  {code: "5128-22", description: "Bastão fibra de carbono telescopico, de 3 alturas, marca Seco.  A 3 Posições de Fibra de Carbono snap-Lock Rod Rover apresenta um design inovador.   É mais rápido e mais amigável (em comparação aos tradicionais de duas peças, parafuso-junto varetas).    É um bastão ideal para todos os levantamentos GPS RTK.    Os telescópios haste e pode travar em três alturas diferentes, 2 m, 1,8 m ou 1,6 m.    Dois sistemas de bloqueio são destaques na haste: O snap-lock garante não escorregar eo bloqueio de compressão centros do interior telescópica e mantém retidão.    Ele inclui um de 40 minutos, frasco ajustável circular.    A fibra de carbono é forte, resistentes a impactos e tem um coeficiente de 'zero' de expansão.    Ele pesa 1,75 £ (0,79 kg)", name: "BASTÃO FIBRA CARBONO 3 ALTURAS", manufacturer: "SECO", price: "1819.0", price_3x: "606.0", price_30_days: "1759.0", price_cash: "1729.0", rev_icms18: "1549.0", rev_icms12: "1469.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
