  {code: "010-C1062-20", description: "Mapa de navegação marítima de toda a Costa Leste da América do Sul  A cartografia marítima MapSource™ BlueChart é exclusivamente compatível com aparelhos da Garmin. Contém informação de linha de costa, profundidade, barcos e objectos afundados, zonas de perigo, marinas e toda a informação necessária para navegação marítima em segurança.  Principais características:  - Funções de gestão de pontos e da viagem;  - Cartas náuticas electrónicas detalhadas para várias regiões pré-definidas numa área específica – seleccione abaixo a área marítima que pretende, caso não apareça na listagem, entre em contacto com a Loja;  - Zonas entre batimétricas sombreadas e zonas entre-marés com sondagens locais;  - Ajudas à navegação com visualização de escala e cobertura;  - A informação na carta (nome da carta, número, escala, data de revisão, e último Aviso à Navegação);  - Destroços, áreas restritas, áreas de cabos submarinos, fundeadouros, escolhos, e áreas de despejos;  - A versão americana contém tabelas de maré e marinas.", name: "BlueChart G2 Costa Leste", manufacturer: "GARMIN BR", price: "-1.0", price_3x: "0.0", price_30_days: "-1.0", price_cash: "-1.0", rev_icms18: "-1.0", rev_icms12: "-1.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-C1062-00", description: "Mapa de navegação marítima de toda a Costa Leste da América do Sul  Baseado nas funcionalidades padrão do BlueChart g2, o BlueChart g2 Vision proporciona capacidades premium de gráficos e de mapeamento.   A Orientação Automática apresenta um caminho visual que evita pontes baixas, águas pouco profundas e outras obstruções cartografadas. Tal permite-lhe viajar para o seu destino com toda a tranquilidade. Mas a Orientação Automática é ainda mais extraordinária quando está ligada a um sistema de piloto automático Garmin.  Principais características:  - Funções de gestão de pontos e da viagem;  - Cartas náuticas electrónicas detalhadas para várias regiões pré-definidas numa área específica – seleccione abaixo a área marítima que pretende, caso não apareça na listagem, entre em contacto com a Loja;  - Zonas entre batimétricas sombreadas e zonas entre-marés com sondagens locais;  - Ajudas à navegação com visualização de escala e cobertura;  - A informação na carta (nome da carta, número, escala, data de revisão, e último Aviso à Navegação);  - Destroços, áreas restritas, áreas de cabos submarinos, fundeadouros, escolhos, e áreas de despejos;  - A versão americana contém tabelas de maré e marinas.", name: "BlueChart G2 Vision AS CLeste", manufacturer: "GARMIN BR", price: "-1.0", price_3x: "0.0", price_30_days: "-1.0", price_cash: "-1.0", rev_icms18: "-1.0", rev_icms12: "-1.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "8120-30-ORG", description: "Bolsa mochila almofadada, p/ acondicionamento de estação total.  A Mochila é projetada para transportar de forma segura uma estação total ou teodolito. A sua criação foi baseada em projetos populares para que ele não seja apenas confiável, mas confortável.   O compartimento principal possui um 'wrap' inovador feito de espuma de alta densidade 3/8-inch com gancho e ajuste laço que os instrumentos de forma segura berços até 15,75 polegadas (400 mm) de altura. As dimensões interiores (entre o wrap) são 16,5 x 8,25 x 6,5 W em D (41,91 x 20,95 x 16,51 centímetros).   O bolso frontal grande pode acomodar todos os controladores ou de tamanho semelhante equipamento.   Os bolsos laterais de altura pode manter garrafas de água, baterias, etc   A mochila é feita de fortes tecidos e resistente à água 420D nylon. Possui tecnologia Outlast, calor longe de seu corpo no verão e ajuda a manter o calor do corpo no inverno.   Feita em Geo de SECO, México   Pesa 1,10 kg", name: "BOLSA MOCHILA P/ ESTAÇÃO", manufacturer: "SECO", price: "1289.0", price_3x: "430.0", price_30_days: "1249.0", price_cash: "1219.0", rev_icms18: "1099.0", rev_icms12: "1039.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
