  {code: " 010-01063-01", description: "Computador de bike para navegação e avaliação de desempenho Recursos conectados¹, como trajeto em tempo real, envio/recebimento de percursos, compartilhamento em redes sociais e previsão do tempo Mapa base integrado e mapas detalhados opcionais Distância, velocidade, subida/descida e posição do GPS Taxa de batimentos cardíacos opcional, velocidade/cadência e potência Transferência de dados sem fio ao Garmin Connect Os perfis das atividades armazenam as preferências de diferentes atividades de ciclismo  Acompanhe cada detalhe Além dos recursos de mapa, o Edge® 810 registra sua distância, as métricas de velocidade, subidas, descidas, ângulos e muito mais. Ele ainda é compatível com sensores ANT+™, que medem a frequência cardíaca, velocidade/cadência e energia. O recurso de perfil da atividade permite que você personalize campos de dados e configurações do dispositivo com base na atividade, como estrada, montanhismo ou passeio. Para mudar o perfil, basta deslizar o dedo pela tela, e o seu dispositivo será configurado para mostrar os dados necessários para aquela atividade.", name: "EDGE 810", manufacturer: "GARMIN BR", price: "1659.0", price_3x: "553.0", price_30_days: "1659.0", price_cash: "1659.0", rev_icms18: "1609.0", rev_icms12: "1529.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "78410-20", description: "O receptor GNSS EPOCH 50 da Spectra Precision, com seus 220 canais, faz uso efetivo dos sinais GPS e GLONASS L1/L2 L1/L2/L2C/L5 para oferecer uma excelente cobertura de satélites e posicionamento preciso. O EPOCH 50 usa sua alta tecnologia para proporcionar um centro de fase extremamente estável e monitoramento dos sinais L2C e L5, os mais recentes.  O receptor EPOCH 50 GNSS com o software de campo Survey Pro fornece ferramentas avançadas para o trabalho das equipes de campo. Com o máximo de estabilidade, precisão, qualidade e facilidade de operação, o EPOCH 50 tem tecnologias comprovadas, e que você pode confiar no dia-a-dia de trabalho.  O receptor GNSS EPOCH 50 tem rádio UHF interno, que possibilita receber ou transmitir sinais, de modo a que cada receptor pode ser usado como base ou rover. Use o rádio interno em um canteiro de obras para uma locação de pontos rápida e fácil. O EPOCH 50 suporta também rádio externo e conexão com modem de celular para acrescentar mais flexibilidade e amplitude ao seu projeto. Além disso, possui comunicação livre de cabos via bluetooth, permitindo a escolha de um dos coletores de dados Spectra Precision para operação.  O EPOCH 50 fornece produtividade e economia, com o uso da tecnologia RTK em rede e operações NTRIP. Conecte-se com os coletores de dados da Spectra Precision e obtenha mais flexibilidade.  Projetado para garantir mais de 99,9% de confiabilidade em inicializações, o receptor GNSS EPOCH 50 proporciona resultados rápidos e de alta qualidade em todos os modos de trabalho suportados. Resultados precisos e consistentes, qualidade de construção e preços acessível fazem do EPOCH 50 a escolha ideal para o seu trabalho.  O Software Spectra Precision Survey Office oferece uma solução completa de escritório para o pós-processamento de dados GNSS e ajustamento. Exporte facilmente seus resultados processados e concluídos de volta para o software de campo ou softwares de desenho, usando uma variedade de formatos de arquivo.  ESPECIFICAÇÕES TÉCNICAS  - Constelação: GPS / GLONASS / Galileo / SBAS  - Frequência: L1/L2/L5  - Canais: 220  - Taxa de atualização: 0,05 seg  - Formato dos dados: sCMRx, CMR, CMR + e RTCM 3.1 - Precisão em tempo real:      RTK (HRMS): 1 cm      DGPS (HRMS): < 30 cm      SBAS (HRMS): < 50 cm - Precisão pós-processada (HRMS): 0,3 mm + 0,5 ppm - Comunicações: UHF, BT, RS-232  - Dimensões: 19,0 x 10,7 x 20,0 cm - Peso: 1,34 kg - Display: LED  - Memória: 64 MB  - Temp. de operação: -40 ° C a 60 ° C - Proteção: IP66 / MIL-STD-810F (choque e vibração)  - Alimentação (tipo - duração): Li-Ion - 4 horas (3 baterias incluídas)  ITENS INCLUSOS:  - 2 receptores EPOCH50 (base/rover) - 1 estojo de transporte - 1 trena 3M - 1 mini bastão extensor - 3 baterias (2.6Ah, 7.4v) - 1 carregador duplo de baterias - 1 cabo do carregador (65W, 19V 3.4Ah, 100-240V AC) - 2 antenas 425-475 MHz", name: "EPOCH 50 GNSS RTK (PAR)", manufacturer: "SPECTRA PRECISION", price: "79649.0", price_3x: "26550.0", price_30_days: "77259.0", price_cash: "75669.0", rev_icms18: "71679.0", rev_icms12: "68099.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
