  {code: "SUMR-30002", description: "Estação Total Spectra Precision FOCUS 30 – 2” – Robótica Coletor de Dados RANGER500X com 2.4Ghz  Apresentamos a poderosa Estação Total Spectra Precision® FOCUS 30 ®. A solução totalmente Robótica Motorizada FOCUS 30 oferece a mesma possibilidade de utilização igual à uma Estação Total convencional, porém com mais velocidade, exatidão e precisão  na medição.  ●Tecnologia StepDrive – A velocidade de observação e a precisão de posicionamento da FOCUS 30 ® é fornecida pela tecnologia de movimento StepDrive (desenvolvida e patenteada pela Spectra Precision). O StepDrive controla o movimento horizontal e vertical por meio de motores, por isso não há necessidade de bloqueios de movimento tradicional. Usando as unidades motorizadas, é possível estabelecer as medições com rapidez, e repeti-las se necessário com grande precisão. Isso resulta em medições rápidas e confiáveis, o que aumenta substancialmente a sua produtividade no campo. ●Tecnologia LockNGo – A FOCUS 30 ® possui um sensor de monitoramento que utiliza a tecnologia de rastreamento LockNGo, permitindo que a estação total acompanhe o prisma automaticamente em todos os momentos, evitando que o operador tenha que voltar, reduzindo o tempo final da medição. Para manter o contato com o operador que está com o bastão e o prisma, a FOCUS 30 ® utiliza uma comunicação via rádio de 2,4Ghz. Uma vez que as comunicações foram estabelecidas, todas as funções da FOCUS 30 ® podem ser controladas a distância, tornando possível que você possa realizar medições com alta precisão ou até levantamentos topográficos sozinhos.  ●Software Spectra Precision Survey Pro® ●Alta precisão com medidas através do prisma ●Longo alcance de medição sem-prisma ●Software assistente GeoLock ●Três modelos com precisão de 2”, 3” e 5” ●Qualidade Spectra Precision  Medição do angulo Precisão (Padrão norma ISO 17123-3): 2”(0,6mgon).  Leitura de ângulo (contagem mínima): Padrão 1”( 0,1mgon) Monitoramento- 2\" (0,5mgon)  Pr