  {code: "010-10998-00", description: "Medidor de passos Garmin Foot Pod cod. 010-10998-00. Sensor sem-fio que calcula a velocidade e distância de corrida e envia os dados ao Forerunner.  Compatível com os modelos:  Forerunner® 305 Forerunner® 505 Forerunner® 50 FR60", name: "FOOT POD P/FORERUNNER 305/405", manufacturer: "GARMIN IMPORTADO", price: "509.0", price_3x: "170.0", price_30_days: "509.0", price_cash: "459.0", rev_icms18: "509.0", rev_icms12: "479.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00658-30", description: "O Forerunner 405CX é a evolução do treinamento com GPS. Este compacto relógio esportivo registra a sua distância, ritmo e batimento cardíaco e então envia os dados sem fios ao seu PC para posterior análise. O 405CX permite o cálculo das calorias baseado no batimento cardíaco e vem com uma segunda opção de pulseira adequada para os pulsos menores.  Veja os Resultados Incorporando funções avançadas de treinamento, o Forerunner 405CX continuamente grava o seu tempo, distância, ritmo, calorias queimadas e freqüência cardíaca. Cada treino é armazenado na memória, assim você poderá rever e analisar os dados para ver o quanto você  evoluiu. Funções avançadas de treinos desafiarão você para aumentar o seu ritmo correndo contra o Forerunner Virtual Partner® (companheiro virtual) para melhorar os seus tempos ou definir intervalos de treinos sem ter que circular a pista. Você poderá até descarregar percursos gravados para competir contra treinos anteriores. Para usar o relógio,  simplesmente toque no aro para mudar as telas sem se aborrecer com botões.  Registre o Batimento Cardíaco O Forerunner 405CX vem acompanhado de um monitor de batimento cardíaco flexível e sem fios para ajudá-lo na maioria dos seus treinos. Este monitor digital continuamente registra as batidas por minuto do seu coração e utiliza estes dados para calcular as calorias queimadas. Treine em uma certa zona de batimento cardíaco para aperfeiçoar o seu nível de aptidão ou comparar o seu ritmo e a freqüência cardíaca para melhorar o desempenho na mesma corrida.  Compartilhe sem Fios os seus Treinos  Com o Forerunner 405CX, você poderá compartilhar as suas localizações, treinamentos avançados e percursos, sem fios, com outros usuários de Forerunner 405. Envie o seu treinamento favorito para seus amigos testarem ou para você competir contra o percurso gravado de alguém. O compartilhamento dos dados é fácil: simplesmente selecione \"transferir\" para enviar as suas informações para um dispositivo próximo.  Corra, Sincronize, Armazene e Compartilhe Uma vez que você tenha gravado quilômetros de treinamentos, a tecnologia sem fios ANT+™ automaticamente transferirá os dados para o seu computador quando o Forerunner estiver dentro do alcance. Sem cabos e sem embaraços, os dados estarão lá prontos para serem analisados, classificados e compartilhados através da nossa comunidade \"online\" -  Garmin Connect ou nosso programa opcional Garmin Training Center™. Você poderá até mesmo planejar treinamentos no seu computador e depois enviá-los para o seu Forerunner.  Treine o Ano Todo Leve os seus treinos para dentro de casa com o versátil Forerunner 405CX e os acessórios opcionais sem fios. Sincronize-o com um sensor opcional de passos para registrar a sua velocidade, distância e cadência de corrida \"indoors\" quando os sinais GPS estiverem indisponíveis. O sensor de passos sem fios fixa-se no cadarço do seu calçado para fácil remoção e automaticamente liga quando você iniciar movimentos. Você ainda pode sincronizar  o seu Forerunner com um sensor opcional de velocidade/cadência para bicicleta e registrar a velocidade e a distância dos seus treinos de ciclismo.  Acessórios incluídos com o Forerunner 405 CX: * Adaptador USB ANT™ * Monitor de batimento cardíaco * Duas Pulseiras adicionais * Carregador CA (de parede) * Conector (clip) de recarga * Manual do proprietário em disco * Guia de referência rápida", name: "Forerunner 405CX", manufacturer: "GARMIN IMPORTADO", price: "1049.0", price_3x: "350.0", price_30_days: nil, price_cash: "1049.0", rev_icms18: "1049.0", rev_icms12: "999.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00741-21", description: "Forerunner® 910XT da GARMIN, procedência Americana.  Você nada. Você pedala. Você corre. Você é obcecado por dados e detalhes. Nós também. E acabamos de aperfeiçoar seu novo parceiro de treinamento. Forerunner 910XT é o único dispositivo habilitado com GPS que fornece medições detalhadas de nado, registra distância, ritmo, elevação e frequência cardíaca¹ para corredores e ciclistas. É elegante e possui uma confortável pulseira e um visor de fácil leitura. Mergulhe de cabeça Desenvolvido para a prática de natação em piscina e mar aberto, o Forerunner 910XT é resistente à água até 50 m (164 pés). É nosso primeiro GPS de pulso poliesportivo a oferecer medições para a prática de natação, incluindo distância, identificação do tipo de nado, contagem e comprimento das piscinas. Ele também computa sua pontuação ajudando você a avaliar sua eficiência na prática de natação. O design robusto e a fácil operação do 910XT, o torna perfeito para outros esportes aquáticos, incluindo Paddle Board. Por ser habilitado com GPS, o Forerunner 910XT captura até mesmo o caminho viajado para que você visualizá-lo mais tarde em nossa comunidade gratuita, Garmin Connect™. Este recurso pode ajudá-lo a analisar sua prática em mar aberto e fazer os ajustes necessários a sua técnica. Transição tranquila Seja em um treinamento ou em uma competição real, cada segundo é importante. Por isso, o 910XT facilita a transição entre os esportes. O recurso poliesportivo automático permite que você troque o modo de cada esporte em apenas um toque, para que você não perca segundos preciosos nessa transição. A montagem com desengate rápido facilita que você mude o 910XT de seu pulso para a bicicleta sem fazer esforço Experimente-o também em terra firma Em terra firme, o Forerunner 910XT oferece diversos recursos dos avançados computadores para ciclismo e dos GPS de pulso esportivos da Garmin, para capturar com precisão o tempo, a distância, a velocidade, o ritmo e muito mais. O 910XT é nosso primeiro GPS de pulso poliesportivo a incorporar um altímetro barométrico para mostrar precisos dados de elevação, incluindo subidas, descidas e a gradação. Campos de dados configuráveis permitem que você personalize diversas páginas de treinamento para cada esporte. Configure alertas vibratórios para receber avisos sempre que fizer uma volta, quando for a hora de comer ou se precisar de um feedback para não perder de vista os seus objetivos. Com esses recursos de alto nível, além de 20 horas de duração da bateria, o 910XT é ideal para atletas em treinamento para triatlo para provas Ultraman ou Ironman.  ESPECIFICAÇÃO: Físico e desempenho: Dimensões da unidade, LxAxP:  5,4 x 6,1 x 1,5 cm (2,1\" x 2,4\" x 0,6\") Tamanho do visor, LxA:  1,3\" x 0,8\" (3,3 x 2,0 cm) Resolução do visor, LxA:  160 x 100 pixels Tela sensível ao toque:  não Peso:  2,5 oz. (72 g) Bateria:  íons de lítio recarregáveis Duração da bateria:  até 20 horas Resistente à água:  sim (50 m) Habilitado com GPS:  sim Receptor de alta sensibilidade:  sim Mapas e memória: Mapa base:  não Capacidade de incluir mapas:  não Aceita cartões de dados:  não Histórico de voltas:  1.000 voltas Paradas/Favoritos/Localizações:  100 Rotas:  0 Características: Monitor de batimentos cardíacos:  sim (algumas versões) Sensor de velocidade/cadência de bicicleta:  sim (opcional) Contador de passos:  sim (opcional) Sincronização automática (transfere automaticamente os dados para o seu computador):  sim Compatível com Garmin Connect™ (comunidade on-line onde é possível analisar, categorizar e compartilhar dados):  sim Virtual Partner® (treinar contra um competidor digital):  sim Virtual Racer™ (compete against other activities):  sim Percursos (competir contra atividades anteriores):  sim Auto Pause® (pausar e retomar o timer com base na velocidade):  sim Auto Lap® (iniciar automaticamente uma nova volta):  sim Rolagem automática (virar as páginas de dados durante o exercício):  sim Esportes múltiplos (alterar a modalidade do esporte com o simples toque de um botão):  sim Exercícios avançados (criar exercícios personalizados com base nas metas):  sim Alerta de ritmo (acionar um alarme quando há variação do ritmo pré-definido):  sim (somente para exercícios avançados) Alerta de tempo/distância (acionar um alarme quando atingir o objetivo):  sim Alerta de vibração: (escolha entre tons de alerta/ou alerta de vibração).:  sim Treinamento nos intervalos (definir exercícios e descanso nos intervalos):  sim Computação de calorias com base na freqüência cardíaca:  sim Swim metrics (stroke type, stroke count and pool lengths):  sim Training Effect (measures impact of an activity on your aerobic fitness):  sim Tela(s) personalizável (personalizáveis):  sim Altímetro barométrico:  sim Transferência unidade a unidade (compartilha dados sem fio com unidades similares):  não Compatível com medidor de energia (exibe dados de forças de terceiros compatíveis com os medidores de energia ANT+™ habilitados):  sim (registra dados aproximadamente 1 por segundo) Temperatura (apresenta e grava a temperatura enquanto conduz):  não Shock Resistant:  sim Relógio esportivo:  não Adicional:  Medidor para a prática de natação (tipo de nado, contagem e comprimento das piscinas): sim                 O Garmin Connect é compatível com Windows® XP ou superior e PowerPC e MAC baseado em Intel que execute OS 10.4 ou superior com Safari.", name: "Forerunner 910 XT", manufacturer: "GARMIN BR", price: "1749.0", price_3x: "583.0", price_30_days: "1749.0", price_cash: "1749.0", rev_icms18: "1699.0", rev_icms12: "1609.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00777-00", description: "O Foretrex 401 é um fino navegador GPS de pulso, perfeito para actividades ao ar livre que exigem o uso das duas mãos. O Foretrex 401 combina um receptor de GPS de alta sensibilidade à prova de água, uma bússola electrónica e um altímetro barométrico num dispositivo leve ideal para caminhantes, esquiadores, campistas e militares. Para partilhar os dados facilmente, pode ligar o Foretrex ao seu computador por USB ou simplesmente enviar os dados sem fios para outro dispositivo.  \"Registe\" os seus passos Onde quer que a aventura o leve, nunca se irá preocupar em ficar perdido com o Foretrex 401. O Foretrex regista o seu caminho e apresenta-o como um trilho pontilhado no ecrã. Basta ligar a funcionalidade TracBack® do Foretrex e pode traçar de volta o seu caminho até onde começou. Registe o seu rumo e altitude com a bússola electrónica e o altímetro barométrico do Foretrex 401. Pode guardar localizações na memória, como pontos de passagem para que possa sempre encontrar o caminho de volta para um local importante, como o seu parque de campismo ou veículo. Além disso, tem até 17 horas de vida útil da bateria e pilhas AAA substituíveis.  Controle os seus dados O Foretrex 401 permite-lhe criar e guardar rotas para todos os seus locais favoritos e fornece outras informações úteis, incluindo um computador de viagem, nascer-do-sol/pôr-do-sol e informações sobre caça e pesca. Para obter ainda mais dados, ligue o Foretrex 401 a um acessório sem fios, como um sensor de ritmo cardíaco, sensor de cadência ou prenda-o na sua bicicleta com o suporte de montagem em bicicleta. Para manter o registo da sua viagem, ligue o seu Foretrex ao seu PC ou Mac® por USB para guardar os pontos de passagem, rotas e trajectos no seu computador. Também pode partilhar pontos de passagem, rotas e trajectos sem fios com certos dispositivos Foretrex, Oregon® e Colarado® e também é compatível com os sensores de ritmo cardíaco Garmin e sensores de cadência.  Foretrex 401: navegação simples sempre à mão.  ", name: "FORETREX 401", manufacturer: "GARMIN BR", price: "999.0", price_3x: "333.0", price_30_days: "999.0", price_cash: "969.0", rev_icms18: "899.0", rev_icms12: "849.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00743-21", description: "FR® 60 Registre cada quilômetro e cada minuto com o FR60, um relógio esportivo esguio com uma ferramenta de exercícios que grava o seu tempo, batimento cardíaco e calorias queimadas. Quando conjugado com o contador de passos (foot pod) sem fio, o FR60 também registra velocidade e distância, em ambientes fechados ou ao ar livre. Então, o FR60 transferirá, sem fio, os dados do seu exercício ao seu computador para análise posterior. Treine em Ambientes Fechados ou ao Ar Livre Na academia ou na rua, o FR60 registrará os dados do seu exercício, incluindo tempo, batimento cardíaco, calorias queimadas, tempos das voltas, médias e mais. O FR60 possuí avançadas ferramentas para treinos, como alarmes de exercícios e o Virtual Partner™ (companheiro virtual), que permite que você corra contra um treinador virtual para aperfeiçoar o seu desempenho. O maior sucesso do FR60 é a tecnologia sem fio ANT+™, que permite conectá-lo a outros dispositivos compatíveis ANT+, como o monitor de batimento cardíaco incluído, o opcional contador de passos (foot pod) ou mesmo equipamentos de “fitness” compatíveis com o ANT+. Escolha o Seu Modelo Homens e mulheres podem treinar igualmente, mas eles podem ter diferentes preferências quanto ao estilo do relógio. Desta forma, oferecemos versões masculinas e femininas do FR60 que diferem apenas nas opções de tamanho e cores. O modelo masculino, que pesa 45,36 gramas, tem a cor preta ou a cor vermelha sobre preto. O modelo feminino pesa 39,69 gramas e tem a cor preta ou lilás. Conheça a Distância Com a conexão sem fio ANT+, o FR60 conecta-se ao contador de passos (foot pod) opcional, que registra a sua distância e a sua velocidade, tanto em ambientes fechados como em ambientes externos. Usando uma avançada tecnologia com acelerômetro, o contador de passos coleta e envia dados precisos sobre os seus movimentos, obtendo os dados de distância e velocidade com precisão de 98 porcento, direto da embalagem e sem configurações. Acompanhe o Seu Coração O FR60 também se conecta sem fio a um monitor de batimento cardíaco digital, leve e flexível, proporcionando conhecimento instantâneo de como está o seu treino. O FR60 registra continuamente os batimentos cardíacos por minuto e exibe a sua zona de freqüência cardíaca. Assim você poderá monitorar e aperfeiçoar o seu nível de aptidão física. Treino Cruzado Quando conectado com um sensor opcional de velocidade/cadência, o FR60 registra a velocidade e a distância dos seus treinos de ciclismo. Este sensor sem fio é instalado seguramente na sua bicicleta e mede a sua cadência de pedaladas e a velocidade da roda enquanto você estiver andando com a bicicleta. Você poderá usá-lo mesmo nos treinos em ambientes fechados porque o sensor é instalado na roda traseira da sua bicicleta. Sincronize e Compartilhe Depois que você coletou os dados dos treinos, o FR60 transferirá automaticamente os dados ao seu PC ou Mac, sem fio e quando estiver próximo. Sem cabos e sem aborrecimentos. Os dados estarão lá, prontos para você analisar, classificar e compartilhar através da nossa comunidade online Garmin Connect.", name: "FR60 (VERMELHO/PRETO)", manufacturer: "GARMIN IMPORTADO", price: "419.0", price_3x: "140.0", price_30_days: "399.0", price_cash: "369.0", rev_icms18: "419.0", rev_icms12: "399.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
