  {code: "GeoOffice Basico", description: "Software Topográfico GeoOffice Bas I) Módulo Básico 1) CAD CAD próprio, com interface e recursos semelhantes aos do AutoCAD\u0001 e com recursos específicos para topografia; 2) Comunicação com aparelhos de GPS de Navegação Comunicação com a maioria dos aparelhos GPS de Navegação (Garmin e Magellan); 3) Cadernetas Permite edição de dados em diversos tipos de cadernetas Topográficas, Nivelamento, Geodésica, Cálculo Automático de Coordenadas e Geodésia na mesma planilha; 4) Poligonais Cálculo automático de poligonais e suas irradiações; Método Projeções, Proporcional às Distâncias e também o Método dos Mínimos Quadrados (MMQ); 5) Cálculos de Áreas Cálculo de áreas por pontos, entidades, ponto de giro e divisão por paralela; 6) Divisão de áreas e memoriais Divisão de áreas tomando-se por base um ponto ou alinhamento de referência, geração automática de memoriais descritivos e tabelas no desenho; 7) Reconstituição de memoriais Reconstituição de áreas através de memoriais descritivos informando-se as distâncias e os azimutes, rumos ou deflexões; 8)Auto Croqui Faz a ligação dos pontos do desenho automaticamente, obedecendo uma ordem; 9) MDT Modelagem digital do terreno que permite a interpolação dos pontos; 10) Traçado de curvas de nível Traçado automático de curvas de nível e ferramenta para rotular curvas com a cota; 11) Loteamento Rual Divisão de áreas em várias partes, configurações de tamanho, testada dos lotes e relatórios de Memorial de cada Lote.  • Comunicação com a maioria das Estações Totais; • Importa e exporta dados em diversos formatos, como ASCII, FBK, DXF, DWG, DGN e SHP. • Compatível com Windows\u0001 2000 e XP e VISTA; • Chave de proteção para uso em porta USB. (com garantia eterna); • Atualizador automático e gratuito da mesma Versão.  OBS: SERÁ FATURADO O HARDLOCK COMO VENDA NO VALOR DE R$ 80,00 E O RESTANTE COMO PRESTAÇÃO DE SERVIÇO DE USO DO SOFTWARE - ISS- 2%", name: "GEOOFFICE V2 BASICO", manufacturer: "SOL