nados em Banco de Dados para uso como Variáveis nos relatórios e na folha do desenho. Processo que elimina a repetição de cadastro de dados;  \u0095 Cria de forma automática e controla todas as Camadas (layers) exigidas pelo INCRA com suas configurações de cor e espessura de linhas; \u0095 Calcula a Escala do Projeto e insere a Folha de Impressão com a Malha de Coordenadas de forma automática de acordo com o Formato da Folha escolhida; \u0095 Gera a Planta de Situação de forma automática com base nas coordenadas do projeto usando o Google Maps; \u0095 Permite mostrar o projeto automaticamente no Google Earth e também importa arquivos como Polígonos em *KML e *KMZ do mesmo; \u0095 Cria os relatórios exigidos como: Memorial Descritivo, Monografia de Marco, Tabela de Dados Cartográficos, Requerimento para Certificação, Solicitação de Anuência C7 para Áreas Inacessíveis e Áreas Ambientais, Declaração de Respeito de Limites, Planilha de Cálculo de Área e também o Memorial Descritivo Tabular para uso de acordo com as normas da Amazônia Legal. \u0095 Gera o novo relatório exigido pelo SIGEF (formato *.ods) com todos os dados de todas as Glebas (parcelas) preenchidos automaticamente. \u0095 Cria um Polígono de cada Gleba (desenho) com referencia no SGL, bem como o Memorial expedido pelo SIGEF, com Latitudes, Longitudes, Distâncias e Azimutes em SGL. \u0095 Exporta SHP de acordo com os padrões exigidos pelo SICAR / CAR, para os trabalhos de registro ambiental   OBS: SERÁ FATURADO O HARDLOCK COMO VENDA NO VALOR DE R$ 80,00 E O RESTANTE COMO PRESTAÇÃO DE SERVIÇO DE USO DO SOFTWARE - ISS- 2%", name: "GEOOFFICE V2 BASICO + GEORREFERENCIAMENTO", manufacturer: "SOLUTION SOFTWARES", price: "2509.0", price_3x: "836.0", price_30_days: "2509.0", price_cash: "2459.0", rev_icms18: "2459.0", rev_icms12: "2339.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, sta