  {code: "geo-edu1", description: "Software Topográfico GeoOffice Bas+Top+Proj+Vias I) Módulo Básico 1) CAD CAD próprio, com interface e recursos semelhantes aos do AutoCAD\u0001 e com recursos específicos para topografia; 2) Comunicação com aparelhos de GPS de Navegação Comunicação com a maioria dos aparelhos GPS de Navegação (Garmin e Magellan); 3) Cadernetas Permite edição de dados em diversos tipos de cadernetas Topográficas, Nivelamento, Geodésica, Cálculo Automático de Coordenadas e Geodésia na mesma planilha; 4) Poligonais Cálculo automático de poligonais e suas irradiações; Método Projeções, Proporcional às Distâncias e também o Método dos Mínimos Quadrados (MMQ); 5) Cálculos de Áreas Cálculo de áreas por pontos, entidades, ponto de giro e divisão por paralela; 6) Divisão de áreas e memoriais Divisão de áreas tomando-se por base um ponto ou alinhamento de referência, geração automática de memoriais descritivos e tabelas no desenho; 7) Reconstituição de memoriais Reconstituição de áreas através de memoriais descritivos informando-se as distâncias e os azimutes, rumos ou deflexões; 8)Auto Croqui Faz a ligação dos pontos do desenho automaticamente, obedecendo uma ordem; 9) MDT Modelagem digital do terreno que permite a interpolação dos pontos; 10) Traçado de curvas de nível Traçado automático de curvas de nível e ferramenta para rotular curvas com a cota; 11) Loteamento Rual Divisão de áreas em várias partes, configurações de tamanho, testada dos lotes e relatórios de Memorial de cada Lote.  II) Módulo Topografia 12) Geodésia Cálculos de conversão de coordenadas geográficas, UTM, RTM, LTM e Topográficas; 13) Monografia de Marco Confecção de Monografia de Vértices GPS (Marco); 14) Perfil longitudinal Geração de perfil longitudinal de estacas levantadas em campo; 15) Seções transversais Geração de seções transversais de um estaqueamento (Perfil); 16) Georreferenciamento Possibilita fazer cálculo da Poligonal Geodésica, como também se pode criar o Desenho em Coordenadas Topográficas Local ou Coordenadas Planas;  III) Módulo Projetos 17) Visualizador 3D Visualização de um MDT em 3D. Permite suavização e várias configurações; 18) Volume entre superfícies Cálculo de volume entre uma superfície e um plano e/ou entre duas superfícies (primitivo e medição); 19) Greide Traçado de greide no perfil longitudinal e cálculo automático das cotas de projeto; 20) Curvas Verticais Permite a criação e projeções de curvas verticais (PIV) em um greide. Utilizam-se curvas: circular, parábola e parábola composta; 21) Curvas Horizontais Permite a criação e projeções de curvas horizontais (PIH) em um traçado geométrico. Utilizam-se curvas: circular; circular composta; espiral e espiral composta; 22) Seções-tipo Cadastro de seções-tipo e cálculo dos pontos de projeto; 23) Volume entre camadas Volume entre camadas de seções-transversais do Perfil e mais relatório de volume; 24) Mapa de declividades Mapa de declividades de uma superfície, com possibilidade de várias configurações; 25) Platô Cálculo automático dos taludes de corte e aterro, offsets e bermas de um platô.  IV) Módulo VIAS (Estradas) 26) Vias Cálculo de super-elevação, super-largura, curvas de transição horizontal, parábolas compostas verticais, diagrama de massas (Brückner), Cálculo de Dimensionamento da Pavimentação. Relatórios de Notas de Serviço de Terraplenagem, Locação de Eixo, Bordas e Offset.  • Comunicação com a maioria das Estações Totais; • Importa e exporta dados em diversos formatos, como ASCII, FBK, DXF, DWG, DGN e SHP. • Compatível com Windows\u0001 2000 e XP e VISTA; • Chave de proteção para uso em porta USB. (com garantia eterna); • Atualizador automático e gratuito da mesma Versão.   OBS: SERÁ FATURADO O HARDLOCK COMO VENDA NO VALOR DE R$ 80,00 E O RESTANTE COMO PRESTAÇÃO DE SERVIÇO DE USO DO SOFTWARE - ISS- 2%", name: "GEOOFFICE V2 EDUCACIONAL - CHAVE INDIVIDUAL", manufacturer: "SOLUTION SOFTWARES", price: "2999.0", price_3x: "1000.0", price_30_days: "2999.0", price_ca