iar o Desenho em Coordenadas Topográficas Local ou Coordenadas Planas; 17) Visualizador 3D Visualização de um MDT em 3D. Permite suavização e várias configurações; 18) Georreferenciamento (INCRA 3ª edição da Lei Nº. 10.267/01) Importa dados pós processados do GPS, e tem a possibilidade de gerar de forma automática a planta para impressão e os relatórios solicitados para entrega nos formatos vigentes, inclusive a nova planilha do SIGEF em formato *.ODS. 19) SHP (CAR/SICAR) Exporta o Polígono no formato SHP exigido pelo Sistema de Cadastro Ambiental Rural, de acordo com os requisitos formais da Lei Nº. 12.651/12.  • Comunicação com a maioria das Estações Totais; • Importa e exporta dados em diversos formatos, como ASCII, FBK, DXF, DWG, DGN e SHP. • Compatível com Windows XP, VISTA, 7 e 8 (32 e 64 bits); • Chave de proteção para uso em porta USB. (garantia por 5 anos); • Atualizador automático e gratuito da mesma Versão. ", name: "GEOOFFICE V2 TOPOGRAFIA + GEORREFERENCIAMENTO", manufacturer: "SOLUTION SOFTWARES", price: "2969.0", price_3x: "990.0", price_30_days: "2969.0", price_cash: "2909.0", rev_icms18: "2909.0", rev_icms12: "2759.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00258-62", description: "O sensor GPS 16X-LVS apresenta um receptor de alta sensibilidade, antena integrada e um design resistente e à prova d'água, o que o torna útil para diversas aplicações OEM. Obtenha dados precisos  Esse receptor de 12 canais de alta sensibilidade rastreia satélites continuamente e informa sua posição exata. Ele também é habilitado para WAAS, podendo determinar sua localização em um raio de 3 metros, sem usar um receptor de sinal DGPS externo. Deixe a interferência para trás  O GPS 16x oferece um excelente desempenho de EMI/RFI. Dessa forma, você pode usá-lo próximo a dispositivos de computação e equipamentos de comunicação sem fio sem se preocupar com interferência.  O GPS 16x é um sensor GPS de alta sensibilidade que substitui o GPS 16.", name: "GPS  16X-LVS", manufacturer: "GARMIN BR", price: "609.0", price_3x: "203.0", price_30_days: nil, price_cash: "579.0", rev_icms18: "549.0", rev_icms12: "519.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00321-31", description: "O GPS 18x é um sensor GPS de alta sensibilidade OEM para uso em aplicações automotivas, de veículos de frota e eletrônicas que exigem um receptor GPS pequeno e altamente preciso.  Use em espaços pequenos  Esse receptor GPS de alta sensibilidade, com recurso WAAS e 12 canais paralelos, está disponível em versões de nível serial CMOS ou USB 2.0 em velocidade total e possui uma base magnética integrada. Esse receptor em forma de disco de hóquei possui 2,4 polegadas de diâmetro e pesa poucas gramas, o que faz dele uma solução ideal para aplicações onde o espaço é limitado.  Escolha o tipo de conexão  O GPS 18x é fornecido com três configurações de cabo diferentes. Todas essas versões do GPS 18x possuem memória não volátil para o armazenamento de informações de configuração, um relógio de tempo real e dados de medida não processados para aplicações sofisticadas dos clientes.  GPS 18x PC — possui um conector serial de pinos DB-9 com adaptador de isqueiro de 12 volts e pode produzir dados em formato NMEA 0183 (padrão do setor) ou no formato proprietário da Garmin. GPS 18x USB — possui um conector USB estilo A, compatível com hosts USB 2.0 e 1.1 em velocidade total e pode produzir dados somente no formato proprietário da Garmin. GPS 18x LVC — possui fio nu para realizar conexões em diversas aplicações e pode produzir dados no formado NMEA 0183 (padrão do setor) ou no formato proprietário da Garmin. Oferece saída de nível lógico em pulsos por segundo com extremidade ascendente alinhada para até 1 micro-segundo do tempo UTC. O GPS 18x OEM é um sensor GPS de alta sensibilidade que substitui o GPS 18 OEM.", name: "GPS 18X USB", manufacturer: "GARMIN BR", price: "369.0", price_3x: "123.0", price_30_days: "369.0", price_cash: "369.0", rev_icms18: "309.0", rev_icms12: "299.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
