  {code: "010-00829-13", description: "GPS EDGE 500 RED da GARMIN. Aprimore seu desempenho de ciclismo com o Edge 500, um computador de ciclismo leve, com base em GPS, para ciclistas focados no desempenho. Carregado com dados, o Edge 500 rastreia distância, velocidade, localização e elevação com um GPS de alta sensibilidade. Adicione um monitor cardíaco compatível com ANT+™, sensor de velocidade/cadência ou um medidor de potência compatível, para obter uma análise detalhada do seu percurso.  Adiante o seu treinamento  O Edge 500 é facilmente encaixado na haste ou no guidão de sua bicicleta com seu discreto suporte para bicicleta. O Edge é facilmente preso ao suporte por rosqueamento. Quando estiver pronto para partir, basta ligar o Edge, adquirir os satélites GPS e ir. O Edge 500 possui um receptor GPS de alta sensibilidade com previsão por satélite HotFix™ para calcular sua posição mais rapidamente.  Obtenha os dados de que precisa  Enquanto você pedala, o Edge 500 mede a velocidade, a distância, o tempo, as calorias queimadas, a altitude, as subidas e as descidas, e também grava esses dados, para que você possa visualizá-los. Para obter dados de subida e descida ainda mais precisos, o Edge 500 também incorpora um altímetro barométrico para detectar mudanças de elevação.  Todas as versões do Edge 500 trabalham com medidores de alimentação de terceiros habilitados para ANT+, para exibir a saída de potência em watts durante o percurso. Esses importantes dados mostram o esforço feito, independentemente das condições que afetam o percurso, para que você possa treinar de forma inteligente. Algumas versões também incluem um monitor cardíaco digital e um sensor de velocidade/cadência.  Outros recursos de treinamento úteis incluem um recurso de Percursos, que ajuda a comparar viagens sucessivas na mesma rota, assim como Auto Pause, Auto Lap e leituras de temperatura. O Edge também o alerta se você estiver se movendo sem que o timer esteja ligado.  Monitore sua freqüência cardíaca  Usado em conjunto com um monitor cardíaco Garmin, o Edge 500 monitora seus batimentos por minuto e usa sua freqüência cardíaca para computação avançada de calorias, para que você possa saber quantas calorias está queimando. Treine em uma determinada zona de freqüência cardíaca, para melhorar seu nível de condicionamento ou compare seu ritmo ou freqüência cardíaca a um desempenho anterior do mesmo percurso.  Analise seu percurso  Após terminar o percurso, conecte o Edge 500 ao seu computador com o cabo USB incluído para analisar seu desempenho. Com um simples clique, você pode acessar uma rede mundial de ciclistas e entusiastas de atividades ao ar livre, o Garmin Connect™, um site completo para análise e compartilhamento de dados.  Conteúdo da caixa:  Edge 500 (Red Combo)  Edge 500 Monitor Cardíaco Premiun Sensor de Velocidade e Cadência (GSC10) Suporte para bicicleta Carregador CA Cabo USB Manual do proprietário em disco Manual de início rápido  Dimensões da unidade, LxAxP  1,9\" x 2,7\" x 0,85\" (4,8 x 6,9 x 2,2 cm) Tamanho do visor, LxA  1,17\" x 1,44\" (3,0 x 3,7 cm) Resolução do visor, LxA  128 x 160 pixels Tela sensível ao toque  Não Peso  2 oz. (56,7 g) Bateria  íons de lítio recarregável Duração da bateria  até 18 horas Resistente à água  Sim (IPX7) Habilitado com GPS  Sim Receptor de alta sensibilidade  Sim Mapas e memória: Mapa base  Não Capacidade de incluir mapas  Não Aceita cartões de dados  não Histórico de voltas  1.000 voltas (depende do uso da memória) Paradas/Favoritos/Localizações  0 Rotas  0 Funcionalidades e Vantagens: Monitor de batimentos cardíacos  Sim (algumas versões) Sensor de velocidade/cadência de bicicleta  Sim (algumas versões) Contador de passos  Não Sincronização automática (transfere automaticamente os dados para o seu computador)  Não Compatível com Garmin Connect™ (comunidade on-line onde é possível analisar, categorizar e compartilhar dados)  Sim Virtual Partner® (treinar contra um competidor digital)  productTemplate.tab.specs.picklist.yes_(within_a_course) Virtual Racer™ (compete against other activities)  Não Percursos (competir contra atividades anteriores)  Sim Auto Pause® (pausar e retomar o timer com base na velocidade)  Sim Auto Lap® (iniciar automaticamente uma nova volta)  Sim Rolagem automática (virar as páginas de dados durante o exercício)  Sim Esportes múltiplos (alterar a modalidade do esporte com o simples toque de um botão)  Não Exercícios avançados (criar exercícios personalizados com base nas metas)  Sim Alerta de ritmo (acionar um alarme quando há variação do ritmo pré-definido)  Não Alerta de tempo/distância (acionar um alarme quando atingir o objetivo)  Sim Alerta de vibração: (escolha entre tons de alerta/ou alerta de vibração).  Não Treinamento nos intervalos (definir exercícios e descanso nos intervalos)  Sim Computação de calorias com base na freqüência cardíaca  Sim Training Effect (measures impact of an activity on your aerobic fitness)  Não Tela(s) personalizável (personalizáveis)  Sim Altímetro barométrico  Sim Transferência unidade a unidade (compartilha dados sem fio com unidades similares)  Não Compatível com medidor de energia (exibe dados de forças de terceiros compatíveis com os medidores de energia ANT+™ habilitados)  Sim (grava os dados aprox. 1 por segundo) Temperatura (apresenta e grava a temperatura enquanto conduz)  Sim Relógio esportivo  Não ", name: "GPS EDGE 500 RED COMBO (CINTA+GSC10)", manufacturer: "GARMIN BR", price: "1319.0", price_3x: "440.0", price_30_days: nil, price_cash: nil, rev_icms18: "1279.0", rev_icms12: "1219.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00970-00", description: "Somente a Garmin poderia aprimorar o eTrex. O novo eTrex 10 mantém a funcionalidade principal, a arquitetura robusta, acessibilidade e a longa vida útil de bateria que tornaram o eTrex o mais confiável dispositivo GPS disponível. Melhoramos a interface do usuário e acrescentamos um mapa base mundial, geocaching informatizado e suporte para acessórios de montagem. Você irá reconhecer o nome. Você irá reconhecer a qualidade. Mas o eTrex 10 é um dispositivo totalmente novo – um dispositivo que somente a Garmin poderia oferecer.   Veja o caminho  O eTrex 10 possui um visor aprimorado monocromático 2.2 que facilita a leitura em qualquer condição de iluminação. Durável e à prova d'água, o eTrex 10 foi projetado para resistir aos elementos. Sua interface de fácil utilização permite que você passe mais tempo aproveitando a natureza e menos tempo buscando informações. O eTrex possui uma resistência incrível, construída para resistir aos elementos, seja poeira, sujeira, umidade ou água, nenhum desses é páreo para esse célebre navegador.  Divirta-se  O eTrex 10 suporta arquivos GPX da geocaching para fazer download de geocaches e detalhes diretamente para a sua unidade. Visite o site OpenCaching.com para começar sua aventura de geocaching. Não utilizando papéis, você não só ajuda o meio ambiente, mas aumenta sua eficiência. O eTrex 10 armazena e exibe informações importantes, incluindo localização, terreno, dificuldade, dicas e descrições, o que significa que não é mais necessário inserir coordenadas manualmente e levar folhas impressas. Basta carregar o arquivo GPX em sua unidade e começar a busca por caches.  Mantenha sua posição  Com seu receptor GPS habilitado para WAAS de alta sensibilidade e previsão por satélite HotFix®, o eTrex 10 localiza sua posição de forma rápida e precisa e mantém sua localização por GPS mesmo em florestas densas e vales profundos. A vantagem é clara — se você estiver em florestas muito densas ou próximo a prédios e árvores altas, o eTrex 10 pode ajudar você a encontrar o caminho desejado nas horas de maior necessidade.  Seja global  A nova série eTrex é o primeiro tipo de receptor para consumidores da história que tem a capacidade de rastrear satélites GPS e GLONASS simultaneamente. GLONASS é um sistema desenvolvido pela Federação Russa e estará em funcionamento total em 2012. Ao usar satélites GLONASS, o tempo que se leva para o receptor “capturar” uma posição é (em média) aproximadamente 20% mais rápido que usar um GPS. Ao usar ambos (GPS e GLONASS), o receptor tem a capacidade de capturar 24 satélites a mais que usar somente o GPS.   Especificações  Físico e desempenho:  Dimensões da unidade, LxAxP: 2,1\" x 4,0\" x 1,3\" (5,4 x 10,3 x 3,3 cm)  Tamanho do visor, LxA: 1,4\" x 1,7\" (3,6 x 4,3 cm); 2,2\" de diagonal (5,6 cm)  Resolução do visor, LxA: 128 x 160 pixels  Tipo de visor: transflectivo, monocromático  Peso: 5 oz (141,7 g) com baterias  Bateria: 2 baterias AA (não inclusas); recomendável NiMH ou lítio  Duração da bateria: 25 horas  À prova d'água: sim (IPX7)  Flutua: não  Receptor de alta sensibilidade: sim  Interface: USB  Mapas e memória: Mapa base: sim  Mapas pré-carregados: não  Capacidade de incluir mapas: não  Memória interna: não  Aceita cartões de dados: não  Paradas/Favoritos/Localizações: 1000  Rotas: 50  Registro de trajeto: 10.000 pontos, 100 trajetos salvos  Características:  Roteamento automático (roteamento em estradas curva a curva): não  Bússola eletrônica: não  Tela sensível ao toque: não  Altímetro barométrico: não  Câmera: não  Pode ser facilmente usado para geocaching: sim (informatizado)  Compatível com mapas personalizados: não  Navegação por imagens (navega nas fotos geomarcadas): não  Jogos de GPS externo: não  Calendário de caça/pesca: sim  Informações sobre o sol e a lua: sim  Tabelas de marés: sim  Cálculos de área: sim  POIs personalizados (capacidade de incluir outros pontos de interesse): sim  Transferência unidade a unidade (compartilha dados sem fio com unidades similares): não  Visualizador de imagens: não  Compatível com Garmin Connect (comunidade on-line onde é possível analisar, categorizar e compartilhar dados):  Conteúdo da caixa:  eTrex 10 Cabo USB Manual", name: "GPS ETREX 10", manufacturer: "GARMIN BR", price: "549.0", price_3x: "183.0", price_30_days: "549.0", price_cash: "519.0", rev_icms18: "489.0", rev_icms12: "469.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00970-10 BR", description: "O eTrex 20 melhora o dispositivo GPS mais popular e confiável. Ergonomia reprojetada, interface fácil de usar, geocaching informatizado e recursos de mapeamento ampliados adicionados às melhorias de um dispositivo portátil GPS tradicional. O eTrex 20 é versátil. É resistente. E foi criado para lidar com qualquer situação imposta pela mãe natureza e muito mais.  Veja o caminho  O eTrex 20 possui um visor de 2.2 com 65K de cores e legível sob a luz solar. Durável e à prova d'água, o eTrex 20 foi projetado para resistir aos elementos. Apesar de possuir uma interface atualizada, ele ainda mantém sua incrível resistência aos elementos – seja poeira, sujeira, umidade ou água, nenhum desses é páreo para esse célebre navegador.  Vá a qualquer lugar  Com uma matriz de suportes compatíveis, o eTrex 20 foi desenvolvido para ser usado em veículos para todos os tipos de terreno, bicicletas, barcos, como um dispositivo portátil ou no carro. Use o recurso de instalação automática e os mapas do City Navigator NT® para obter referência de locais trecho a trecho ou a instalação robusta para sua moto ou veículos para todos os tipos de terreno. O eTrex possui os mapas e as montagens que o levam para qualquer lugar que você imaginar.  Seja global  A nova série eTrex é o primeiro tipo de receptor para consumidores da história que tem a capacidade de rastrear satélites GPS e GLONASS simultaneamente. GLONASS é um sistema desenvolvido pela Federação Russa e estará em funcionamento total em 2012. Ao usar satélites GLONASS, o tempo que se leva para o receptor “capturar” uma posição é (em média) aproximadamente 20% mais rápido que usar um GPS. Ao usar ambos (GPS e GLONASS), o receptor tem a capacidade de capturar 24 satélites a mais que usar somente o GPS.  Adicione mapas  Com o cartão microSD™ e 1,7 GB de memória interna, o eTrex 20 permite a você carregar mapas TOPO 24K e entrar na trilha, conectar cartões BlueChart® g2 pré-carregados para um grande dia na água ou dados de mapa City Navigator NT® para receber informações de rota em estradas (veja a guia Mapas para mapas compatíveis). O eTrex 20 também é compatível com imagens de satélite do BirdsEye™ (necessária assinatura) que permite que você baixe as imagens por satélite para o seu dispositivo e integre-as com seus mapas.  Mantenha sua posição  Com seu receptor GPS habilitado para WAAS de alta sensibilidade e previsão por satélite HotFix™, o eTrex localiza sua posição de forma rápida e precisa e mantém sua localização por GPS mesmo em florestas densas e vales profundos.  Divirta-se  O eTrex 20 suporta arquivos GPX da geocaching para fazer download de geocaches e detalhes diretamente para a sua unidade. Visite o site OpenCaching.com para começar sua aventura de geocaching. Não utilizando papéis, você não só ajuda o meio ambiente, mas aumenta sua eficiência. O eTrex 20 armazena e exibe informações importantes, incluindo localização, terreno, dificuldade, dicas e descrições, o que significa que não é mais necessário inserir coordenadas manualmente e levar folhas impressas. Basta carregar o arquivo GPX em sua unidade e começar a busca por caches.   Itens inclusos:  eTrex 20 Cabo USB Manual  Fabricante : Garmin Dimensões da unidade LxAxP: 2,1\" x 4,0\" x 1,3\" (5,4 x 10,3 x 3,3 cm) Tam. tela LxA: 1,4\" x 1,7\" (3,5 x 4,4 cm); 2,2\" de diagonal (5,6 cm) Resolução da tela LxA : 176 x 220 pixels Tipo de tela : TFT colorido e transflectivo com 65.000 cores Peso : 5 oz (141,7 g) com baterias Bateria : 2 baterias AA (não inclusas); recomendável NiMH ou lítio Autonomia da bateria : 25 horas A prova d'água : Sim (padrão IPX7) Flutuante : Não Receptor de alta-sensibilidade : Sim Interface : USB Base de mapa : Sim Mapas pré-carregados : Não Permite adicionar mapas : Sim Memória interna : 1,7 GB Tipo do cartão de dados : Cartão microSD™ (não incluso) Waypoints/favoritos/locais : 2000 Rotas : 200 Log de trilhas : 10.000 pontos, 200 trajetos salvos Rota automática : Sim Bússo