  {code: "002405", description: "Sua vibrante, tela colorida transreflexiva permite a melhor legibilidade mesmo com luz solar direta. Com o SiRFstarIII GPS chipset é possivel localizar um geoacache, um local favorito de pesca, ou um próximo cume a ser conquistado com precisão de, 3-5metros (10-15 pés).  Para sua aventura ao ar livre durar o dia todo, o aparelho é alimentado por duas pilhas AA para 18 horas de uso constante. O eXplorist 110 é resistente, impermeável, e tem certiicado (IPX-7) de submerção. Tudo isso com um design compacto e atraente que pode ser levado para qualquer terreno.  A tela do painel possui uma mini-bússola que serve para referência rápida e campos personalizáveis de navegação, como latitude, longitude, rumo, direção, distância até o destino, odômetro de viagem, e muitos mais. Também é possivel ver sua rota em percurso (funciona como se fosse um rastro digital que grava todos os seus movimentos). Marque o seu ponto de partida (trilha, carro, estacionamento ...) com um\" waypoint\" e navegue facilmente de volta no final do dia.    Referêncie o seu resumo de rotas para acompanhar a sua distância percorrida, ganho ou perda altura, tempo de viagem completo, tempo em movimento e tempo parado. Facilmente redefina o seu resumo de rotas e você está pronto para sua próxima aventura de geocaching.  Não importa onde você estiver, o GPS eXplorist 110 vai fornecer sinais precisos graças ao GPS por (SBAS) de WAAS, EGNOS e MSAS; coordenadas de exibição em uma série de diferentes sistemas globais, incluindo UTM WGS84. Ele é tudo que você precisa para te guiar em sua próxima aventura.  Menus Fáceis de Navegar e Gráicos Ricos: gráicos vibrantes e modernos, seu menu principal é simples, interativo e intuitivo. Tela colorida e legível à luz solar: tela colorida translectiva de 2.2\" permite uma ótima legibilidade à luz solar direta. Resistente e a prova d'água aos padrões IPX-7: diversão sem danos ao aparelho. Alta sensibilidade SiRFstarIII GPS com 3 a 5 metros 