  {code: "001694", description: "O eXplorist 610 combina alta sensibilidade de recepção GPS com mapas de fácil leitura, navegação precisa e experiência em sistemas de gravação. A câmera integrada de 3.2 mega-pixel, microfone e alto-falante permitem gravar ao ar livre fotos georeferenciadas, notas de voz e sequências de vídeo.  O eXplorist 610 oferece uma navegação ao ar livre única. Encontre o seu caminho usando o mapa ou uma série de telas de bússola diferentes. Crie milhares de waypoints, grave rotas rastreadas de ponto a ponto. Ele baixa até 10.000 arquivos GPX geocache livre de papel. Analise as estatísticas da sua viagem com mais de 30 campos de dados de navegação.  Alimentado por duas baterias AA, o dispositivo durará até 16 horas em condições normais. Para ajudar a economizar energia, use o modo de suspensão para desligar o dispositivo, mantendo o rastreamento do GPS.  Simples de usar e personalizável, a combinação de uma tela de toque legível à luz solar e um simples toque na tela do mapa, revela-se a interface do usuário de 4 Cantos. Essa super interface de navegação dinamiza a navegação dos mapas com os atalhos. Além disso, dois botões personalizáveis ​​estão localizados na lateral, e marcam rapidamente um waypoint e ativam a câmera.  Características:  Núcleo de Navegação ao ar livre: é uma combinação de alta sensibilidade de recepção GPS com mapas exclusivos e navegação precisa. Mais .Cria pontos no caminho, grava trilhas e rota de ponto a ponto. Experiência de gravação: Câmera integrada de 3.2 mega-pixel, microfone e alto-falante Mapas Superiores com Visualização em Perspectiva 3D: a Edição do mapa Mundial permite a visualização de ângulos 2D ou 3D . A Série Summit é uma nova geração de mapas topográficos externos em várias regiões com alto nível de detalhe. 3.0\" Tela de Toque e Controles de Botão: combina a facilidade de uso de uma tela de toque com a confiabilidade de dois botões personalizáveis. Geocaching livre de papel: Faça o download e visualize 