  {code: "001695", description: "O Magellan eXplorist Pro 10 mantém o seu banco de dados GIS preciso e atualizado. Com apenas um sistema, uma grande quantidade de dados podem ser mapeados em um curto espaço de tempo. O eXplorist Pro 10 é uma solução simples para os maiores desafios de sua aplicação GIS móvel.  Com um poderoso processador de 533MHz, 128MB de memória RAM, 4GB de armazenamento interno, alto desempenho, o computador de mão eXplorist Pro 10 fornece toda capacidade necessária para trabalhos com mapas e grandes quantidades de dados. O sistema operacional Windows Mobile® v6.5 permite escolher uma solução de software projetado especificamente para as suas necessidades.  O Bluetooth torna mais fácil a recepção de mapas e dados. Ele pode também ser conectado a outros dispositivos que possuam a tecnologia Bluetooth disponível, tal como telêmetro a laser e scanners e código de barras.  Compacto e durável, o eXplorist Pro incorpora características funcionais tais como foto, vídeo, anotações por captura de voz e um receptor GPS de alto rendimento com precisão de posicionamento em tempo real de 3 a 5 metros.  Windows Mobile 6.5 em inglês, espanhol, francês, dinamarquês, alemão, holandês, português brasileiro, russo, chinês tradicional, chinês simplificado, japonês e coreano. Processador Samsung S3C2450 de 533MHz. Bluetooth v2.0 integrado. Câmera digital integrada (Colorida com 3.2 megapixel de resolução) Memória RAM interna de 128MB. Memória Flash (Não-Volátil) de 4GB. Cartão de memória MicroSD (Compatível com MicroSDHC). Tela WQVGA (Resolução de 400 x 240 - Orientação em modo Retrato) transflectiva , legível à luz solar e com touch screen. Suporte a cores de 16 Bit. Alto falante e microfone integrados. Bússola 3D, altímetro de pressão e barômetro. Alimentado por 2 pilhas AA por até 15 horas com o backlight do display a 40 Nits. Receptor GPS SIRFstar III integrado de alta sensibilidade e antena do tipo Multidirectional Patch. 3 a 5 metros de precisão típica. Suporte a protocolos NMEA e SIRF.", name: "GPS EXPLORIST PRO 10 MAGELLAN", manufacturer: "MAGELLAN", price: "2989.0", price_3x: "996.0", price_30_days: "2989.0", price_cash: "2989.0", rev_icms18: "2989.0", rev_icms12: "2839.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-01040-01", description: "fēnix™, o relógio GPS para atividades externas inédito para alpinista e fãs de atividades ao ar livre. O Garmin fēnix™ é o primeiro relógio de pulso com navegador GPS + ABC (altímetro, barômetro e bússola) a incluir navegação GPS abrangente da Garmin. Desenvolvido juntamente com guias profissionais de montanhas para alpinistas e fãs de atividades ao ar livre, o fēnix é a ferramenta de navegação externa que mantém suas mãos livres e que guia você com segurança através de ambientes exigentes de alpinismo. Ele permite a você traçar seu próprio caminho para o cume e de volta para a segurança de um abrigo nas montanhas. Com sensores ABC de autocalibração e recursos de navegação com qualidade Garmin como o TracBack™ e linha de navegação nítida no dispositivo, ele oferece um novo padrão em ambientes de alpinismo. Você pode criar e seguir rotas, marcar até 1.000 paradas, armazenar até 10.000 pontos de trajeto e navegar até eles com facilidade. Compartilhe dados sem fio com outras unidades GPS Garmin e smartphones compatíveis. Naturalmente, por se tratar de um relógio GPS com navegação ABC, ele também inclui altímetro, barômetro, bússola eletrônica de 3 eixos e sensor de temperatura. Estiloso, resistente e à prova d'água até 50 m (164 pés), ele funciona tanto em ambientes urbanos quanto nos outros já conhecidos para explorar as grandes aventuras da vida. Navegação by Garmin Nenhum outro relógio de pulso com navegador GPS + ABC oferece capacidade de navegação GPS da Garmin -- o nome mais confiável quando o assunto é navegação. O fēnix rastreia sua localização, mas também guia você através do desconhecido e, o mais importante, guia você de volta para que você possa se sentir 100% confiante e protegido em cada etapa do caminho. Ele armazena o registro do trajeto, criando uma trilha passo a passo por GPS conforme você se move. Ele também permite a marcação de paradas, como localização do veículo, abrigos, vistas e outros POIs (Pontos de Interesse). Com o fēnix, você pode criar e seguir rotas, marcar até 1.000 paradas e armazenar até 10.000 pontos de trajeto. Você pode até mesmo criar seus dados de viagem com o BaseCamp™, o software gratuito para planejamento de viagens para desktop da Garmin. Planeje confortavelmente sua viagem em casa, baixe todos os dados para o fēnix e siga a seta de navegação para as paradas ou a linha do trajeto claramente visível para o seu destino. Para retornar, permita que o TracBack™ mostre-lhe o caminho. A conveniência de um relógio de pulso Robusto e atraente, o fēnix é também um relógio altamente preciso que pode ser usado todos os dias. Ele inclui configurações de alarme, toques e alertas vibratórios. Ele também funciona como um temporizador, cronômetro e um relógio mundial. Mas, acima de tudo ele é um produto essencial para alpinistas e fãs de atividades ao ar livre. Altímetro O fēnix possui altímetro barométrico interno que fornece informações precisas sobre elevação ao longo do caminho. Isso permite a você manter um registro das subidas/descidas, e saber a altura escalada da base até o cume. Com a calibração automática, a precisão do altímetro é aprimorada graças ao monitoramento contínuo e recalibramento do sensor realizado pelo fēnix. Para que você possa sempre saber o quanto ainda falta escalar para alcançar seu destino. Barômetro O barômetro interno ajuda você a monitorar e prever mudanças climáticas, mostrando mudanças a curto prazo na pressão atmosférica barométrica. Por exemplo, se a pressão barométrica começar a cair gradativamente, isso é uma indicação de tempestade iminente. Bússola O fēnix inclui bússola eletrônica de 3 eixos que registra sua variação em qualquer posição e se você está ou não se movimentando. Isso é muito útil para se orientar novamente após uma pausa curta. Aviste uma variação e mantenha-se confiante, o fēnix irá ajudá-lo a se manter na direção certa. A bússola também pode ser configurada para ser calibrada automaticamente, para que você possa sempre chegar ao seu destino. Desempenho Semelhante aos relógios de corrida com GPS líderes da Garmin, o fēnix fornece monitoramento completo de desempenho em tempo real de atletas alpinistas, assim como corredores de trilhas e praticantes de ski nas montanhas. Com as funções Lap e Autolap, e dados importantes sobre desempenho, por exemplo distância, velocidade vertical e ritmo, alpinistas ambiciosos podem manter um registro de seus progressos durante seus treinamentos ao ar livre ou outras atividades físicas. O fēnix também é compatível com o monitor de batimentos cardíacos opcional da Garmin para informações sobre frequência cardíaca ou com o sensor de velocidade/cadência para informações sobre distância, velocidade e cadência enquanto estiver pedalando. Todos os campos de dados exibidos são totalmente personalizados diretamente no pulso. Temperatura precisa / tempe™ Você pode obter informações sobre as tendências de temperatura através do sensor de temperatura interno. Com o tempe™, a Garmin abriu novamente novos caminhos em relógios precisos para atividades ao ar livre. O tempe™ é o novo sensor de temperatura ANT+ da Garmin que oferece leitura de temperatura ambiente precisa sem a influência da temperatura corporal. Saber a velocidade com a qual a temperatura aumenta ou cai rapidamente pode ajudá-lo a determinar que roupa usar, se é preciso encontrar um abrigo ou se é hora de voltar. Comunicação sem fio entre unidades Você pode compartilhar trajetos, paradas, rotas e geocaches informatizados facilmente sem fio com outras unidades Garmin GPS smartphones compatíveis. O fēnix é equipado com capacidades ANT+™ e tecnologia Bluetooth®.  Dados físicos e de desempenho: Dimensões da unidade, LxAxP  1.9\" x 1.9\" x .7\" (4.9 x 4.9 x 1.7 cm) Tamanho do visor, LxA  1.2\" (3.1 cm) Resolução do visor, LxA  70 x 70 pixels Tipo de visor  transflectivo, monocromático LCD Peso  141,7 g (2.6 oz ) com baterias Bateria  íons de lítio recarregáveis Duração da bateria  16-50 hora