  {code: "010-00924-01BR", description: "Use-o para passear. Use-o para caçar. Use-o na água. O Montana 650 tem um inovador ecrã táctil a cores, de 4 polegadas e dupla orientação, é compatível com várias opções de mapeamento, tais como imagens de satélite BirdsEye e dispõe ainda de uma câmara de 5 megapixéis. O Montana apresenta várias funcionalidades importantes para utilização no exterior, tais como a bússola com compensação de inclinação sobre os 3 eixos e o altímetro barométrico. Adquira o suporte para automóvel e um mapa City Navigator NT® e obterá comandos de voz com indicações de mudança de direcção. É grande. É versátil. É resistente. Chama-se Montana - a novidade em ecrãs tácteis resistentes.  Tire fotografias com georreferenciação  Capture locais e memórias com a câmara digital de 5 megapixéis do Montana 650. Todas as fotografias incluem automaticamente uma georreferenciação com o local onde foram tiradas, permitindo-lhe assinalar, relembrar e navegar para o mesmo local no futuro. Visualize e corte fotografias em modo vertical ou horizontal. Para manter o registo das suas fotografias e apresentar a respectiva localização num mapa, basta ligar o Montana 650 com um cabo USB e utilizar o software gratuito BaseCamp da Garmin. Para maior capacidade de armazenamento, introduza um cartão microSD™. Também pode visualizar imagens de outros dispositivos em microSD com o visualizador de imagens do Montana.   Fácil navegação  O Montana 650 possui uma bússola electrónica com compensação de inclinação de 3 eixos, que lhe indica a sua direcção, mesmo quando está parado, sem estar a segurar a bússola numa posição equilibrada. O seu altímetro barométrico detecta alterações na pressão, indicando a sua altitude exacta, e pode ainda usá-lo para registar a pressão barométrica ao longo do tempo, ajudando-o a controlar mudanças nas condições meteorológicas.  Duplique a sua potência  O Montana 650 apresenta um inovador sistema duplo de baterias. Pode utilizar a bateria de iões de lítio recarregável ou as tradicionais pilhas alcalinas AA, conforme lhe for mais conveniente.  Dados físicos e de desempenho: Dimensões da unidade, LxAxP  2,9\" x 5,7\" x 1,4\" (7,48 x 14,42 x 3,64 cm) Tamanho do visor, LxA  2\" (L) x 3,5\" (A) (5,06 x 8,93 cm); 4\" de diagonal (10,2 cm) Resolução do visor, LxA  272 x 480 pixels Tipo de visor  TFT colorido, brilhante e transflectivo com 65.000 cores, sensível ao toque e orientação dupla; legível sob a luz solar Peso  10,2 oz (289 g) com bateria de íon-lítio incluída; 11,7 oz (333 g) com 3 pilhas AA (não incluídas) Bateria  Bateria de íon-lítio recarregável (incluída) ou 3 pilhas AA (não incluídas); recomendável NiMH ou lítio Duração da bateria  até 16 horas (íon-lítio); até 22 horas (pilhas AA) À prova d'água  Sim (IPX7) Flutua  Não Receptor de alta sensibilidade  Sim Interface  compatível com USB de alta velocidade e NMEA 0183 Mapas e memória: Mapa base  Sim Mapas pré-carregados  não Capacidade de incluir mapas  Sim Memória interna  3,0 GB Aceita cartões de dados  Cartão microSD™ (não incluso) Paradas/Favoritos/Localizações  4000 Rotas  200 Registro de trajeto  10.000 pontos, 200 trajetos salvos Funcionalidades e Vantagens: Roteamento automático (roteamento em estradas curva a curva)  Sim (com mapeamento opcional para estradas pormenorizadas) Bússola eletrônica  Sim (compensação de inclinação, 3 eixos) Tela sensível ao toque  Sim Altímetro barométrico  Sim Câmera  sim (5 megapixels com foco automático; geomarcação automática) Pode ser facilmente usado para geocaching  productTemplate.tab.specs.picklist.yes_(paperless) Compatível com mapas personalizados  Sim Navegação por imagens (navega nas fotos geomarcadas)  Sim Calendário de caça/pesca  Sim Informações sobre o sol e a lua  Sim Tabelas de marés  productTemplate.tab.specs.picklist.yes_with_optional_bluechart Cálculos de área  Sim POIs personalizados (capacidade de incluir outros pontos de interesse)  Sim Transferência unidade a unidade (compartilha dados sem fio