  {code: "010-01065-00", description: "Monterra ™ Tablet Android ™ com GPS, Wi-Fi para acompanhar suas aventuras ! A Garmin tem o prazer de apresentar o mais novo e completo dispositivo de aventura, o Monterra. Este é o primeiro Tablet com Wi-Fi e GPS que é ultra-portátil construídos para o uso ao ar livre e executa o popular sistema operacional Android. As possibilidades para o Monterra são infinitas. Os usuários podem acessar o conjunto completo de aplicativos disponíveis a partir da loja Google Play ™ através de uma conexão Wi-Fi. Além disso, os desenvolvedores de aplicativos podem criar novos aplicativos conforme suas necessidades e que poderão ser executados em um dispositivo resistente à prova d’água. Caracteristicas e Especificações do Produto Nome do produto: Monterra • Tela de 4 \", multi-toque com dupla orientação, legível sob luz solar que utilizam um vidro mineral resistente e robusto; • Sistema operacional Android com acesso aos aplicativos do Google Play; • Receptor de GPS de alta sensibilidade; • Suporta recepção de satélite GLONASS para rastreiar mais satélites para uma melhor posição com HotFix®; • Conectividade via Wi-Fi (802.11bgn), Bluetooth ®, ANT + ™ e NFC (Near Field Communication); • Câmera de 8MP com autofoco automátic, flash LED, (que também funciona como lanterna) capacidade de captura de vídeo full HD 1080p; 1 • Bússola de 3 eixos com acelerômetro, giroscópio e altímetro barométrico; • Sensor UV ajuda a proteger do sol; • À prova d'água (IPX71); • Sintonizador de rádio FM; • Sistema de bateria dupla – opera com bateria de lítio-ion recarregável com carregador interno (incluído) ou 3 pilhas AA; • Memória interna e slot para cartão microSD ™ (até 64 GB) para armazenamento de dados adicionais (mapas, aplicativos, imagens, vídeos e muito mais); • Compatível com mapas opcionais incluindo mapas de topografia, imagens de satélite, mapas personalizados, mapas rodoviários City Navigator NT ® e muito mais; • Pré-carregado com mapa base mundial; • Compatível com uma variedade de suportes Garmin, incluindo suportes para seu carro, moto, barco, ATV, bicicleta e muito mais; Acessórios inclusos na caixa : Tablet Monterra, pré-carregado com mapa base mundial; Bateria li-ion, Cabo USB, adaptador AC, protetores de tela anti-reflexo manuais.", name: "GPS MONTERRA REF. 010-01065-00", manufacturer: "GARMIN BR", price: "2999.0", price_3x: "1000.0", price_30_days: "2999.0", price_cash: "2939.0", rev_icms18: "2819.0", rev_icms12: "2679.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-01001-59BR", description: "GPS NUVI 2415LT GARMIN PROCEDÊNCIA AMERICANA. Se você está dirigindo por uma cidade estranha ou em seu trajeto diário, o Garmin nüvi 2415LT torna sua viagem mais fácil do que nunca. Ele fornece informações em tempo real e GRATUITAS de trânsito, avançada orientação de faixas e muito mais. O GPS apresenta uma tela sensível ao toque de 4,3”, os mapas mais precisos e completos com mais de 3.700 cidades, informações atualizadas de trânsito, aviso de localização de radares e mais de 1.900.000 Pontos de Interesse. Fornece indicações trecho a trecho precisas e fala o nome das ruas. Conta ainda com o mais novo e exclusivo recurso de sugestão de faixa com visualização de cruzamento, que o ajuda a identificar em qual faixa estar para fazer a próxima curva. Evite congestionamentos Com atualizações de tráfego GRATUITAS, o nüvi 2415LT é o sistema mais completo para evitar o trânsito e chegar ao destino na hora certa. Verificamos as condições do tráfego mais de 2 bilhões de vezes a cada mês, assim você pode facilmente desviar de congestionamentos e chegar a tempo. O serviço é totalmente gratuito: não há assinaturas mensais e nem taxas iniciais.. Faça chamadas em viva‐voz com seu celular A conectividade Bluetooth® permite fazer e receber chamadas pelo seu celular, evitando multas. Orientações a cada curva Toque na tela para procurar facilmente endereços e serviços e obtenha orientações trecho a trecho com avisos de voz que falam os nomes das ruas até o seu destino. Ele vem pré‐carregado com os detalhados mapas City Navigator Brazil, possui cobertura de mais de 3.700 cidades e possibilita a criação de rotas rua‐arua em mais de 1.940 cidades. Evite multas por excesso de velocidade com o novo indicador de limite de velocidade do Garmin nüvi 2415LT que mostra qual a velocidade máxima permitida nas principais vias. Você sempre encontrará restaurantes, hotéis, bancos e lojas graças a mais de 1.900.000 pontos de interesse cadastrados e com a possibilidade de adicionar seus próprios pontos.. Conheça a rota antes que seja tarde Quando você se aproxima de uma saída ou cruzamento, o nüvi 2415LT entrará no modo de tela dividida e mostrará uma representação realista dos cruzamentos em toda a sua rota, com os sinais de trânsito e setas que indicam a faixa apropriada para navegação.. Garantia nüMaps Com o navegador GPS Garmin nüvi 2415LT você tem a garantia de estar usando a última versão do mapa City Navigator Brazil. Basta registrar o seu produto no site www.garmin.com.br dentro de 90 dias após o primeiro uso, e se houver alguma atualização de mapa neste período, ela será oferecida gratuitamente para você.  Dados físicos e de desempenho Dimensões da unidade, LxAxP  12,1 x 7,6 x 1,5 cm Tamanho do visor, LxA  9,7 x 5,8 cm; 4,3\" de diagonal (10,9 cm) Resolução do visor, LxA  480 x 272 pixels Tipo de visor  dupla orientação manual, colorido WQVGA com luz de fundo branca Peso  142,0 g Bateria  íons de lítio recarregáveis Duração da bateria  até 2,5 horas Conector para headphone/áudio line-out  Não Receptor de alta sensibilidade  Sim À prova d'água  Não Mapas e memória Mapas de ruas pré-carregados  Sim Inclui actualizações vitalícias de mapas  Não nüGarantia de atualização de mapas  sim Visão de terreno 3-D  Não Visualização de edifícios em 3D (exibe edifícios em 3D)  Não Memória interna  estado sólido interno Aceita cartões de dados  Cartão microSD™ (não incluso) Paradas/Favoritos/Localizações  1000 Rotas  100 Funcionalidades e Vantagens Funcionalidades que poupam tempo e dinheiro Avisos por voz (por exemplo: \"Vire à direita a 150 metros.\")  Sim (altifalante interno) Fala o nome das ruas (por exemplo: \"Vire à direita na ELM Street a 150 metros.\")  Sim Navegação ativada por voz (opere o dispositivo com comandos de voz)  Não Compatível com Tráfego FM  Sim (recetor e trânsito vitalício incluídos) Atualizaçoes de trânsito vitalícias gratuitas (recebe gratuitamente atualizaçoes vitalícias de dados de trânsito)  Sim (3D 