  {code: "010-01002-20BR", description: "GPS NUVI 2565LT. A Garmin é a líder mundial no mercado de navegação. Com origem no mundo da aviação, onde a navegação com precisão é fundamental para a segurança, a Garmin cresceu, tornando‐se a referência mundial em produtos com GPS nos segmentos náutico, aviação, automotivo, fitness e recreacional. Quando você for viajar, não esqueça de levar o nüvi 2565LT pois ele vem pré‐carregado com os detalhados mapas City Navigator South America. Ele pode ser usado na Argentina, Brasil, Chile, Uruguai, Paraguai, Perú, Colômbia, Venezuela, Guiana Francesa, Costa Rica e Panamá. Além desses países, ele também possui cobertura total do Estado da Flórida (Estados Unidos), permitindo a navegação precisa até hotéis, shoppings e destinos turísticos de suas próximas férias com a família. No Brasil, a cobertura é de mais de 3.700 cidades. Evite congestionamentos Com atualizações de tráfego GRATUITAS, o nüvi 2565LT é o sistema mais completo para evitar o trânsito e chegar ao destino na hora certa. Verificamos as condições do tráfego mais de 2 bilhões de vezes a cada mês, assim você pode facilmente desviar de congestionamentos e chegar a tempo. O serviço é totalmente gratuito: não há assinaturas mensais e nem taxas iniciais. Faça chamadas em viva‐voz com seu celular A conectividade Bluetooth® permite fazer e receber chamadas pelo seu celular, evitando multas. Memória RAM 128 MB.  Funções e características • Inclui mapas de 11 países sul‐americanos e do Estado da Flórida (EUA). • Informações de trânsito gratuitas e em tempo real (disponível em SP, RJ e BH). • Faça chamadas e receba mensagens de texto por viva‐voz (Bluetooth®). • Avisa com antecedência localização de radares em todo o Brasil. • Fala o nome das ruas (função TTS): ex. “Vire a esquerda na Avenida Brasil”. • Saiba em qual pista você deverá estar graças à avançada orientação de faixas com a exclusiva visualização de cruzamentos com o photoReal. • Evite multas com o indicador de limite d