  {code: "010-01030-40", description: "nüvi® 2580TV 010-01030-40   O Garmin nüvi 2580TV é um GPS multifuncional que combina o melhor dos dois mundos - navegação avançada e entretenimento: TV, vídeo e música - tudo em um dispositivo fino com tela sensível ao toque de 5\".  Dirija quando precisar  O Garmin nüvi 2580TV apresenta o melhor mecanismo de navegação que oferece rotas rápidas e precisas para suas viagens na cidade e estradas. Com a exclusiva tecnologia Garmin photoReal™ JunctionView, o GPS exibe a visualização foto realística de cruzamentos e exibe em qual faixa você deve estar para pegar a saída correta.  Veja mais  Com a tela widescreen com 5”, você terá sempre as melhores imagens. Assista a seus programas favoritos, veja o mapa em detalhes, direções de condução, fotos e muito mais em cores brilhantes. Sua tela de 5” é legível sob luz solar e pode ser vista de qualquer ângulo.  Orientações a cada curva  Toque na tela para procurar facilmente endereços e serviços e obtenha orientações trecho a trecho com avisos de voz que falam os nomes das ruas até o seu destino. Ele vem pré‐carregado com os detalhados mapas City Navigator South America, possui cobertura de mais de 3.700 cidades brasileiras e possibilita a criação de rotas rua-a-rua em mais de 1.940 cidades. Além disso, esse é o GPS perfeito para todos os viajantes e turistas pois você também poderá utilizá-lo em 12 países sul-americanos (Argentina, Brasil, Chile, Colômbia, Costa Rica, Guiana Francesa, Paraguai, Panama, Peru, Suriname, Uruguai e Venezuela) e também na Flórida (Estados Unidos). Evite multas por excesso de velocidade com o novo indicador de limite de velocidade do Garmin nüvi 2580TV que mostra qual a velocidade máxima permitida nas principais vias. Você sempre encontrará restaurantes, hotéis, bancos e lojas graças a mais de 1.900.000 pontos de interesse cadastrados e com a possibilidade de adicionar seus próprios pontos.  Planeje com antecedência  O Garmin nüvi 2580TV inclui características avançadas de navegação para que você viaje sem preocupações. Com o planejamento de rotas, você pode salvar até 10 rotas, especificar os pontos do itinerário e visualizar uma simulação em sua tela widescreen. Além disso o Garmin nüvi 2580TV ordena automaticamente os destinos e mostra também os limites de velocidade nas principais vias e nas estradas. O registro eletrônico de viagem possibilita rastrear até 10.000 pontos, assim você poderá visualizar onde está no mapa.  Assista TV quando quiser  O Garmin nüvi 2580TV possui recursos de entretenimento de alta definição, incluindo TV digital, para que você não perca nada enquanto estiver dirigindo. Agora, você pode levar seus programas de TV, eventos esportivos e filmes para onde quer que você vá. Seu poderoso receptor de TV digital brasileira e antenas internas e externas oferecem a melhor experiência de visualização e cobertura, mesmo em viagens fora do Brasil, em países que adotam o mesmo sistema de TV digital que o Brasil. Você também pode usá-lo como um monitor de câmeras externas, como câmeras de ré, pois existe uma entrada de vídeo a sua disposição.  Faça chamadas em viva‐voz com seu celular  A conectividade Bluetooth® permite fazer e receber chamadas pelo seu celular, evitando multas.  Além da navegação  A navegação é apenas o começo. O Garmin nüvi 2580TV vem pré-carregado com o mais completo banco de dados de radares e alerta quando você está se aproximando de um. Você também pode customizar seu nüvi, baixando vozes personalizadas e veículos gratuitamente no Garmin Garage™. Com o navegador GPS Garmin nüvi 2580TV você tem a garantia de estar usando a última versão do mapa City Navigator South America. Basta registrar o seu produto no site www.garmin.com.br dentro de 90 dias após o primeiro uso, e se houver alguma atualização de mapa neste período, ela será oferecida.  Evite congestionamentos (exige receptor opcional GTM 36)  Ao adquirir o receptor de trânsito opcional, GTM 36, você evitará atrasos graças ao sistema mais completo para se evitar o trânsito - 3D Traffic. Projetado para lhe oferecer a mais completa visualização da situação do trânsito. Nós verificamos as condições do tráfego mais de 2 bilhões de vezes a cada mês, assim você pode desviar facilmente de congestionamentos e chegar a tempo.  Garantia nüMaps  Com o navegador GPS Garmin nüvi 2580TV você tem a garantia de estar usando a última versão do mapa City Navigator South America. Basta registrar o seu produto no site www.garmin.com.br dentro de 90 dias após o primeiro uso, e se houver alguma atualização de mapa neste período, ela será oferecida gratuitamente para você.  Inclui mapas de 12 países sul‐americanos e do Estado da Flórida (EUA) Navegação avançada e entretenimento: TV, vídeo e música — tudo em um dispositivo fino com tela sensível ao toque de 5\". Receptor de TV digital de alta resolução. Faça chamadas por viva‐voz (Bluetooth®). Avisa com antecedência localização de radares em todo o Brasil. Fala o nome das ruas (função TTS): ex. “Vire a esquerda na Avenida Brasil”. Saiba as faixas antes que seja tarde demais com o recurso de sugestões de faixa com visualização de cruzamentos. Evite multas com o indicador de limite de velocidade integrado Informações de trânsito: opcional, com a compra do acessório para recebimento das informações.  Conteúdo da caixa:  nüvi 2580TV Mapa City Navigator South America + Florida Montagem em veículos por ventosa Cabo de energia veicular Manual de início rápido", name: "GPS NUVI 2580TV", manufacturer: "GARMIN BR", price: "839.0", price_3x: "280.0", price_30_days: "839.0", price_cash: "819.0", rev_icms18: "819.0", rev_icms12: "779.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
