  {code: "010-01118-25", description: "Série Prestige — A nossa melhor navegação Tela de orientação dupla, de5 \" e alta resolução, com aplicação de zoom Mapas detalhados com atualizações gratuitas permanentes¹ Direções reais da Garmin com Garmin Real Voice Alertas de tráfego permanentes gratuitos² Navegação ativada por voz, compatível com Bluetooth e Smartphone  Visor de alta resolução nítido O nüvi 3597LMT tem um visor de alta resolução de 5 polegadas com recurso de “aplicação de zoom”, para que possa olhar mais de perto qualquer informação na tela. Os recursos de orientação dupla permitem usar ajustes horizontais e verticais automaticamente quando ele é girado.  Mapas detalhados com atualizações gratuitas O nüvi 3597LMT vem carregado com mapas detalhados do Brasil, Florida (EUA) e mais 12 países da América do Sul. Com atualizações de mapa por toda a vida útil gratuitas, suas rotas têm a certeza de refletir os mapas mais atualizados, os POIs (pontos de interesse) e as informações de navegação. Novos mapas estão disponíveis para download até quatro vezes por ano, por toda a vida útil do seu dispositivo, sem nenhuma taxa. Com tantos dados, o nüvi 3597LMT torna mais fácil encontrar endereços e milhões de POIs, como empresas, lojas, restaurantes e outros destinos. O nüvi 3597LMT vem pré-carregado com POIs, portanto, não há nenhuma necessidade de você inserir essas informações de endereço. Apenas selecione um (ou vários) e navegue, de maneira rápida e fácil. Você tem também a capacidade de adicionar POIs personalizados ao seu nüvi 3597LMT.  Garmin Trânsito O nüvi 3597LMT oferece o novo serviço Garmin Trânsito para ajudá-lo a passar mais tempo em movimento. Os alertas de trânsito aparecem na lateral do seu mapa, e os relatórios de trânsito são falados também. O Garmin Trânsito pode mostrar detalhes da situação, como quantos minutos de atraso esperar e se há possíveis desvios. Ele pode até mesmo confirmar se você está ou não na rota mais rápida. A atualização do trânsito por toda a vida útil qualifica o seu nüvi 3597LMT para receber informações gratuitas sobre o trânsito durante toda a vida útil do aparelho. Esse serviço está disponível nas cidades de São Paulo, Rio de Janeiro, Belo Horizonte e Distrito Federal.  O poder de sua voz O nüvi 3597LMT tem o luxo da navegação ativada por voz. Fale, e seu dispositivo inteligentemente responderá; suas mãos podem permanecer com segurança no volante. Evidentemente, você pode também navegar usando a interface da tela sensível ao toque.  Direções reais da Garmin™ com Garmin Real Voice™ O nüvi 3597LMT redefine as “indicações trecho a trecho faladas” com Direções reais da Garmin, direções de direção fáceis de entender que orientam como um amigo, usando pontos de referência reconhecíveis, edifícios e semáforos. Não há mais estresse ao tentar ler nomes de rua. O Garmin Real Voice é uma tecnologia de fala refinada que soa mais como uma voz natural, amigável. Direções reais da Garmin e Garmin Real Voice são recursos disponíveis apenas em nossa linha de navegadores GPS.  Chamadas de viva-voz via Bluetooth® Sincronize seu telefone habilitado para Bluetooth com o nüvi 3597LMT para chamadas em viva-voz por meio de seu microfone e alto-falante integrados. Armazene com segurança seu telefone em um porta-luvas, bolso ou bolsa e faça e receba chamadas sem mover suas mãos do volante ou tirar os olhos da estrada.  Compatível com o Smartphone Link Smartphone Link é um aplicativo gratuito que permite que seu GPS receba informações em tempo real, como trânsito, câmeras de segurança móveis, previsão do tempo e muito mais. Ele também compartilha locais com o seu Smartphone, para que possa navegar aquele último quilômetro até seu destino final e voltar para encontrar seu carro estacionado.  O Smartphone Link também lhe oferece acesso aos Garmin Live Services⁴ e a informações em tempo real úteis, como as condições do tempo e do trânsito. Os Garmin Live Services estão disponíveis gratuitamente e por assinatura.  Orientação de condução abrangente que você vê e ouve A visualização de cruzamentos Bird’s Eye oferece uma visualização detalhada dos cruzamentos, olhando para baixo como se fosse uma vista aérea. A visualização de cruzamentos photoReal mostra cruzamentos e alterações de estrada ao longo de sua rota, incluindo a paisagem ao redor. O nüvi 3597LMT também detalha as sinalizações de estrada reais conforme elas aparecem ao longo de sua rota.  Reddot Design Estilo sofisticado Com seu estilo elegante e o perfil ultrafino, o nüvi 3597LMT reflete uma estética refinada que se adapta ao interior de qualquer veículo. Um suporte magnético permite uma montagem e uma remoção simples enquanto transporta com segurança seu nüvi 3597LMT ou enquanto dirige. Tem um visor de alta resolução de 5 polegadas com recurso de zoom, para que possa olhar mais de perto qualquer informação na tela. O recurso de orientação dupla permite usar ajustes horizontais e verticais automaticamente quando ele é girado.  Conteúdo na caixa:  nüvi 3597LMT Mapas¹ e tráfego² diários (indicado por \"LMT\" após o número do modelo na caixa) Antena de tráfego/cabo de força veicular por toda a vida útil Montagem em veículos por copo magnético Cabo USB Manual de início rápido", name: "GPS NUVI® 3597LMT", manufacturer: "GARMIN BR", price: "1399.0", price_3x: "466.0", price_30_days: "1399.0", price_cash: "1369.0", rev_icms18: "1369.0", rev_icms12: "1299.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00697-40", description: "Com o Oregon 450 você realmente ficará em contato com a natureza. Esta próxima geração de GPS portátil possuí uma tela de toque robusta e de fácil leitura sob a luz solar além de uma base interna de mapas com relevo sombreado, receptor de alta sensibilidade, altímetro barométrico, bússola eletrônica de 3 eixos, \"slot\" para cartão microSD™, visualizador de fotos e mais. Inclusive compartilhar trilhas, pontos, rotas e caças ao tesouro de modo sem fios entre unidades similares.  Toque e Vá O Oregon 450 possuí uma tela de toque colorida com 3 polegadas na diagonal (76,2 mm),de fácil visualização sob a luz do sol, que oferece cores cristalinas e imagens de alta resolução. A sua interface de fácil uso significa que você aproveitará mais o tempo se divertindo nas suas aventuras e menos tempo procurando as informações. Com telas selecionáveis pelo usuário, você poderá personalizar a aparência da sua tela. Robusto e a prova de água o Oregon 450 é feito para resistir os elementos do campo. Choque, poeira, sujeira, umidade e água não são problemas para este navegador robusto.  Explore Mais O Oregon 450 vem com um mapa mundial com contornos sombreados. Simplesmente toque na tela colorida para navegar. O seu mapa de elevação digital exibe os contornos sombreados nos maiores níveis de \"zoom\", dando a você uma imagem ampliada nos arredores do terreno.  Compartilhe de Modo Sem Fios Com o Oregon 450 você poderá compartilhar os seus pontos, trilhas, rotas e caças ao tesouro (geocaches) de modo sem fios com outros usuários de unidades compatíveis como Oregon, Colorado e Dakota. Agora você poderá enviar a sua escalada favorita para o seu amigo experimentar ou a localização de um tesouro para ser encontrado. O compartilhamento de dados é fácil: apenas toque em “enviar” para transferir as suas informações à unidades similares.  Encontre Divertimento O Oregon 450 suporta arquivos GPX do Geocaching.com para descarregar caças ao tesouro e detalhes diretamente para a sua unidade. Pelo fato de não usar mapas de papel, você estará não apenas ajudando o meio ambiente, mas também aperfeiçoando a sua eficiência. O Oregon armazena e exibe informações chaves, incluindo a localização, o terreno, a dificuldade, dicas e descrições, assim não havendo mais a necessidade de plotar manualmente as coordenadas em um mapa impresso! Simplesmente carregue o arquivo GPX na sua unidade e inicie a procura pelos tesouros. Mostre as fotos das suas excursões no visualizador de fotos do seu Oregon. Pequeno e leve, o Oregon é a companhia perfeita para todas as suas atividades ao ar livre.  Conheça os Seus Rumos O Oregon 450 tem incorporado uma bússola eletrônica de 3 eixos com compensação de inclinação, que exibe o seu rumo mesmo quando você estiver parado e sem segurar a unidade nivelada. O seu altímetro barométrico detecta as mudanças na pressão para determinar a sua altitude precisa e mesmo plotar a pressão barométrica em um determinado período de tempo, que poderá ajudá-lo nas mudanças das condições atmosféricas. Veja as mudanças na sua elevação à frente e por onde você caminhou. Com o seu receptor GPS de alta sensibilidade, habilitado ao WAAS (não disponível no Brasil) e o sistema de previsão de satélites HotFix™, o Oregon 450 localiza a sua posição rápida e precisamente, mantendo a sua localização GPS mesmo sob cobertura fechada de árvores e em vales profundos.  Adicione Mapas Convenientemente insira um cartão opcional microSD pré-carregado para todas as suas atividades \"outdoor\" na terra ou na água. Apenas insira um cartão MapSource® com mapas detalhados de ruas e o Oregon proporcionará direções curva-a-curva até o seu destino. Adicione mapas topográficos selecionados para ter a vantagem da visualização de mapa 3D do Oregon que lhe dará uma melhor perspectiva da sua elevação. Com o BlueChart® g2, você terá tudo o que necessita para um grande dia na água, incluindo contornos de profundidades, auxílios à navegação e baías. O \"slot\" do cartão está localizado dentro do compartimento a prova de água das pilhas, protegendo-o assim contra umidade.  Fique Conectado Você esteve ocupado com as suas explorações e agora quer armazenar e analisar as suas atividades. Com uma simples conexão ao seu computador e à Internet, você poderá obter uma análise detalhada das suas atividades e enviar as trilhas para o seu dispositivo \"outdoor\" usando o Garmin Connect™. Este sítio único oferece uma tabela de atividades e permite que você visualize as suas atividades em um mapa usando o Google™ Earth. Explore outras rotas carregadas por milhões de usuários do Garmin Connect e compartilhe as suas experiências no Twitter® e no Facebook®. Iniciar é rápido: então vá até lá, explore e compartilhe.  Dados físicos e de desempenho: Dimensões da unidade, LxAxP  2,3\" x 4,5\" x 1,4\" (5,8 x 11,4 x 3,5 cm) Tamanho do ecrã, LxA  1,53\"L x 2,55\"A (3,8 x 6,3 cm); 3\" diag (7,6 cm) Resolução do ecrã, LxA  240 x 400 píxeis Tipo de ecrã  Ecrã táctil TFT a cores transflectivo Peso  6,8 oz (192,7 g) com as pilhas Bateria  2 pilhas AA (não incluídas); Pilhas de lítio ou NiMH recomendadas Vida útil da bateria  16 horas Classificação de resistência à 00e1gua  IPX7 Flutua  Não Receptor de alta sensibilidade  Sim Interface  compatível com USB de alta velocidade e NMEA 0183 Mapas e memória: Mapa de base  Sim Mapas pré-carregados  não Capacidade de adicionar mapas  Sim Memória integrada  850 MB Aceita cartões de dados  Cartão microSD™ (não incluído) Pontos de passagem/favoritos/locais  2000 Rotas  200 Registo de trajectos  10 000 pontos, 200 trajectos guardados Funcionalidades e Vantagens: Cálculo de rota automático (rotas de curva a curva nas ruas)  Sim (com mapeamento opcional para estradas pormenorizadas) Bússola electrónica  Sim (compensação de inclinação, 3 eixos) Ecrã táctil  Sim Altímetro barométrico  Sim Câmara  não Concebido para Geocaching  Sim (Sem papel) Compatível com personalização de mapas  Sim Navegação fotográfica (nav