  {code: "010-00697-10BR", description: "GPS GARMIN OREGON 550  O navegador com memória fotográfica!  O Oregon 550 combina a navegação com uma tela de toque robusta e com uma câmara digital de 3,2 megapixels. Possuí um GPS de alta sensibilidade, altímetro barométrico, bússola eletrônica de 3 eixos e \"slot\" para cartão microSD™. É um dispositivo de múltiplas finalidades que tornará as suas grandes aventuras ainda mais inesquecíveis.  Tire Fotografias e Grave os Locais Capture locais e lembranças com a câmara digital auto-foco de 3,2 megapixels, com \"zoom\" digital de 4x do Oregon 550. Cada fotografia é automaticamente geo-referenciada com o local de onde ela foi tirada, permitindo que você navegue de volta exatamente àquele ponto no futuro. Fotografe e visualize nos modos retrato ou paisagem. Com 850 MB de memória interna, você nunca perderá a oportunidade de fotografar um evento. Para armazenamento \"online\", simplesmente conecte o Oregon 550 via USB e acesse \"my.Garmin.com\" para carregar e armazenar suas fotografias no Picasa™, uma popular comunidade \"online\" para compartilhar fotografias com amigos e familiares ao redor do mundo. Para maior capacidade de armazemamento, coloque um cartão microSD. Você também poderá visualizar fotografias de outros dispositivos no microSD com o visualizador de imagens do Oregon.  Toque e Vá O Oregon 550 torna a navegação fácil com toques na robusta tela colorida táctil, de 7,6 cm na diagonal e de fácil visualização sob a luz do sol. A interface é de fácil utilização para que você gaste mais tempo se divertindo e menos tempo procurando informações. Robusto e a prova de água, o Oregon 550 foi construído para suportar os elementos ao ar livre. Choques, poeira, sujeira, umidade e água não afetam este robusto navegador.  Mantenha os Seus Rumos O Oregon 550 possuí uma bússola eletrônica de 3 eixos com compensação de inclinação, que mostrará a sua direção mesmo que você esteja parado e segurando-o desnivelado. O altímetro barométrico registra as mudanças na pressão para determinar a altitude correta e você também poderá usá-lo para traçar a pressão barométrica num determinado período de tempo, que poderá ajudá-lo na previsão de mudança nas condições meteorológicas. Com o seu receptor GPS de alta sensibilidade, habilitado ao WAAS (não disponível no Brasil) e previsão dos satélites pelo HotFix™, o Oregon 550 localiza a sua posição rápida e precisamente, mantendo a sua localização GPS mesmo sob cobertura de grandes árvores e vales profundos.  Adicione Mapas O Oregon 550 já tem instalado um mapa básico mundial com relevo sombreado. Adicionar mapas mais detalhados é fácil: coloque um cartão microSD pré-carregado com mapas detalhados do MapSource®. O Oregon aceita uma variedade de mapas para quaisquer necessidades de navegação. Adicione mapas com detalhes de ruas para obter navegação curva-a-curva até o seu destino. Adicione mapas topográficos com curvas de nível para aproveitar a vantagem 3D do Oregon. Ainda poderão ser usados mapas BlueChart® g2, que proporcionarão tudo que você precisa para navegação fluvial e marítima, incluindo contornos de profundidade, auxílios à navegação e baías.  Busque Diversão O Oregon 550 suporta arquivos GPX do Geocaching.com, para descarregar caças ao tesouro e detalhes diretamente para a sua unidade. Sem usar mapas de papel, você estará ajudando o meio ambiente e melhorando a sua eficiência. O Oregon armazena e exibe informações chaves, incluindo a localização, terreno, dificuldade, dicas e descrições, significando que você não precisará mais digitar coordenadas e andar com mapas impressos no papel! Simplesmente carregue o arquivo GPX na sua unidade e comece a caçar os tesouros. Mostre fotografias das suas excursões com o visualizador do Oregon. Compacto e leve, o Oregon é a companhia perfeita para todas as suas atividades ao ar livre.  Compartilhamento Sem Fios Com o Oregon 550 você poderá compartilhar pontos (waypoints), trajetos, rotas e caças ao tesouro, de forma sem fios, para outros usuários com unidades compatíveis: Oregon, Colorado e Dakota. Agora você poderá enviar a sua escalada favorita para o seu amigo conhecer ou a localização de uma caça ao tesouro para ele encontrar. O compartilhamento de dados é fácil: apenas toque em “enviar” para transferir as suas informações à unidades similares.  Fique Conectado Você esteve ocupado nas suas explorações e agora quer armazenar e analisar as suas atividades. Com uma simples conexão ao seu computador e à Internet, você poderá obter uma análise detalhada das suas atividades ou enviar trajetos ao seu dispositivo usando o Garmin Connect™. Este \"site\" oferece uma tabela de atividades e permite que você visualize as suas atividades usando um mapa no Google™ Earth. Explore outras rotas carregadas por milhões de usuários do Garmin Connect e compartilhe as suas experiências no Twitter® e no Facebook®. Começar é fácil: visite o \"site\", explore e compartilhe.  Acessórios incluídos com o Oregon 550: - Oregon 550 - Carregador de baterias AA - 2 baterias NiMH AA - Presilha para mosquetão - Cabo USB - Manual do proprietário em disco - Manual de início rápido  - Informações adicionais:  Fabricante  Garmin Garantia  (12) doze meses contra eventuais defeitos de fabricação Dimensões da unidade, LxAxP  5,8 x 11,4 x 3,5 cm Tam. tela, LxA  3,8 x 6,3 cm; 3\" na diagonal (7,6 cm) Resolução da tela, LxA  240 x 400 pixels Tipo de tela  Colorida Transrefletiva, TFT táctil (de toque) Peso  192,7 g com as pilhas Bateria  2 Pilhas AA (não inclusas); recomendado NiMH ou Lítio Autonomia da bateria  16 horas, típico A prova d'água  Sim (padrão IPX7) Flutuante  Não Receptor de alta-sensibilidade  Sim Interface  USB Base de mapa  Sim Mapas pré-carregados  Não Permite adicionar mapas  Sim Memória interna  850 MB Tipo do cartão de dados  Cartão microSD™ (não incluso) Waypoints/favoritos/locais  2000 Rotas  200 Log de trilhas  10.000 pontos, 200 trilhas salvas Rota automática  Sim Bússola eletrônica  Sim Tela sensível ao toque  Sim Altímetro barométrico  Sim Apropriado para Geocaching  Sim Jogos GPS Outdoor  Sim Calendário caça/pesca  Sim Informações de sol e lua  Sim Tábua de marés  Sim Cálculo de área  Sim POIs personalizados (possibilidade de adicionar pontos de interesse)  Sim Compartilha dados sem-fio entre unidades  Sim Visualizador de imagens  Sim ", name: "GPS OREGON 550", manufacturer: "GARMIN BR", price: "1169.0", price_3x: "390.0", price_30_days: "1169.0", price_cash: "1169.0", rev_icms18: "1169.0", rev_icms12: "1109.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-01066-00", description: "Assim que colocar as mãos em um 600, você estará pronto para entrar em um novo mundo ousado de navegação externa da Garmin. Com GPS de alta sensibilidade e rastreamento via satélite GLONASS (mais satélites significa correções mais rápidas, até mesmo em ambientes desafiadores), mapa base global pré-carregado com relevo sombreado e um processador mais rápido, você não irá apenas olhar para os mapas, mas interagir intuitivamente com eles. Amplie, abra o foco e gire a imagem utilizando o multitoque em quaisquer condições e até mesmo com luvas. A tecnologia de visor refletivo aumenta tanto o brilho da tela sensível ao toque que os mapas e as visualizações ficam tão vívidas tanto sob a forte luz solar quanto na sombra.  Toque e use O Oregon 600 foi propositalmente desenvolvido para áreas externas. Ele apresenta a tela sensível ao toque mais brilhante e legível sob a luz solar já incluída em um portátil Garmin, reforçada para resistência contra impacto, mas com orientação dupla e tela multitoque que pode ser operada com luvas. Solavancos, poeira, sujeira, umidade e água não afetam esse navegador orientado por mapeamento.  Get Your Bearings Oriente-se O Oregon 600 possui uma bússola eletrônica de 3 eixos integrada com compensação de inclinação do acelerômetro, que mostra para onde você está indo mesmo quando estiver parado, sem precisar segurá-lo na posição horizontal. Seu altímetro barométrico monitora as mudanças de pressão para definir sua altitude exata, e você pode até mesmo usá-lo para monitorar a pressão barométrica com o tempo, o que pode ajudá-lo a perceber as mudanças meteorológicas. E com sua alta sensibilidade, receptor GPS ativado via WAAS/EGNOS e GLONASS e previsão por satélite HotFix®, o Oregon 600 localiza sua posição mais rapidamente e com maior precisão e mantém sua localização GPS até mesmo em vales bastante cobertos e íngremes.   Dobre sua energia Além de seu excepcional desempenho de até 16 horas de duração da bateria, o novo Oregon 600 apresenta nosso sistema otimizado de bateria dupla para áreas externas. Você terá a opção de utilizar a bateria de NiMH internamente recarregável (não inclusa) ou pilhas AA tradicionais caso não haja possibilidade de recarregá-la - A bateria de NiMH regarrega automaticamente sempre que o aparelho for conectado à energia externa.  Compartilhe sem fio Compartilhe dados de atividades incluindo pontos de passagem, rotas e trajetos com amigos e parentes pelo smartphone e procure excelentes aventuras para compartilhar pelo Garmin Adventures próximo de onde estiver. Além disso, com o Oregon 600, você pode compartilhar seus pontos de passagem, trajetos, rotas e geocaches até 50 vezes mais rápido com outros dispositivos portáteis compatíveis sem fio da Garmin.  Adicione mapas É fácil adicionar mais mapas ao Oregon. Carregue mapas de nossa imensa seleção de Mapas Topográficos Europeus de alta qualidade ou escolha um de nossos mapas em bitmap 1:25k do Birdseye™ Select e pé na estrada. Conecte cartões pré-carregados do BlueChart® g2 em um lindo dia na água ou carregue dados de mapa do City Navigator para roteamento trecho a trecho nas estradas (consulte mapas compatíveis na guia Mapas). Adicione imagens de satélite aos seus mapas com o Birdseye™ Satellite Imagery (assinatura necessária).  Carregue todos os geocaches Chega de escolher e planejar, simplesmente faça o download de todos. O Oregon 600 suporta um número ilimitado de geocaches. Não apenas mil ou um milhão. Ilimitado. Faça o download de cada cache em OpenCaching.com. Carregue caches a partir do GSAK. Ou utilize seu programa ou website preferido que suporte arquivos GGZ*. Todos os seus recursos de geocaching informatizado serão guardados nesse lugar para cada cache. Leia as descrições, dicas e registros completos. Filtre caches por tamanho, terreno, dificuldade e tipo. Conecte a caches ativados por chirp. Grave seus registros no campo. Você pode fazer tudo. O Oregon 600 não tem limites.  Planeje sua próxima viagem Aproveite ao máximo suas aventuras com o BaseCamp™, o software de planejamento de viagens gratuito da Garmin. O BaseCamp é o ambiente perfeito para preparar com conforto suas viagens com mapas, pontos de passagem, trajetos e rotas antes de sair, e quando voltar para casa, poderá compartilhar aventuras incríveis pelo Garmin Adventures com os amigos, parentes ou colegas exploradores. O software exibe dados do mapa topográfico em 2D ou 3D na tela do seu computador, incluindo linhas de contorno e perfis de elevação.  Brilho do visor A tecnologia de visor refletivo utiliza luz externa, como a luz solar, em combinação com a luz de fundo LED da unidade para aumentar o brilho e visibilidade. Além disso, conserva-se energia por não aumentar a luz de fundo.  Tecnologia sem fio: Bluetooth® e ANT Agora é possível transferir arquivos pesados sem fio como fotos, geocaches, aventuras, rotas e mapas personalizados entre as unidades da série Oregon 600 (ou com Garmin Basecamp™ Mobile). Além disso, a nova tecnologia permite uma transferência 50 vezes mais rápida de rotas, pontos de passagem e trajetórias. O Oregon é também compatível com a tecnologia sem fio ANT + para frequência cardíaca, cadência, chirp™ e sensores tempe™.  Orientação dupla Visualize mapas e dados no modo vertical ou paisagem, dependendo de como a unidade estiver posicionada. A visualização em paisagem também ajuda a aprimorar a experiência de digitação e de navegação na estrada.  Lanterna A lanterna possui vários níveis de brilho e opções de luz - Alto e Baixo - para economizar energia da bateria.  Atalhos Abre aplicativos, troca de perfis, aplica definições e inicia a navegação com um toque  Painéis/Modo nüvi Os painéis permitem esconder e mostrar mais funções para seu aplicativo preferido. Com essas informações rápidas, é possível realizar várias ações sem ter que desabilitar o aplicativo.  Plano de elevação avançado A nova visualização Trajeto total permite visualizar todo o plano de elevação e rapidamente mover sua visualização aumentada a qualquer lugar no plano. O Plano futuro utiliza seus dados de mapeamento para mostrar o que existe à frente.  Computador de viagem aprimorado Obtenha 33% mais dados na tela de uma vez com novas opções de layout. Acrescente várias páginas de campos de dados, sendo cada uma personalizável para 1 a 4 layouts: 2 grandes, 1 grande e 4 pequenos, 6 pequenos ou 8 pequenos.  Monitoramento de atividades (Calendário) Monitore suas atividades, pontos de passagem e geocaches acumulados; monitora no dia em que você as realiza.  Gerenciamento avançado dos pontos de passagem Todos os dados são exibidos e são editáveis em uma tela. Exclua um ou vários pontos de passagem de uma vez no menu Gerenciador de pontos de passagem.  Dados físicos e de desempenho: Dimensões da unidade, LxAxP  2,4\" x 4,5\" x 1,3\" (6,1 x 11,4 x 3,3 cm) Tamanho do visor, LxA  1,5\"L x 2,5\"A (3,8 x 6,3 cm); 3\" diagonal (7,6 cm) Resolução do visor, LxA  240 x 400 pixels Tipo de visor  TFT colorida sensível ao toque transflectiva Peso  7,4 oz. (209,8 g) com baterias Bateria  2 pilhas AA (não inclusas); recomendável NiMH ou lítio, bateria de NiMH recarregável (opcional) Duração da bateria  16 horas Classificação de impermeabilidade  IPX7 Flutua  Não Receptor de alta sensibilidade  Sim Interface  compatível com USB de alta velocidade e NMEA 0183 Mapas e memória: Mapa base  Sim Mapas pré-carregados  não Capacidade de incluir mapas  Sim Memória interna  1,5 GB Aceita cartões de dados  Cartão microSD™ (não incluso) Paradas/Favoritos/Localizações  4000 Rotas  200 Registro de trajeto  10.000 pontos, 200 trajetos salvos Funcionalidades e Vantagens: Roteamento automático (roteamento em estradas curva a curva)  Sim (com mapeamento opcional para estradas pormenorizadas) Bússola eletrônica  Sim (compensação de inclinação, 3 eixos) Tela sensível ao toque  Sim Altímetro barométrico  Sim Câmera  não Pode ser facilmente usado para geocaching  Sim (Sem papel) Compatível com mapas personalizados  Sim Navegação por imagens (navega nas fotos geomarcadas)  Sim Calendário de caça/pesca  Sim Informações sobre o sol e a lua  Sim Tabelas de marés  Sim (com Bluechart opcional) Cálculos de área  Sim POIs personalizados (capacidade de incluir outros pontos de interesse)  Sim Transferência unidade a unidade (compartilha dados sem fio com unidades similares)  Sim (com imagens e mapas personalizados) Visualizador de imagens  Sim Compatível com Garmin Connect™ (comunidade on-line onde é possível analisar, categorizar e compartilhar dados)  Sim   Na caixa: Oregon 600 Mapa base mundial Cabo USB/de carregamento Presilha para mosquetão Documentação", name: "GPS OREGON 600", manufacturer: "GARMIN BR", price: "1609.0", price_3x: "536.0", price_30_days: "1609.0", price_cash: "1529.0", rev_icms18: "1369.0", rev_icms12: "1299.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
