rtical ou paisagem, dependendo de como a unidade estiver posicionada. A visualização em paisagem também ajuda a aprimorar a experiência de digitação e de navegação na estrada. Lanterna A lanterna possui vários níveis de brilho e opções de luz - Alto e Baixo - para economizar energia da bateria. Atalhos Abre aplicativos, troca de perfis, aplica definições e inicia a navegação com um toque Painéis/Modo nüvi Os painéis permitem esconder e mostrar mais funções para seu aplicativo preferido. Com essas informações rápidas, é possível realizar várias ações sem ter que desabilitar o aplicativo. Plano de elevação avançado A nova visualização Trajeto total permite visualizar todo o plano de elevação e rapidamente mover sua visualização aumentada a qualquer lugar no plano. O Plano futuro utiliza seus dados de mapeamento para mostrar o que existe à frente. Computador de viagem aprimorado Obtenha 33% mais dados na tela de uma vez com novas opções de layout. Acrescente várias páginas de campos de dados, sendo cada uma personalizável para 1 a 4 layouts: 2 grandes, 1 grande e 4 pequenos, 6 pequenos ou 8 pequenos. Monitoramento de atividades (Calendário) Monitore suas atividades, pontos de passagem e geocaches acumulados; monitora no dia em que você as realiza. Gerenciamento avançado dos pontos de passagem Todos os dados são exibidos e são editáveis em uma tela. Exclua um ou vários pontos de passagem de uma .   Dados físicos e de desempenho:  Dimensões da unidade, LxAxP  2,4\" x 4,5\" x 1,3\" (6,1 x 11,4 x 3,3 cm) Tamanho do visor, LxA  1,5\"L x 2,5\"A (3,8 x 6,3 cm); 3\" diag (7,6 cm) Resolução do visor, LxA  240 x 400 pixels Tipo de visor  TFT colorida sensível ao toque transflectiva Peso  7,4 oz. (209,8 g) com baterias Bateria  bateria de NiMH recarregável (inclusa) ou 2 pilhas AA (não inclusas); recomendável NiMH ou lítio Duração da bateria  16 horas À prova d'água  Sim (IPX7) Flutua  Não Receptor de alta sensibilidade  Sim Interface  compatível com USB de alta velocidade e NMEA