  {code: "010-00928-01", description: "Sistema Global de Posicionamento (GPS) Rino 650 da GARMIN, procedência americana. Resistir às tempestades Resista a qualquer tempestade com o rádio de tempo NOAA integrado do Rino que o ajuda a evitar condições meteorológicas perigosas. O rádio apresenta as fronteiras de condados e indicações/avisos de tempestades no ecrã do mapa para que esteja sempre em cima do acontecimento... e seguro.  Localização avançada de contactos Que importância tem um nome? Muita, quando esse nome é Rino. Agora, pode localizar 2 000 pontos de informações por contacto. Para além disso, o gestor de localizações torna fácil manter e consultar quem tem andado a localizar.   Notas melhoradas Nunca mais perca uma nota. O Rino regista a hora e as notas que recebe de contactos para as consultar mais tarde ou reencaminhar.  Painéis de instrumentos Melhore a funcionalidade do seu dispositivo com mais painéis de instrumentos em mais locais. Veja os registos de elevação, as coordenadas, a seta da bússola e mais, em qualquer página, em qualquer momento.   Várias personalidades com vários perfis Personalize o Rino para que seja tão flexível como você. Pode definir diferentes perfis para que possa alternar rapidamente de personalidades baseado na sua actividade actual - passear, conduzir ou outras. Com o Rino, nunca vai ter de perder o seu ritmo.   Modo nocturno Não perca a concentração mesmo depois do pôr-do-sol. O Rino ajusta automaticamente as cores depois do pôr-do-sol para que possa continuar a sua caminhada.  GPS robusto + Rádio  Utiliza o HotFix®, um receptor de alta sensibilidade e uma antena quad helix para obter sinais de satélite Oferece um mapa básico melhorado com Modelo Digital de Elevação Oferece suporte para mapeamento melhorado com acesso a TOPO U.S. 24K, Imagens de satélite BirdsEye, Mapas personalizados Garmin, City Navigator NT®, BlueChart® g2 e muito mais (vendidos separadamente) Utiliza o formato de ficheiros universal GPX para armazenar dado