  {code: "010-00564-01", description: "Receptor GPS com Rádio VHS, GARMIN Rino® 530 HCx (procedência americana) – É a integração de um navegador GPS com um rádio de duas vias com 5W de potência, sendo o mais completo da família Rino, pois incorpora uma bússola eletrôni-ca, um altímetro barométrico e um receptor de alta sensibili-dade com 12 canais paralelos e habilitado ao WAAS (não ope-racional no Brasil). Possui expansão de memória através de um “slot” microSD para o uso de cartões de dados com mapas com-plementares dos produtos MapSource (opcionais). Tela colorida TFT (256 cores). A prova de água (grau IPX-7). Permite enviar a sua exata localização para outro Rino numa distância de até 22 km (em campo aberto) e sendo um rádio de padrão FRS/GMRS, ele poderá se comunicar com qualquer outro rádio neste padrão de freqüência. Possui uma base cartográfica das Américas Recreacional (inclu-indo o Brasil), apresentando lagos, rios, cidades, rodovias, ferro-vias e a costa litorânea. Memória para 500 pontos de caminha-mento alfanuméricos (waypoints) com símbolos gráficos; 50 rotas reversíveis; gravação de até 20 trilhas (10.000 pontos) com a fun-ção de cálculo de área. Incorpora um computador de viagem, calendário de caça e pesca; tabelas celestiais (nascer e pôr do Sol e da Lua). Permite o posi-cionamento em coordenadas geográficas ou UTM. Utiliza o da-tum Córrego Alegre ou SAD69. Rádio com 22 canais e 38 códigos; ativação por voz (VOX) com  controle de sensibilidade. Permite a transmissão de pequenos tex-tos, para comunicação silenciosa e possui alarme vibratório. Alimentação através de bateria recarregável de íons de Lítio com autonomia de até 14 horas. Tela TFT colorida, com retroilumina-ção, dimensões de 3,3 x 4,3 cm e resolução de 176 x 220 pixels. Peso: 292 gramas com a bateria. Precisão do GPS: £ 15 metros RMS. Precisão do altímetro: 3 metros e resolução de 30 centímetros. Precisão da bússola: ± 2º e resolução de ± 1º.  Acessórios inclusos: cabo USB para a transferência dos dados para o PC, programa MapSource Trip & Waypoint Manager, alça de transporte, presilha para cinto, bateria com carregador CA (110V) e guia rápido de instruções em português.   Acessórios básicos: ● Alça de transporte. ● Programa MapSource Trip & Waypoint Manager ● Cabo USB para a transferência dos dados para o PC ● Guia de instruções em português. ● Presilha para cinto ● Bateria com carregador CA (110V)", name: "GPS RINO530HCX", manufacturer: "GARMIN IMPORTADO", price: "1859.0", price_3x: "620.0", price_30_days: "1769.0", price_cash: "1769.0", rev_icms18: "1769.0", rev_icms12: "1679.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
