  {code: "RM9255SGXBRYT", description: "Tela de 7.0\" sensivel ao toque Bluetooth®: Transforma seu RoadMate em um hands-Free Viva voz para garantir a segurança enquanto o veículo está em movimento.  A/V in entrada de audio e vídeo: Fácil conexão com dispositivos externos, como câmeras de ré, DVD players, Sintonizador de TV digital e iPods.  Junction View: Representações realistar para garantir que você faça a curva certa no tempo certo.  Receptor de TMC integrado: O sitema de informações de transito online pode ser habilitado sem a necessidade de hardware extra.  OneTouch™ Menu: Permite o acesso instantâneo aos seus lugares favoritos de forma personalizada. Text-to-Speech (TTS): Informa verbalmente o nome das ruas para as próximas manobras.  Alerta de Camera de Volocidade: Informa a localização das cameras de velocidades para evitar acidentes.  Garantia de mapa atualizado por 60 dias: A garantia de mapa permite que o usuário atualize seu GPS para a versão de mapa mais atual da Magellan por  até 60 dias depois da compra.  Mais de um milhão de PDIs com qualidade: Todos os pontos de interesse são verificados e com alta qualidade.  Alerta de limite de velocidade: Dirija com mais segurança com os avisos visuais e verbais de limite de velocidade.  Busca de POIs em indicações de saídas das estradas: Encontre postos de gasolina, restaurantes, hotéis e muito mais nas proximidades das saídas das estradas.   Recálculo automático de rota: Permite-lhe rapidamente voltar ao trajeto correto caso você tenha errado o caminho.", name: "GPS ROADMATE 9255 YT", manufacturer: "MAGELLAN", price: "1129.0", price_3x: "376.0", price_30_days: "1129.0", price_cash: "1099.0", rev_icms18: "1099.0", rev_icms12: "1039.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00876-03BR", description: "DETALHES  Fique em contato com as estradas — deixe o zūmo 220 mostrar-lhe o caminho. O acessível e compacto navegador zūmo 220 para motocicletas possuí uma perfeita integração com o guidão da sua moto e pronto a guiá-lo falando o nome das ruas de modo sem fios no seu capacete ou fone de ouvido habilitados ao Bluetooth®. Projetado por Motociclistas para Motociclistas O zūmo 220 tem uma nítida tela de toque colorida, de fácil uso com luvas e que proporciona todas as informações que você necessita em um formato de fácil visualização. Ela é fácil para você visualizar sob o sol do meio dia ou em uma noite sem luar. Uma interface intuitiva torna a entrada das informações tão fácil quanto mudar de marchas. Todavia não se engane, pois este não é um navegador automotivo - foi concebido para o uso em motos. Ele é muito resistente. Com sua caixa robusta a prova de água que resiste a espirros de combustível e raios UV, o zūmo 220 é construído para a vida na estrada. Siga o Seu Próprio Caminho Escolha a sua rota e pegue as estradas. O zūmo 220 está pronto, mesmo para navegação fora-de-estrada, diretamente da caixa. Ele está pré-carregado com o City Navigator® NT e Autoguias GPS com mapas de ruas e milhares de pontos de interesse (POIs) que incluem motéis, restaurantes, postos de combustíveis, caixas eletrônicos e mais. Ele possuí comandos de voz, direções curva-a-curva que falam os nomes das ruas ao seu destino e exibe os limites de velocidade na maioria das estradas. Adicionalmente, o zūmo 220 oferece ajuda de faixa (ainda não disponível no Brasil) que indica a escolha da faixa apropriada nas mudanças em rodovias complicadas. O zūmo 220 também tem como padrão um indicador digital de combustível que o auxiliará a manter um controle do consumo. E no final da viagem ele poderá ser guardado com facilidade no bolso da sua jaqueta. Planeje e Compartilhe as Suas Viagens Procurando a estrada perfeita para compartilhar com os seus amigos estradeiros? Ou talvez você está planejando cruzar o país e querendo evitar ao máximos estradas interestaduais. Com a poderosa ferramenta para planejamento de viagens, o zūmo 220 poderá ajudá-lo a criar rotas personalizadas através do computador e a transferir a sua rota gravada diretamente ao seu zūmo. Uma vez em casa, você poderá rever as suas viagens no Google™ Earth. Também um cartão de expansão microSD™, tornará fácil compartilhar rotas e aumentar a capacidade de armazenamento. Visite o Garmin Connect — a comunidade \"online\" de rotas e viagens. Ele é uma grande fonte de busca para encontrar novas viagens e planejamento de viagens. Alterne os Modos de Uso Só porque a sua moto está parada, não significa que o seu dia acabou. O zūmo 220 também poderá ser usado como um navegador no seu carro ou caminhoneta quando for necessário. Além de incluir um suporte para a motocicleta, o zūmo 220 também vem acompanhado de um suporte automotivo e um cabo de alimentação. Acessórios incluídos no Zumo 220: * Pré-carregado com o City Navigator® NT para a América do Norte (cobertura total) * DVD do MapSource® City Navigator North America NT (licença plena) * Suporte para motocicleta com acessórios de montagem * Cabo de alimentação com fios nús * Bateria removível * Suporte automotivo com ventosa * Cabo de alimentação veicular * Cabo USB * Disco para painel de automóvel * Manual de início rápido * Instruções de instalação", name: "GPS ZUMO 220", manufacturer: "GARMIN BR", price: "1359.0", price_3x: "453.0", price_30_days: "1359.0", price_cash: "1359.0", rev_icms18: "1329.0", rev_icms12: "1269.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00258-53", description: "O sensor GPS16 X-HVS apresenta um receptor de alta sensibilidade, antena integrada e um design resistente e à prova d'água, o que o torna útil para diversas aplicações OEM. Obtenha dados precisos  Esse receptor de 12 canais de alta sensibilidade rastreia satélites continuamente e informa sua posição exata. Ele também é habilitado para WAAS, podendo determinar sua localização em um raio de 3 metros, sem usar um receptor de sinal DGPS externo. Deixe a interferência para trás  O GPS 16x oferece um excelente desempenho de EMI/RFI. Dessa forma, você pode usá-lo próximo a dispositivos de computação e equipamentos de comunicação sem fio sem se preocupar com interferência.  O GPS 16x é um sensor GPS de alta sensibilidade que substitui o GPS 16.", name: "GPS16 X-HVS", manufacturer: "GARMIN BR", price: "639.0", price_3x: "213.0", price_30_days: nil, price_cash: "609.0", rev_icms18: "579.0", rev_icms12: "549.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00321-36BR", description: "O GPS 18x é um sensor GPS de alta sensibilidade OEM para uso em aplicações automotivas, de veículos de frota e eletrônicas que exigem um receptor GPS pequeno e altamente preciso.  Use em espaços pequenos  Esse receptor GPS de alta sensibilidade, com recurso WAAS e 12 canais paralelos, está disponível em versões de nível serial CMOS ou USB 2.0 em velocidade total e possui uma base magnética integrada. Esse receptor em forma de disco de hóquei possui 2,4 polegadas de diâmetro e pesa poucas gramas, o que faz dele uma solução ideal para aplicações onde o espaço é limitado.  Escolha o tipo de conexão  O GPS 18x é fornecido com três configurações de cabo diferentes. Todas essas versões do GPS 18x possuem memória não volátil para o armazenamento de informações de configuração, um relógio de tempo real e dados de medida não processados para aplicações sofisticadas dos clientes.  GPS 18x PC — possui um conector serial de pinos DB-9 com adaptador de isqueiro de 12 volts e pode produzir dados em formato NMEA 0183 (padrão do setor) ou no formato proprietário da Garmin. GPS 18x USB — possui um conector USB estilo A, compatível com hosts USB 2.0 e 1.1 em velocidade total e pode produzir dados somente no formato proprietário da Garmin. GPS 18x LVC — possui fio nu para realizar conexões em diversas aplicações e pode produzir dados no formado NMEA 0183 (padrão do setor) ou no formato proprietário da Garmin. Oferece saída de nível lógico em pulsos por segundo com extremidade ascendente alinhada para até 1 micro-segundo do tempo UTC. O GPS 18x OEM é um sensor GPS de alta sensibilidade que substitui o GPS 18 OEM.", name: "GPS18X LVC", manufacturer: "GARMIN BR", price: "469.0", price_3x: "156.0", price_30_days: "469.0", price_cash: "449.0", rev_icms18: "419.0", rev_icms12: "399.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: ni