  {code: "010-00764-01BR", description: "O GPSMAP 421S é um chartplotter compacto que possui um visor colorido QVGA ultra-brilhante de 4” e um design digital aprimorado de alta velocidade, para permitir mais rapidez no desenho dos mapas e na exibição de panoramas. Ele pode ser usado imediatamente, com um mapa base mundial interno e uma interface de fácil utilização projetada para ajudá-lo a navegar com facilidade em mar aberto. O GPSMAP 421 também suporta cartões BlueChart® g2 Vision para obtenção de mais recursos e funcionalidades, como imagens de satélite de alta resolução, visualizações em 3-D e a tecnologia de Orientação Automática.  Exiba o mapa base mundial alimentado por satélite  O mapa base do GPSMAP 421 contém imagens de satélite do mundo todo em vez dos mapas tradicionais. O GPSMAP 421 vem de fábrica com um receptor GPS de alta sensibilidade, para um melhor rastreamento via satélite e tempos de aquisição mais rápidos. E, com um slot de cartão SD, é fácil adicionar mais mapas sem conectar-se a um computador.  Adicione um sonar  Quando aplicável, a versão de sonar, o GPSMAP 421s, é acompanhada por um potente transdutor de dupla freqüência que ilustra com clareza contornos de profundidade, alvos de pesca e estruturas, independentemente de você estar pescando em água doce ou em mar aberto. O GPSMAP 421 e o GPSMAP 421s também possuem a certificação NMEA 2000 para uma melhor conectividade com sensores, instrumentos e futuras ofertas marítimas.  Adicione extras com o BlueChart g2 Vision  Com o cartão SD BlueChart g2 Vision opcional, é possível adicionar uma grande variedade de novos recursos incríveis ao seu chartplotter.  As visualizações MarinerEye e FishEye oferecem uma perspectiva tridimensional das informações do mapa, acima e abaixo do nível do mar. Imagens de satélite de alta resolução e fotografias aéreas ajudam você a orientar-se em áreas não-familiares. A tecnologia de Orientação Automática pesquisa em todas as cartas relevantes e cria uma rota que você possa realmente seguir — uma rota que evite obstáculos, águas rasas, bóias e outras obstruções.   Conteúdo da caixa:  GPSMAP 421/421s* Instalação com suporte inclinado/giratório Tampa frontal protetora Cabo de alimentação/dados Documentação *O sonar está disponível com ou sem o transdutor de dupla freqüência. Consulte a guia de versões para obter os detalhes.   Especificações Físico e desempenho: Dimensões da unidade, LxAxP: 5.7\" x 5.0\" x 2.7\" (14.5 x 12.7 x 6.9 cm) Tamanho do visor, LxA: 2.4\" x 3.2\", 4.0\" diagonal (6.1 x 8.1 cm, 10.2 cm diagonal) Resolução do visor, LxA: 240 x 320 pixels Tipo de visor: QVGA display Peso: 590 g À prova d'água: sim (IPX7) Mapas e memória: Mapa base: sim Mapas de ruas pré-carregados: não Capacidade de incluir mapas: sim Aceita cartões de dados: SD™ card slot Paradas/Favoritos/Localizações: 3,000 Rotas: 100 Características: Compatível com CANet®: não Suporta AIS (rastreia a posição dos navios em alvo): sim Suporta DSC (exibe os dados da posição de rádio VHF com capacidade para DSC): sim Alarmes sonoros: sim Tabelas de marés: sim Informações sobre o sol e a lua: sim Visualização do mapa em 3D: sim (com mapas opcionais BlueChart g2) Compatível com sonar de freqüência dupla: sim Compatível com sonar de feixe duplo: sim Zoom com tela dividida: sim Sonar/GPS com tela dividida: sim Ultrascroll™ (exibir os peixes em alvo em velocidades do barco mais altas): sim Tecnologia See-thru® (expõe os peixes escondidos em abrigos): sim Fish Symbol ID (ajuda a identificar os peixes em alvo): sim Tecnologia AutoGain (diminui a interferência e aumenta os alvos): sim Whiteline (indica fundos duros ou macios): sim Linha de profundidade ajustável (mede a profundidade de objetos submersos): sim Escopo A (exibição em tempo real dos peixes passando através do feixe do transdutor): sim Trava da parte inferior (exibe o retorno à superfície): sim Gráfico e relatório de temperatura da água: sim Sensor de temperatura da água incluso: sim Outros: Freqüência: dual freq: 50/200 kHz Potência de transmissão: 500 W RMS Variação de voltagem: 10-32 Vdc Profundidade máxima: 460 m", name: "GPSMAP 421s", manufacturer: "GARMIN BR", price: "2199.0", price_3x: "733.0", price_30_days: "2199.0", price_cash: "2199.0", rev_icms18: "2199.0", rev_icms12: "2089.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
