ossa realmente seguir — uma rota que evite obstáculos, águas rasas, bóias e outras obstruções.   Conteúdo da caixa:  GPSMAP 521/521s* Instalação com suporte inclinado/giratório Tampa frontal protetora Cabo de alimentação/dados Documentação *O sonar está disponível com ou sem o transdutor de dupla freqüência. Consulte a guia de versões para obter os detalhes. ", name: "GPSMAP 521s", manufacturer: "GARMIN BR", price: "2599.0", price_3x: "866.0", price_30_days: "2599.0", price_cash: "2599.0", rev_icms18: "2599.0", rev_icms12: "2469.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-00868-00BR", description: "O novíssimo navegador portátil GPSMAP 62 possuí tela de 6,6 cm, de fácil visualização sob a luz do sol e 65.000 cores, permitindo o uso de imagens dos satélites BirdsEye™ (assinatura necessária) e mapas personalizados. Robusto e a prova de água, o GPSMAP 62 tem uma antena quadri-helix para excepcional recepção e novo projeto esguio.  Explore O GPSMAP 62 vem com uma base instalada de um mapa mundial com relevo sombreado, assim você poderá navegar facilmente em qualquer lugar. Com navegação por fotos, você poderá baixar fotografias do Garmin Connect™ Photos e navegar até elas.  Mantenha a Sua Posição Com a sua antena quadri-helix de alta sensibilidade, receptor GPS habilitado ao WAAS (não operacional no Brasil) e previsão dos satélites pelo HotFix®, o GPSMAP 62 localiza a sua posição rápida e precisamente e ainda mantém a sua localização GPS mesmo sob densa cobertura e vales profundos. A vantagem é evidente: estando em densas florestas ou próximo à prédios e árvores altas, você poderá contar com o GPSMAP 62 para ajudá-lo a encontrar o seu caminho quando mais precisar.  Adicione Mapas É fácil adicionar novos mapas com a ampla linha de mapas topográficos, marítimos e rodoviários detalhados da Garmin. Com 1,7GB de memória interna, você poderá baixar mapas topográficos de 24K e 100K e caminhar na trilha; baixe o BlueChart® g2 para um grande dia na água ou o City Navigator NT® para rotas curva-a-curva nas estradas. O GPSMAP 62 também suporta imagens dos satélites BirdsEye™ (assinatura necessária), que permite você baixar imagens dos satélites ao seu dispositivo e integrá-las com os seus mapas. Adicionalmente, o 62 é compatível com mapas personalizados, através de um programa gratuito que converte mapas impressos e eletrônicos em mapas transferíveis ao seu dispositivo.  Fique Conectado Você tem estado ocupado nas atividades ao ar livre e agora quer armazenar e analisar estas atividades. Com uma simples conexão no seu computador e na 