  {code: "010-00864-00BR", description: "Para os entusiastas dos esportes náuticos e que querem ter o melhor, o robusto GPSMAP 78 possuí mapas com cores bem definidas, receptor de alta sensibilidade, nova lateral moldada em borracha e uma ranhura para cartão microSD™, permitindo adicionar mapas. E além de tudo ele ainda flutua!  Explore O GPSMAP 78 tem instalada uma base de mapas do mundo, assim você poderá navegar facilmente em qualquer lugar. Assim como os demais produtos da série 78, o GPSMAP 78 é a prova de água com grau IPX7 e flutua na água.  Mantenha a Sua Navegação Com o receptor GPS de alta sensibilidade, habilitado ao WAAS (não disponível no Brasil) e previsão dos satélites HotFix™, o GPSMAP 78 localiza a sua posição rápida e precisamente, mantendo a sua localização GPS mesmo sob espessa cobertura de árvores e vales profundos. A vantagem é clara: se você estiver dentro de florestas ou próximo à grandes prédios e árvores, você poderá contar com a ajuda do GPSMAP 78 para encontrar o seu caminho quando mais precisar dele.  Adicionando Mapas Adicionar novos mapas torna-se fácil com a ampla linha de produtos cartográficos detalhados da Garmin: mapas náuticos, topográficos e rodoviários disponíveis em cartões microSD card. Insira um cartão BlueChart® g2 para um grande dia na água ou um City Navigator NT® para roteamento curva-a-curva nas estradas e ruas (consulte o seu revendedor sobre os mapas compatíveis). A ranhura do cartão está localizada dentro do compartimento de pilhas à prova de água,ficando assim protegido contra umidade. O GPSMAP 78 também suporta imagens do satélite BirdsEye™ (é necessário assinatura), que permite descarregar imagens de satélite ao seu dispositivo e integrá-las com os seus mapas. Adicionalmente, o 78 é compatível com o \"Custom Maps\", programa gratuito que converte mapas de papel e eletrônicos em mapas transferíveis ao seu dispositivo.  Fique Conectado Você esteve ocupado nas explorações e agora quer armazenar e analisar as suas atividades. Com uma simples conexão ao seu computador e à Internet, você poderá obter uma análise detalhada das suas atividade e enviar trilhas ao seu dispositivo usando o Garmin Connect™. Este sítio único oferece uma tabela de atividades e permite que você reveja as suas atividades usando o Google™ Earth. Explore outras rotas disponibilizadas por milhões de usuários do Garmin Connect e compartilhe as suas experiências no Twitter® e no Facebook®. É fácil iniciar, então vá até lá, explore e compartilhe.  Encontre Diversão O GPSMAP 78 suporta arquivos GPX para descarregar caças aos tesouros (geocaches) e detalhes diretamente para a sua unidade. Pelo fato de não usar papel, você estará não apenas ajudando o meio ambiente, mas também estará aperfeiçoando a sua eficiência. O GPSMAP 78 armazena e exibe informações chaves, incluindo a localização, terreno, dificuldade, dicas e descrições, significando que você não precisará mais plotar coordenadas em mapas de papel e consultar apontamentos! Simplesmente carregue o arquivo GPX na sua unidade e comece a caçar os seus tesouros. Esguio e leve, o 78 é a companhia perfeita para todas as suas atividades ao ar livre.  GPSMAP 78: mapas coloridos, projeto robusto e flutuante — tudo que um marinheiro precisa.  Acessórios incluídos com o GPSMAP 78: * Alça de transporte  * Cabo USB * Manual de início rápido   Informações adicionais.Fabricante Garmin  Garantia (12) doze meses contra eventuais defeitos de fabricação  Dimensões da unidade, LxAxP 6,6 x 15,2 x 3,0 cm  Tam. tela, LxA 4,1 x 5,6 cm; 2.6\" (6,6 cm) na diagonal  Resolução da tela, LxA 160 x 240 pixels   Tipo de tela transrefletiva, TFT com 65.000 cores  Peso 218,3 g com as pilhas   Bateria 2 pilhas AA (não incluídas); recomenda-se usar NiMH recarregáveis  Autonomia da bateria 20 horas   A prova d'água Sim (padrão IPX7)  Flutuante Sim  Receptor de alta-sensibilidade Sim  Interface USB  Base de mapa Sim  Mapas pré-carregados -  Permite adicionar mapas Sim  Memória interna 1,7 GB  Tip