  {code: "010-00864-01BR", description: "Para os entusiastas dos esportes náuticos e que querem ter o melhor, o robusto GPSMAP 78s possuí uma bússola de 3 eixos, altímetro barométrico, mapas com cores bem definidas, receptor de alta sensibilidade, nova lateral moldada em borracha e uma ranhura para cartão microSD™, permitindo adicionar mapas. E além de tudo ele ainda flutua!  Assim como os demais produtos da série 78, o GPSMAP 78s é a prova de água com grau IPX7 e flutua na água.  Obtenha as Suas Direções O GPSMAP 78s tem incorporado uma bússola eletrônica com compensação nos 3 eixos, que exibe a você a direção mesmo estando parado e sem segurar o GPS nivelado. O seu altímetro barométrico rastreia mudanças na pressão para calcular a sua altitude com precisão e até mesmo você poderá usá-lo para traçar a pressão barométrica em um determinado período de tempo, monitorando assim mudanças nas condições climáticas.  Compartilhamento Sem Fio Com o GPSMAP 78s você poderá compartilhar os seus pontos (waypoints), trilhas, rotas e caças aos tesouros, de modo sem fio, com outros usuários de dispositivos compatíveis. Agora você poderá enviar o seu local favorito de pesca para uma amigo usufruir. O compartilhamento de dados é fácil: apenas pressione “enviar” para transferir as informações para unidades similares.  Mantenha o Sua Navegação Com o receptor GPS de alta sensibilidade, habilitado ao WAAS (não disponível no Brasil) e previsão dos satélites HotFix™, o GPSMAP 78s localiza a sua posição rápida e precisamente, mantendo a sua localização GPS mesmo sob espessa cobertura de árvores e vales profundos. A vantagem é clara: se você estiver dentro de florestas ou próximo à grandes prédios e árvores, você poderá contar com a ajuda do GPSMAP 78s para encontrar o seu caminho quando mais precisar dele.  Adicionando Mapas Adicionar novos mapas torna-se fácil com a ampla linha de produtos cartográficos detalhados da Garmin: mapas náuticos, topográficos e rodoviários disponíveis em cartõe