  {code: "010-00887-15", description: "O GTU 10 é um localizador GPS que combina serviço de rastreamento baseado na Web com tecnologia GPS para que seja possível vigiar crianças, animais de estimação e propriedades. Você pode rastrear seu GTU 10 em nosso site usando qualquer computador ou com o aplicativo Garmin Tracker™ gratuito.  Como funciona?  O GTU 10 é pequeno, leve e à prova d'água. É facilmente preso à mochila, coleira ou qualquer outro pertence importante para você.  Ao adquirir um novo GTU 10, você também receberá 1 ano de Rastreamento Standard (consulte o mapa de cobertura), assim poderá usá-lo imediatamente ao registrar-se e ativar sua conta Garmin.  Então, você pode exibir a localização do seu GTU 10 em um mapa dos confins do seu computador. Para obter um nível de conveniência adicional, é possível fazer o download do aplicativo Garmin Tracker para seu dispositivo móvel.  Ao usar o seu computador ou celular, você pode também: Crie até 10 cercas virtuais para o seu dispositivo. Quando o seu GTU 10 entra ou sai de uma geofence, podemos lhe enviar uma notificação por e-mail ou mensagem de texto. Crie sessões de rastreamento contínuo (relatórios de localização a cada 15 segundos por até 5 horas). Envie convites para que outras pessoas rastreiem suas atividades*. Excelente para rastrear corridas ou exercícios. Ver histórico dos locais onde o seu GTU 10 esteve. Programe para que seu dispositivo seja ativado e relate sua localização*. Receber alertas quando uma velocidade definida for excedida.* Personalize as configurações do dispositivo para desempenho ideal, incluindo alertas para nível de bateria baixo e de velocidade.  Adquira um  Os recursos do GTU 10 são tão flexíveis que permitem que você os utilize para atender ao seu estilo de vida. Viajantes: Localize bagagens e pertences para que nada se perca ou seja deixado para trás. Pais: Vigie seus filhos no caminho para a escola para garantir que eles cheguem com segurança. Proprietários de animais de estimação: Receba notificações quando o seu animal de estimação sai da geofence para que seja possível encontrá-lo. Corredores: Permita que seus amigos e familiares acompanhem sua corrida ou o seu progresso em corridas diárias.  *Necessita de um plano de serviços de Rastreamento Deluxe.  Características:  É pequeno, leve e à prova d'água. Usa um sensor GPS de alta sensibilidade e pode usar triangulação de torre de celular para obter localização aproximada. Inclui 1 ano de Rastreamento Standard. Inclui bateria de íon de lítio recarregável. Localize dispositivos sob demanda com o computador ou celular. Configure 10 cercas virtuais e receba notificações por mensagens de texto ou e-mail após entrada/saída. Personalize as configurações do dispositivo, incluindo bateria e alertas de velocidade. Envie convite para membros da família e amigos para seguirem seu dispositivo por tempo específico. Acesse por 1 dia o histórico de rastreamento com Rastreamento Standard. Acesse por 7 dias o histórico de rastreamento e os recursos avançados com o Rastreamento Deluxe*. Renove os serviços automaticamente após sua expiração (se desejado). Não há taxas de rescisão, de ativação ou contratos.  Características físicas e desempenho:  Dimensões da unidade, LxAxP: 1,34\" x 3,07\" x 0,79\" (3,4 x 7,8 x 2,0 cm)  Largura: 1,71 oz (48,5 g)  Tipo da bateria: íon de lítio recarregável  Duração da bateria: de 1 dia a 1 mês (dependendo do modo de operação escolhido)  À prova d'água: sim (IPX7)  Receptor de alta sensibilidade: sim  Interface: USB 2.0  Mapas e memória  Capacidade para adicionar mapas: não  Aceita cartões de dados: não  Registro de trajeto: Rastreamento Standard — 1 dia de histórico; Rastreamento Deluxe — Até 20.000 pontos dos últimos 7 dias (dependendo do tipo de modo de operação escolhido)  Recursos  Cercas virtuais por dispositivo: máximo 10  Notificações: e-mail e/ou mensagem de texto  Transferência de unidade para unidade (compartilha dados sem fio com unidades similares): não  Número de dispositivos por conta: ilimitados  Suporta energia externa: sim (consultar os acessórios)  Suporta antena GPS externa: não  links rápidos Manuais Software FAQs Vídeos de treinamento Recomendamos   Plano de serviços para Rastreamento Deluxe, Brasil US$ 14,95   Imagens de satélite BirdsEye™ US$ 29,99   AA South Africa Guide US$ 7,99 Os clientes viram também   Cyclops™ Safety Cameras — U.S. and Canada US$ 25,99   Cyclops™ Safety Cameras — South Africa US$ 16,99   Cyclops™ Safety Cameras — Italy and Slovenia US$ 16,99 Novidades  Acesse o minisite GTU 10 Obtenha o aplicativo gratuito  O Garmin Tracker permite que você rastreie pelo smartphone o que você ama. Disponível no Android Market Disponível na App Store  ", name: "GTU-10", manufacturer: "GARMIN BR", price: "749.0", price_3x: "250.0", price_30_days: "749.0", price_cash: "729.0", rev_icms18: "669.0", rev_icms12: "639.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
