  {code: "KIT003", description: "O receptor GNSS EPOCH 50 da Spectra Precision, com seus 220 canais, faz uso efetivo dos sinais GPS e GLONASS L1/L2 L1/L2/L2C/L5 para oferecer uma excelente cobertura de satélites e posicionamento preciso. O EPOCH 50 usa sua alta tecnologia para proporcionar um centro de fase extremamente estável e monitoramento dos sinais L2C e L5, os mais recentes.  O receptor EPOCH 50 GNSS com o software de campo Survey Pro fornece ferramentas avançadas para o trabalho das equipes de campo. Com o máximo de estabilidade, precisão, qualidade e facilidade de operação, o EPOCH 50 tem tecnologias comprovadas, e que você pode confiar no dia-a-dia de trabalho.  O receptor GNSS EPOCH 50 tem rádio UHF interno, que possibilita receber ou transmitir sinais, de modo a que cada receptor pode ser usado como base ou rover. Use o rádio interno em um canteiro de obras para uma locação de pontos rápida e fácil. O EPOCH 50 suporta também rádio externo e conexão com modem de celular para acrescentar mais flexibilidade e amplitude ao seu projeto. Além disso, possui comunicação livre de cabos via bluetooth, permitindo a escolha de um dos coletores de dados Spectra Precision para operação.  O EPOCH 50 fornece produtividade e economia, com o uso da tecnologia RTK em rede e operações NTRIP. Conecte-se com os coletores de dados da Spectra Precision e obtenha mais flexibilidade.  Projetado para garantir mais de 99,9% de confiabilidade em inicializações, o receptor GNSS EPOCH 50 proporciona resultados rápidos e de alta qualidade em todos os modos de trabalho suportados. Resultados precisos e consistentes, qualidade de construção e preços acessível fazem do EPOCH 50 a escolha ideal para o seu trabalho.  O Software Spectra Precision Survey Office oferece uma solução completa de escritório para o pós-processamento de dados GNSS e ajustamento. Exporte facilmente seus resultados processados e concluídos de volta para o software de campo ou softwares de desenho, usando uma variedad