  {code: "KIT008", description: "O ProMark 220 é a solução mais versátil de pós-processamento ou rover para RTK em rede. O ProMark 220 integra em um único receptor o sistema operacional Windows Mobile 6.5, o software de coleta de dados Survey Pro da Ashtech e a antena ASH-661 (L1/L2 GNSS).  Graças à tecnologia Z-BLADE, o ProMark 220 faz uso de todos os sinais GNSS para  fornecer posições RTK de alta precisão, mesmo em ambientes onde a cobertura GPS é insuficiente, mas outras constelações, como GLONASS, são visíveis. Seu excepcional desempenho de pós-processamento com curto tempo de ocupação oferece maior produtividade para as equipes de campo.  Muito leve, com um design compacto e robusto, grande espaço em memória e autonomia, o ProMark 220 foi concebido para uma utilização confortável e produtiva em campo. Seu modem GSM/GPRS incorporado faz do ProMark 220 uma poderosa solução adequada para qualquer aplicação para RTK-NTRIP. O ProMark 220 é extremamente rentável, atendendo aos requisitos mais exigentes para uma solução de levantamento de ponta. Juntamente com os softwares de levantamento de campo Survey Pro ou Fast Survey, permite a operação com um vasto número de ferramentas, incluindo calibração local, locação de pontos, e projetos onde são usados instrumentos óticos, como estações totais.  ESPECIFICAÇÕES TÉCNICAS  - Constelação: GPS, GLONASS, SBAS  - Freqüência: L1, L2  - Canais: 45  - Taxa de atualização: 0.05 seg  - Formato dos dados: RTCM 3.1, ATOM, CMR (+), NMEA  - Precisão em tempo real:        RTK (HRMS): 1 cm         DGPS (HRMS): <30 cm         SBAS (HRMS): <50 cm  - Precisão de Pós-Processado (HRMS): 0.5 cm + 1 ppm  - Tempo para a primeira correção: 15 seg  - Faixa de Inicialização: Até 40 km  - Processador: 806 MHz  - Sistema Operacional: Windows Embedded Handheld 6.5  - Comunicações: GSM / GPRS, BT, WLAN  - Tamanho da unidade: 190x90x43mm - Peso: 0,62 kg  - Display: 3,5\"  - Memória: 256 MB SDRAM /2 GB / SDHC  - Temp. de operação: -20 ° C a 60 ° C - Imp