  {code: "KIT007", description: "O receptor GNSS ProMark 800, com seus 120 canais, oferece rastreio de sinais de satélite em L1/L2/L5 GPS + GLONASS + GALILEO para uso em topografia e geodésia. Esta é uma solução poderosa para levantamentos RTK, livre de cabos, robusta e inteligente, que fornece posicionamento GNSS de forma precisa.  A nova tecnologia Z-Blade GNSS Centric otimiza sinais GNSS e tira proveito de cada constelação GNSS para calcular posições RTK de forma rápida e estável, mesmo quando a cobertura GPS é insuficiente, como em centros urbanos ou sob copas de árvores. Diferentemente da maioria dos outros receptores GNSS que priorizam os sinais de satélite GPS sobre os sinais de outras constelações, o ProMark 800 com tecnologia Z-Blade não é mais dependente do GPS (o que exige um mínimo de 4 a 5 satélites GPS para adquirir e manter um posicionamento preciso). O algoritmo de Z -Blade GNSS Centric trata todos os sinais de satélite disponíveis de forma igual e combina-os para o desempenho ideal.  • Obter e manter soluções RTK mesmo se a cobertura GPS é insuficiente • Confiabilidade na solução em centros urbanos e sob a copa de árvores • Mecanismos de detecção de sinais para rápida aquisição e reaquisição de sinais GNSS • Minimização dos efeitos de multi-caminhamento  A mistura de um desempenho excepcional RTK e design compacto torna o ProMark 800 uma solução RTK extremamente poderosa e atraente para os mais exigentes profissionais. Impermeável, resistente a queda, leve e com bateria de longa duração, o ProMark 800 oferece uma operação durante todo o dia e em todas as condições ambientais.  O ProMark 800 inclui módulos de comunicação sem fios para o máximo de mobilidade e flexibilidade no campo. Sua função de ponte RTC permite um conectar a uma rede um ProMark 800 rover RTK para retransmissão de correções para vários rovers.  • UHF e GSM/GPRS/3.5G • Vários modos de operação e configurações • Suporte estendido de protocolos e formatos de dados  Combine o receptor ProMark 800 com o software de campo, software de escritório e coletor de dados de sua escolha para criar uma solução robusta:  • Survey Pro: fornece um conjunto completo de recursos para todos os seus projetos de levantamento ou locação de pontos • FAST Survey: simplifica a coleta de dados e operação em tempo real • Spectra Precision Survey Office: ideal para o processamento e análise de dados GNSS e de levantamentos ópticos gravados no campo • GNSS Solutions: oferece apoio para uma ampla gama de aplicações.  A terceira geração do coletor de dados Ranger da Spectra Precision oferece uma grande e brilhante tela touch screen, teclado alfa-numérico, fácilidade de operar, e é construído com as características necessárias para enfrentar condições extremas. Sua construção robusta, está certificado com o rigoroso padrão militar MIL-STD-810G, contra quedas, vibração, umidade e temperaturas extremas e, com uma classificação IP67, ele é projetado para manter seu investimento e seus dados seguros. O Ranger tem Survey Pro e Windows Mobile 6.5 a bordo, com a capacidade de executar a versão móvel de todos os seus programas favoritos, incluindo capacidades de Excel e Outlook. O bluetooth integrado permitem você se conectar a equipamentos de campo sem cabos. O Rangers 3 vem de fábrica com 8 GB de memória interna para armazenamento de dados. Mova seus arquivos de forma rápida e fácil usando um cartão SDHC, Bluetooth, cabo USB, pen drive, WiFi ou via GSM.  ESPECIFICAÇÕES TÉCNICAS  • PROMARK 800  - Constelação: GPS/GLONASS/GALILEO/SBAS - Frequência: L1/L2/L5 - Canais: 120 - Taxa de atualização: 0,05 seg - Formato de dados: RTCM 3.1, ATOM, CMR(+) e NMEA - Precisão em tempo real:      RTK (HRMS): 1 cm      DGPS (HRMS): < 30 cm      SBAS (HRMS): < 50 cm - Precisão pós-processada (HRMS): 0,3 mm + 0,5 ppm - Tempo de inicialização: 2 seg  - Alcance de Inicialização: Até 40 km  - Comunicações: UHF, GSM/GPRS/3.5G, BT  - Dimensões: 22,8 x 18,8 x 8,4 cm - Peso: 1,4 kg - Display: LED - Memória: 