  {code: "990651A-50", description: "Hoje com o MobileMapper 10, a Spectra Precision torna possível o uso de um receptor GIS profissional para qualquer necessidade de campo.  Aumente sua produtividade em mapeamento com o MobileMapper 10 Faça coletas em tempo real com precisão sub-métrica; Conecte equipe de campo e escritório para obter o máximo rendimento; Alcance precisões de até meio metro com pós-processamento. Descomplique e comece a trabalhar com o MobileMapper 10 Solução completa para uso em campo e escritório; Interface amigável com o Windows Mobile 6.5; Câmera de 3 Mega Pixels  Software fácil de usar, com rápida aprendizagem e operação.  Feito para equipes de trabalho  Design compacto e leve para melhor mobilidade e operação; Comunicação integrada para fácil transferência de dados; Um único receptor oferece duração de bateria por dias; Reforçado para uso ao ar livre.  MobileMapper Fied e MobileMapper Office: uma solução completa  O conjunto de softwares MobileMapper inclui todas as funcionalidades GIS que os profissionais realmente precisam, sem o problema com funções complicadas e raramente usadas, tanto no campo quanto no escritório; Instalado nos receptores MobileMapper, o MobileMapper Field é a solução perfeita para coleta de dados GIS, registro de feições, medições de áreas, criação e atualização de mapas. O software é muito intuitivo e fácil de usar, requerendo treinamento mínimo. Ele também oferece interface com sensores externos para uma solução completa.  A ferramenta MobileMapper Office pode ser usada para o pós-processsamento dos dados brutos coletados com o software MobileMapper Field. Com uma conexão de internet, o MobileMapper Office pode automaticamente encontrar e baixar os arquivos de bases referência que correspondem aos dados de coleta, corrigindo as posições levantadas.  Adapte o MobileMapper 10 com sua aplicação  Com o Windows Mobile 6.5 você pode fazer a instalação de ferramentas de acordo com seu trabalho. Pode fazer coletas de ponto e mapas através da aplicação de GIS de sua escolha, ou com um software a parte, tais como ESRI ArcPad ou uma aplicação Spectra Precision. Especificações Técnicas  Constelação: GPS Canais: 20 Frequencia: L1 Taxa de atualização: 1 Hz Formato de dados: NMEA Saída de dados brutos: Não Precisão em tempo real SBAS (HRMS): 1-2 m Precisão pós-processamento (HRMS): <0.5 m Processador: 600 MHz Sistema operacional: Windows Mobile 6.5 Comunicação: GSM/GPRS, WiFi, Bluetooth, USB Dimensões: 169 x 88 x 25mm Peso: 380 g com bateria  Tela: 3.5” Memória: 128MB SDRAM, 256 MB Flash, Micro SDHC (até 8GB) Temp. Min (°C): -10°C Temp. Max (°C): +60°C Proteção: IP54 Quedas e choques: 1,2 m Energia (tipo - duração): Li-Ion, 3000mAh  > 20 horas Antena: Interna/Externa Opções de firmware: Não Opções de software: Sim (Mobile Mapper Field incluso)", name: "MOBILE MAPPER 10", manufacturer: "SPECTRA PRECISION", price: "6789.0", price_3x: "2263.0", price_30_days: "6589.0", price_cash: "6449.0", rev_icms18: "6109.0", rev_icms12: "5799.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
