  {code: "990660-ASH", description: "Nova geração de Estação de Referência: O ProFlex 800 CORS (Estação de Referência de Funcionamento Contínuo), é a melhor solução para a coleta, armazenamento e transferência de dados brutos GNSS de alta qualidade para o pós-processamento em levantamentos topográficos, geodésicos e outras aplicações. A programação automática de sessões, a interface Web prática, o conversor RINEX incluído, a funcionalidade de “push” FTP e muitas outras características CORS avançadas fazem do ProFlex 800 CORS uma solução potente, robusta e simples. Robusto e com uma classificação IP67, o receptor foi desenvolvido para suportar ambientes rigorosos.  Z-Blade: Dados brutos GNSS de alta qualidade: O ProFlex 800 CORS, equipado com tecnologia Z-Blade Ashtech - garante uma elevada qualidade dos dados brutos, disponibilidade e confiabilidade, assegurando as melhores medidas possíveis de quatro constelações GNSS: GPS (incluindo L5), GLONASS, SBAS e GALILEO.  Receptor de campo para aplicações múltiplas: O receptor Spectra Precision ProFlex 800 CORS foi otimizado para o funcionamento como CORS, mas graças ao seu design inovador, flexível e ultra robusto, pode ser igualmente usado como um receptor de campo GNSS, uma estação base portátil / permanente para o pós processamento ou outras aplicações RTK. Além de criar arquivos de dados brutos no formato Ashtech ATOM ou RiINEX, o ProFlex 800 CORS consegue criar simultaneamente correções RTK em tempo real numa grande variedade de formatos e métodos de comunicação incluindo IP Direto, servidor NTRIP, UHF, GSM E Ethernet.  Funções importantes: ■ Especialmente criado e adaptado para aplicações CORS; ■ Revestimento ultra robusto que suporta ambientes rigorosos; ■ Tecnologia GNSS Z-Blade para dados brutos de alta qualidade; ■ Memória interna ampliada (8 GB) para o armazenamento de dados; ■ Controle remoto abrangente da estação de referência por meio da interface Web prática; ■ Programação rápida e avançada de sessões; ■ Conversor RINEX incluído (RINEX 2.11 e 3.01 são suportados); ■ Podem ser criados simultaneamente até dois arquivos RINEX com dois períodos diferentes; ■ Conversão RINEX rápida (arquivo RINEX imediatamente disponível após o início de uma sessão de forma a corresponder aos requisitos de serviços IGS rápidos e ultra rápidos); ■ Os arquivos de dados brutos podem ser transferidos automaticamente para um servidor FTP externo; ■ Servidor e NTRIP caster incluídos; ■ Relatórios de e-mails automáticos sobre possíveis avarias detectadas pelo receptor; ■ Suporte para sensores meteorológicos e de inclinação; ■ Servidor FTP incluído.  ESPECIFICAÇÕES TÉCNICAS DO PROFLEX 800 CORS.  Características GNSS: ■ 120 canais: - GPS L1 C/A, L1/L2 P, L2C, L5; - GLONASS L1 e L2 C/A; - GALILEO E1 e E5 (incluindo satélites de teste GIOVE-A e GIOVE-B); - SBAS (WAAS / EGNOS / MSAS); - Código totalmente independente e medição de fases. ■ Tecnologia Z-Blade para um excelente desempenho GNSS: - A mais alta qualidade de dados brutos (disponibilidade/confiabilidade) para corresponder às aplicações da estação de referência; - Algoritmo cêntrico GNSS da Ashtech: localização e processamento totalmente independentes e sinais GNSS¹; - Motor de detecção rápida de sinais para aquisição rápida e nova aquisição de sinais GNSS; - Solução RTK rápida e estável. ■ Até 20 Hz de dados brutos em tempo real e saída de posição. ■ Técnica de atenuação avançada de multi-caminhamentos. ■ Modos de base e dispositivos móveis RTK, pós-processamento.  Precisão em tempo real (RMS)²,³  SBAS (WAAS/EGNOS/MSAS): ■ Horizontal < 50 cm. Posição DGPS em tempo real: ■ Horizontal 25 cm + 1 ppm em  condições típicas³,4. RTK: ■ Horizontal: 1 cm + 1 ppm4. ■ Vertical: 2 cm + 1 ppm4 . Flutuante RTK: ■ 5 cm + 1 ppm (estado estável) horizontal para linhas-base de até 1000 km.  Desempenho em tempo real RTK imediato® Inicialização: ■ Inicialização típica de 2 segundos para linhas-base < 20 km. ■ Até 99,9% de confiabilidade. Alcance de inicialização RTK: ■ > 40 km.  Precisão pós-processamento (RMS)²,3 Estático, Estático rápido: ■ Horizontal 5 mm + 0,5 ppm. ■ Vertical 10 mm + 1 ppm. Estático longo5: ■ Horizontal 3 mm + 0,5 ppm. ■ Vertical 6 mm + 0,5 ppm. Cinemático pós-processado: ■ Horizontal 10 mm + 1,0 ppm. ■ Vertical 20 mm + 1,0 ppm.  Características de registro de dados: Intervalo de gravação ■ 0,05 - 999 segundos  Memória: ■ 8 GB de memória interna. ■ Função “Ring File Memory” que assegura o uso ilimitado do meio de armazenamento. ■ A memória é expansível por meio de dispositivos de memória USB externo ou de discos rígidos.  Sessões: ■ Até 96 sessões por dia. ■ Conversor RINEX incluído. ■ Função “push” FTP automática melhorada.  Conversor RINEX incluído: ■ RINEX 2.11 e 3.01 são suportados. ■ Conversão rápida. ■ Até dois arquivos RINEX com duas taxas diferentes simultaneamente.  Base RTK: ■ RTCM-2.3 e RTCM-3.1. ■ CMR e CMR+. ■ ATOM e DBEN (formatos proprietários).  Dispositivo móvel RTK: ■ Até 20 Hz de saída da posição RTK rápida. ■ RTCM-2.3 e RTCM-3.1. ■ CMR e CMR+. ■ ATOM, DBEN e LRK (formatos proprietários). ■ Redes: VRS, FKP, MAC. ■ Protocolo NTRIP. ■ Saída de mensagens NMEA0183.  Servidor Web incluído: ■ Servidor Web protegido por senha. ■ Monitoramento e configuração totais do receptor. ■ Função “push” FTP. ■ Servidor FTP incluído e NTRIP caster. ■ Servidor NTRIP e fluxo imediato de vários dados em tempo real na Ethernet. ■ DHCP ou configuração manual (endereço IP estático). ■ Suporte tecnológico DynDNS® .  Integração total do sensor MET/TILT: ■ Ambos os tipos de sensores podem ser conectados simultaneamente. ■ Os dados “Met and Tilt” podem ser: - Registrados em conjunto com os dados GNSS. - Transmitidos em tempo real.  Interface I/O (conectores robustos e à prova de água): ■ 1 x RS232/RS422 até 921,6 kbits/seg. ■ 2 x RS232 até 115,2 kbits/seg. ■ Host e dispositivo USB 2.0. ■ Bluetooth 2.0 + EDR Classe 2, perfil SPP. ■ Ethernet (10 Base-TX / 100 Base-TX Full- Duplex, autonegociação). ■ Saída PPS. ■ Entrada de marcador de eventos. ■ Saída 12V/0,5A (pico 1A) disponível na porta serial A. ■ Interface I/O óticamente isolada (exceto USB). ■ Preparado para barramento CAN (compatível com NMEA200). ■ Entrada do relógio de referência externa.  Características Físicas: Dimensões: ■ Unidade: 21,5 x 20 x 7,6 cm  Peso. ■ Receptor GNSS: a partir de 2,1 kg.  Características ambientais: ■ Temperatura de operação: -30° a +65°C. ■ Temperatura de armazenamento: -40° a +70°C. ■ Umidade: Condensação de 100%. ■ IP67 (à prova de água e de poeira). ■ Névoa salina conforme definido na EN60945. ■ Choque: MIL-STD 810F, Fig. 516.5-10. ■ Vibração: MIL-STD 810F, Fig. 514.5C-17.  Características de potência: ■ Bateria de íons de lítio, 32,5Wh (7,4Vx4,4Ah). Funciona como UPS no caso de uma falha da fonte de alimentação. ■ Autonomia da bateria: > 6,5 horas @20°C com configuração do dispositivo móvel UHF. ■ Entrada 9-36 VDC (com proteção de inversão da polaridade). ■ Consumo típico de energia com antena GNSS: < 5W. ■ Suporta tensão transitória conforme a EN2282 com tensão de entrada de 28V. ■ Modo de suspensão programável. ■ Característica de limites de alimentação DC externa.  Certificações: ■ Cumprimento da diretiva R&TTE (CE) ■ FCC/IC  Componentes complementares do sistema: Conjuntos UHF internos: ■ Pacific Crest Tx/Rx (base e dispositivo móvel). ■ U-Link Rx (somente dispositivo móvel). Conjuntos de transceptores UHF externos: ■ Pacific Crest Tx/Rx. ■ U-Link Tx/Rx. Modem 3.5 G incorporado: ■ UMTS/HxDPA: 2100,1900,850MHz; Tri Banda. ■ GSM/GPRS/EDGE: 850,900,1800,1900,2100 MHz; Quadri Banda. ■ GPRS/EDGE Classe “multislot” 12. ■ Detecção automática 2G-3G. ■ Aprovado por GCF e PTCRB   Antenas: ■ Geodésica: Antena de levantamento GNSS, ganho de 38dB. ■ Anel de estrangulamento: Antena com anel de estrangulamento GNSS, ganho de 39dB.  Software de campo: ■ FAST Survey, Survey Pro.  Software de escritório: ■ GNSS Solutions, Survey Office, RTDS   ¹Todos os sinais GNSS disponíveis são processados de forma uniforme e combinados sem qualquer preferência por algumas constelações para um desempenho excelente em ambientes rigorosos. ²A precisão e as especificações TTFF podem ser afetadas por condições atmosféricas, vários multi-caminhamentos e geometria dos satélites. As especificações de precisão da posição referem-se ao posicionamento horizontal. O erro vertical é normalmente 2 vezes < que o erro horizontal. 3Os valores de desempenho assumem no mínimo cinco satélites, respeitando os procedimentos recomendados no manual do produto. Elevadas áreas de multi-caminhamentos, elevados valores PDOP e períodos de severas condições atmosféricas podem reduzir o desempenho. 4Valor de estado estável para linhas-base < 50 km após um tempo de convergência suficiente. Uso de linhas-base longas, ocupações longas, efemérides precisas. ", name: "PROFLEX 800 CORS", manufacturer: "ASHTECH", price: "44419.0", price_3x: "14806.0", price_30_days: "43089.0", price_cash: "42199.0", rev_icms18: "42199.0", rev_icms12: "40089.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
