  {code: "89823-00", description: "Descrição: O ProMark 700 é o receptor GNSS mais leve no hoje mercado. Muito compacto, fino e sem cabos, o ProMark 700 é portátil, ergonômico e confortável para o uso em campo. A bateria de longa duração permite o funcionamento durante todo o dia, sem a necessidade de recarregar ou substituí-la. Graças à sua construção robusta à prova d'água e seu design, ProMark 700 resiste as condições externas mais extremas.  O RTK rover mais leve do mercado  O ProMark 700 é um receptor GNSS de dupla frequência extremamente leve com 220 canais, para tirar proveito de todos os sinais disponíveis. Sua tecnologia GNSS a bordo e conectividade sem fio fazem do ProMark 700 uma poderosa solução adequada para qualquer aplicação RTK em rede.  Construído para o campo  Muito leve, compacto e sem cabos, o ProMark 700 é projetado para uso confortável em campo. O design resistente à quedas e à prova de água suporta uma gama de temperaturas muito grande, permitindo que o receptor possa ser usado em todas as condições. O ProMark 700 possui uma bateria interna para funcionamento durante todo o dia, garantindo ao topógrafos um dia inteiro de trabalho com uma única carga.  Fácil de usar  Graças à sua interface simples e configuração pronta para o uso, o ProMark 700 é muito fácil de operar. A ausência de módulos adicionais ou recursos desnecessários e raramente utilizados torna este produto acessível para todo tipo de usuário. Seu preço acessível faz dele não só um equipamento fácil de operar, mas também fácil de possuir, sendo a melhor solução de baixo custo.  ESPECIFICAÇÕES TÉCNICAS:   - Constelações: GPS / GLONASS / SBAS  - Frequências: L1/L2 - Canais: 220  - Taxa de atualização: 0.05 seg  - Formato dos dados: RTCM 2.0-3.1, CMR (+)  - Precisão: Tempo real - modo RTK (HRMS): 1 cm  Pós-processado (HRMS): 0.5 cm + 0,5 ppm  - Tempo para de fixação: 10 seg  - Comunicações: Bluetooth 2.0  - Dimensões (mm): 205x205x62  - Peso: 0,65 kg - Memória: 6 MB SDRAM  - Temp. de operação: Mín. (° C): -30 ° C / -22 ° F  Máx. (° C): 65 ° C / 149 ° F  - Proteção: IP 67 / ETS300 019 (choque e vibração)  - Alimentação (tipo / duração): 5000 mAh Li-Ion / 10 horas ", name: "PROMARK 700 GNSS", manufacturer: "SPECTRA PRECISION", price: "37199.0", price_3x: "12400.0", price_30_days: "37199.0", price_cash: "37199.0", rev_icms18: "37199.0", rev_icms12: "35339.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "990657-99", description: "O receptor GNSS ProMark 800, com seus 120 canais, oferece rastreio de sinais de satélite em L1/L2/L5 GPS + GLONASS + GALILEO para uso em topografia e geodésia. Esta é uma solução poderosa para levantamentos RTK, livre de cabos, robusta e inteligente, que fornece posicionamento GNSS de forma precisa.  A nova tecnologia Z-Blade GNSS Centric otimiza sinais GNSS e tira proveito de cada constelação GNSS para calcular posições RTK de forma rápida e estável, mesmo quando a cobertura GPS é insuficiente, como em centros urbanos ou sob copas de árvores. Diferentemente da maioria dos outros receptores GNSS que priorizam os sinais de satélite GPS sobre os sinais de outras constelações, o ProMark 800 com tecnologia Z-Blade não é mais dependente do GPS (o que exige um mínimo de 4 a 5 satélites GPS para adquirir e manter um posicionamento preciso). O algoritmo de Z -Blade GNSS Centric trata todos os sinais de satélite disponíveis de forma igual e combina-os para o desempenho ideal.  • Obter e manter soluções RTK mesmo se a cobertura GPS é insuficiente • Confiabilidade na solução em centros urbanos e sob a copa de árvores • Mecanismos de detecção de sinais para rápida aquisição e reaquisição de sinais GNSS • Minimização dos efeitos de multi-caminhamento  A mistura de um desempenho excepcional RTK e design compacto torna o ProMark 800 uma solução RTK extremamente poderosa e atraente para os mais exigentes profissionais. Impermeável, resistente a queda, leve e com bateria de longa duração, o ProMark 800 oferece uma operação durante todo o dia e em todas as condições ambientais.  O ProMark 800 inclui módulos de comunicação sem fios para o máximo de mobilidade e flexibilidade no campo. Sua função de ponte RTC permite um conectar a uma rede um ProMark 800 rover RTK para retransmissão de correções para vários rovers.  • UHF e GSM/GPRS/3.5G • Vários modos de operação e configurações • Suporte estendido de protocolos e formatos de dados  Combine o receptor ProMark 800 com o software de campo, software de escritório e coletor de dados de sua escolha para criar uma solução robusta:  • Survey Pro: fornece um conjunto completo de recursos para todos os seus projetos de levantamento ou locação de pontos • FAST Survey: simplifica a coleta de dados e operação em tempo real • Spectra Precision Survey Office: ideal para o processamento e análise de dados GNSS e de levantamentos ópticos gravados no campo • GNSS Solutions: oferece apoio para uma ampla gama de aplicações.  ESPECIFICAÇÕES TÉCNICAS  - Constelação: GPS/GLONASS/GALILEO/SBAS - Frequência: L1/L2/L5 - Canais: 120 - Taxa de atualização: 0,05 seg - Formato de dados: RTCM 3.1, ATOM, CMR(+) e NMEA - Precisão em tempo real:      RTK (HRMS): 1 cm      DGPS (HRMS): < 30 cm      SBAS (HRMS): < 50 cm - Precisão pós-processada (HRMS): 0,3 mm + 0,5 ppm - Tempo de inicialização: 2 seg  - Alcance de Inicialização: Até 40 km  - Comunicações: UHF, GSM/GPRS/3.5G, BT  - Dimensões: 22,8 x 18,8 x 8,4 cm - Peso: 1,4 kg - Display: LED - Memória: 128 + USB - Temp. de operação: -30°C a 55°C  - Proteção: IP67 / ETS300 019 e EN60945 (choque e vibração) - Alimentação (tipo - duração): 4600 mAh Li-ion / > 8 horas  ITENS INCLUSOS - 1 receptor GNSS Promark 800 - 1 bateria - 1 carregador de bateria - 1 cabo de energia 12V - 1 trena  - 1 cabo USB (hospedeiro) - 1 cabo USB (transferência) - 1 antena GSM - 1 extensor para antena - 1 bolsa de transporte  30% DESTE ITEM SERÁ FATURADO COMO PRESTAÇÃO DE SERVIÇO DE USO DE SOFTWARE - ISS 2%", name: "PROMARK 800 GNSS (UNID.)", manufacturer: "SPECTRA PRECISION", price: "64609.0", price_3x: "21536.0", price_30_days: "62669.0", price_cash: "61379.0", rev_icms18: "61379.0", rev_icms12: "58309.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
