  {code: "990618", description: " SPECTRA PRECISION SOFTWARE FAST SURVEY INTERNO E EXTERNO - PM 100  FAST Survey ™ é um software para uma completa solução de campo projetado para otimizar a funcionalidade, desempenho e controle dos receptores Spectra Precision para aplicações de topografia e construção. FAST Survey fornece suporte inovador e flexível para uma ampla gama de instrumentos e formatos de dados (incluindo outras marcas de receptores GNSS e Estações Totais).  Exibe gráficos FAST Survey é uma interface gráfica, fácil de usar solução de campo. A visualização do mapa escalável exibe pontos e linhas em que são pesquisados, oferecendo impressão de grandes controles para coleta rápida de dados, possui mapas de fundo e linhas de cor diferente a serem definidas pelo usuário. Acesso ao menu por meio de uma interface intuitiva baseada em ícones, menu principal visualizado em todas as telas, facilitando assim o acesso de novas funções.  Software FAST Survey é incluído como padrão nos coletores de dados Spectra Precision: Mobile Mapper 100 ou Ranger.  ", name: "SOFTWARE DE COLETA FAST SURVEY", manufacturer: "SPECTRA PRECISION", price: "2979.0", price_3x: "993.0", price_30_days: "2979.0", price_cash: "2979.0", rev_icms18: "2979.0", rev_icms12: "2829.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "990604", description: "O software MobileMapper Field inclui todos os recursos de GPS que os profissionais de SIG realmente precisam, sem a carga de funções complicadas e raramente utilizadas. Ele também fornece uma interface direta via Bluetooth com dispositivos de tecnologia Laser como os telêmetros TruPulse ou localizadores de cabo 3M Dunatel. O software é muito intuitivo e fácil de usar, o que requer um mínimo de formação, tornando mais fácil para trabalhar com conjuntos de dados GIS.  MobileMapper Field é o programa de campo que roda no Microsoft Windows Mobile ou Windows Embedded Handheld do receptor. Ele permite ao usuário: • Carregar feições (arquivos Shpefile, MapInfo ou de texto) e atualizar seus atributos no campo; • Revisitar feições coletadas e atualizar seus atributos; • Definir novas categorias de feições (camadas) e atribuir o número necessário de atributos para projetos futuros; • Importar e visualizar mapas de fundo para ajudarem a detectar mais facilmente os recursos no campo; • Coletar dados brutos simultaneamente para aumentar a precisão das posições recolhidas. Isto requer a opção de pós-processamento para MobileMapper Field, bem como o uso exclusivo de MobileMapper Office para processar seus dados de campo; • Visualizar o número de satélites e a qualidade dos sinais, mostrando uma vista do céu dos satélites visíveis; • Coletar feições do tipo ponto, linha, polígono, MapInfo e texto, podendo configurar o tempo das coletas e pausar (no caso de linhas e polígonos); • Coletar informações de atributos do tipo texto, menu, imagem, voz, numérico, data, hora e sim/não; • Definir uma etiqueta para cada feição; • Buscar um ponto de coordenadas conhecidas cujos valores são inseridos no software ou selecionar um ponto do projeto para navegar até ele.  MobileMapper Field integra um teclado virtual para tornar mais fácil a introdução de dados. Quando ativado, este teclado aparece automaticamente na tela toda vez que você tocar no interior de um campo de dados editável pelo usuário. O software suporta ainda dados de sensores internos ao receptor utilizados como bússola embutida. ", name: "SOFTWARE DE COLETA MOBILE MAPPER FIELD", manufacturer: "SPECTRA PRECISION", price: "1789.0", price_3x: "596.0", price_30_days: "1739.0", price_cash: "1699.0", rev_icms18: "1609.0", rev_icms12: "1529.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "990646", description: "SPECTRA PRECISION SOFTWARE PROMARK FIELD  Fácil de utilizar e muito intuitivo, o software ProMark field foi concebido para que a utilização do ProMark 100 seja simples e sem problemas. Permite todas as ferramentas necessárias para um levantamento de pós processamento eficiente, assim como, trabalhos  RTK, incluindo gravação de dados brutos, do receptor móvel e configurações base, além de, levantamentos em modo estático ou cinemático, conectividade network ou demarcação. O software ProMark Field dá aos utilizadores do ProMark 100 uma simples, mas potente ferramenta, sem funções desnecessárias nem complicadas.", name: "SOFTWARE DE COLETA PROMARK FIELD", manufacturer: "SPECTRA PRECISION", price: "1889.0", price_3x: "630.0", price_30_days: "1889.0", price_cash: "1889.0", rev_icms18: "1889.0", rev_icms12: "1789.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "702081-04", description: "SPECTRA PRECISION SOFTWARE GNSS SOLUTION  GNSS Solution é um programa interativo e eficaz na obtenção de bons resultados nos levantamentos, oferecendo altos padrões de rendimento, velocidade de processamento, com designer compacto e flexível. • Permite a introdução de dados vetoriais e imagem raster no processamento dos dados e também a exportação deste, como mapa de fundo para os receptores GPS/GNSS da linha Ashtech • Possibilita a geração de relatório de ajustamento • Único software do mercado que realmente permite a utilização de efemérides precisas para longas linhas de base • Possui módulos de ajustamento de redes • Permite a realização de loop para análise de erro de fechamento de figura • Processa dados de receptores GPS e GLONASS L1 e L1/L2 de qualquer receptor GPS/GNSS de dupla frequencia  FÁCIL PROCESSAMENTO DOS DADOS DE CAMPO O GNSS Solutions™ é um programa para escritório com todas as ferramentas necessárias para processar com sucesso os dados dos levantamentos GPS, GLONASS e SBAS. Focando na simplicidade, o GNSS Solutions orienta você através do planejamento, processamento, controle da qualidade, relatórios, exportação dos dados. Possuí ferramentas internas para avançada detecção de erros e análise de qualidade para assegurar precisão e confiabilidade. Fechamentos de polígonos, repetição automática, análise automática das observações e ajustamentos pelos mínimos quadrados são componentes que estão integrados no GNSS Solutions.", name: "SOFTWARE DE PROCESSAMENTO GNSS SOLUTIONS", manufacturer: "SPECTRA PRECISION", price: "4519.0", price_3x: "1506.0", price_30_days: "4379.0", price_cash: "4289.0", rev_icms18: "4289.0", rev_icms12: "4079.0", stock_in: 11, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "63710-00", description: "SURVEY OFFICE -O Spectra Precision Survey Office da Spectra Precision® é ideal para processamento e análise de dados GPS, e exportação dos projetos. O software fornece numerosas características exclusivas e inovadoras e é fácil de se aprender a usar. Com o software Survey Office em seu PC, você terá a possibilidade de trabalhar com dados RTK e Estáticos/PPK para gerar relatórios, bem como identificar e corrigir erros de campo.  Importe dados de levantamentos topográﬁcos existentes ou diretamente da internet e exporte dados como pontos, ou em formato CAD ou XML. Esteja certo que seus dados estarão seguros e serão confiáveis com garantia de qualidade e características de controle de qualidade. O programa intuitivo e integrado Survey Office, economiza tempo com seu aprendizado rápido e com poderosas ferramentas. Dados de levantamentos adquiridos em campo usando uma estação total e contidos em um arquivo de dados podem ser importados para o software e integrados, conforme necessário com outros dados coletados como parte de um projeto de levantamento (por exemplo, dados de GPS ou nível). O software Survey Office é poderoso e ajustável, além de ser fácil de usar  A interface do usuário conta com opções que são familiares a usuários do Microsoft Office, arraste e solte arquivos compatíveis de seu computador diretamente em um projeto aberto e o software Survey Office analisa o arquivo para determinar seu tipo e como ele deve ser processado. Ferramentas de visualização, tais como visualizações de Plano, visualizações em 3D, visualizações de dados em base de tempo e editores de sessão ajudam você a “ver” os dados no contexto do projeto inteiro. O software Survey Office fornece a agrimensores e engenheiros tecnologia avançada, integrando tarefas comuns a um sistema único. Processe e analise dados RTK, Estáticos, Rápido-Estático, stop-and-go e cinemáticos. O Survey Office executa ainda redução de dados, cálculo, QA/QC e ajuste de rede. Dados de controle  podem ser exportados para o software de campo para uso em campo.  CARACTERÍSTICAS E FUNÇÕES - Importar/Exportar, Visualização de exploração do projeto de hierarquia de dados, Visualizações de gráfico (Visualização plana, visualização em 3D), Lista de dados que permitem classificação e seleção de : Planilha de pontos e Planilha de ocupação, Relatórios e planos de garantia de qualidade, Download da internet – para estações base e efemérides precisas, processamento de dados GPS, ajuste de rede, importação de dados RINEX.  MÓDULO BÁSICO - Pós-processamento GPS L1, Relatório de fechamento de ciclo e Ajuste de rede (vetores L1) MÓDULO COMPLETO - Pós-processamento GPS L1/L2, Relatório de fechamento de ciclo  e Ajuste de rede completo. ", name: "SOFTWARE DE PROCESSAMENTO SPECTRA SURVEY OFFICE", manufacturer: "SPECTRA PRECISION", price: "6289.0", price_3x: "2096.0", price_30_days: "6099.0", price_cash: "5969.0", rev_icms18: "5349.0", rev_icms12: "5079.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "BASECAMP", description: "BaseCamp é um download gratuito disponível tanto para o Windows e Mac usuários.  Requisitos do sistema para Windows ® 1-Você deve ter um computador compatível com IBM executando o Windows XP Service Pack 3 ou posterior.  2-Microsoft ®. NET Framework 3.5 SP1 é necessário. A versão atual do. NET será instalado, se necessário.  3-Uma placa de vídeo que suporte OpenGL versão 1.3 ou posterior é necessário para visualizar 3-D terreno.  4-Se você tiver problemas ao interagir com os pontos de vista de mapa, certifique-se de que você tenha instalado os drivers da placa de vídeo atual.  Requisitos do sistema para Mac ®  1-BaseCamp requer um Mac com processador Intel rodando Mac OS 10.5.8 ou superior.  2-1024 MB de RAM é necessária (2048 MB recomendado).  Características:  Importar e visualizar mapas, incluindo TOPO e City Navigator ® série. Criar, editar e organizar rotas, pontos de interesse e muito mais no seu computador. Ver Birdseye imagens de satélite ou mapas Birdseye Select raster, e transferir os dados para o seu dispositivo (assinaturas necessárias). Back-up e arquivamento suas rotas salvas, waypoints, trilhas e fotos georeferenciadas em seu computador. Instalar novos mapas para o seu dispositivo com a ferramenta integrada MapInstall. Criar e compartilhar fotos georeferenciadas. Ver a reprodução de rotas e trilhas. Imprimir página inteira ou de várias páginas de mapas em azulejo. Pesquisar geocaches através integrado OpenCaching apoio. Mantenha o seu dispositivo up-to-date com o WebUpdater .  Planejamento de viagem Use BaseCamp para planejar sua próxima caminhada, ciclismo, motociclismo, conduzir ou off-road viagem. Você pode ver mapas, planejar rotas e pontos de passagem marca e faixas de seu computador e depois transferi-los para o dispositivo.  Desenhe rastrear recurso permite traçar sua rota planejada e visualizar mudanças de elevação, ajudando a estimar a dificuldade de uma caminhada ou passeio de bicicleta. Planeje a rota perfeita cênica, tornando-se o seu navegador leva você através de certos pontos de passagem, para a sua próxima viagem. Reproduzir suas rotas e trilhas ao longo do tempo e salvar e compartilhar sua aventura. Inquérito sobre o Terreno BaseCamp exibe seus dados de mapas topográficos, em 2-D ou 3-D na tela do computador, incluindo as linhas de contorno e perfis de elevação. Carregar os dados do mapa de seu dispositivo portátil, ou mapas de importação você tenha baixado ou comprado em DVD ou cartão microSD ™. Considere nossos mapas TOPO série , que oferecem detalhes sobre uma escala de 1:100.000 ou seja 1:24,000.  Fotos geotag BaseCamp permite-lhe fotos geotag, associando-os com pontos específicos. Você pode ver o cenário exato em qualquer local determinado. Transferir as fotos para o seu dispositivo portátil, publicar fotos diretamente para o Picasa ™, ou enviar e-mail suas fotos georeferenciadas diretamente para os amigos ou a família para que eles possam navegar direito de seus lugares favoritos no futuro.  Criar e Compartilhar Adventures Garmin Adventures oferece uma maneira livre interativo para compartilhar suas caminhadas, passeios de bicicleta, passeios de estrada e muito mais. Usando BaseCamp, você pode combinar registos de traçado, pontos de interesse, fotos com geotags, vídeos do YouTube ® e muito mais para uma aventura que é publicado online. Você pode então enviar e-mail um link para a sua aventura para os amigos e familiares, compartilhá-lo em sites de mídia social ou mesmo postar em seus fóruns favoritos. BaseCamp torna ainda mais fácil de seguir os passos de outros viajantes, permitindo-lhe procurar e baixar aventuras.  Transferir Imagens de Satélite Com BaseCamp e imagens de satélite Birdseye assinatura, você pode transferir uma quantidade ilimitada de imagens de satélite para o seu dispositivo ao ar livre ou de fitness e integrar essas imagens em seus mapas para obter uma verdadeira representação de seu entorno. Isso torna mais fácil para explorar parques de campismo, fontes de água, riscos potenciais e muito mais. Se preferir mapas raster topográficos, você também pode fazer download de mapas Birdseye Select e pagar apenas os dados que você baixar.  Link para download: http://www8.garmin.com/support/download_details.jsp?id=4435", name: "SOFTWARE GARMIN BASECAMP", manufacturer: "GARMIN BR", price: "-1.0", price_3x: "0.0", price_30_days: "-1.0", price_cash: "-1.0", rev_icms18: "-1.0", rev_icms12: "-1.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "GEOOF/GPS USB", description: "SISTEMA GEOOFFICE GPS O Geoffice GPS é uma ferramenta de automação desenvolvida para auxiliar no armazenamento e manipulação de dados de GPS de navegação, confecção de mapas, etc.  Principais Aplicativos.: - Criação, Edição e Remoção de Trilhas, Rotas e Waypoints facilmente; - Ferramentas para adição, união e quebra de trilhas; - Localização de Waypoints e Trilhas de maneira rápida; - Diversas opções de Zoom; - Desenhos a Mão - Livre; - Cálculo de área e distância por seleção de Trilhas ou por seleção de Regiões; - Cálculos de ângulo e azimute elipsoidal; - Inserção de Textos; - Banco de dados com referências de diferentes datums; - Inserção de imagens no desenho. (Imagens de Satélite e Metafile); - Geo-referenciamento de imagens; - Traçado do Perfil das Trilhas; - Perfil – Elevação. (com o GPS em movimento conectado a um notebook); - Editar Planilhas; - Seleção de Coordenadas; - Planilha com informações dos WayPoits, Trilhas e Rotas, com todas as informações que o GPS disponibiliza e também, nas Trilhas são fornecidas as informações de Azimute ou Rumo e Distância das mesmas; - Interface com o Google Earth; - Navegação automática através do GPS conectado ao computador; - Impressão de Mapas em Escala e Desenho das Margens e Selo; - Exportação e Importação de diversos formatos de arquivo; - Mouse Wheel – pressionando funciona como PAN; - Mouse Wheel – girando funciona como Zoom Dinâmico; - Compatível com Windows 95, 98, ME, NT, 2000, XP e Vista;  - Chave de proteção para uso em porta USB.", name: "SOFTWARE GPS USB", manufacturer: "SOLUTION SOFTWARES", price: "219.0", price_3x: "73.0", price_30_days: nil, price_cash: "209.0", rev_icms18: "209.0", rev_icms12: "199.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
