  {code: "010-00950-01BR", description: "DETALHES  Com a melhor tecnologia de rastreamento de alvos e monitor em escala de cinza de 4 polegadas, o echo 100 apresenta um novo nível de capacidade de pescaria para o comprador preocupado com o orçamento. Valorize o seu dinheiro Graças a exclusiva tecnologia de rastreamento HD-ID da Garmin, você terá separação aprimorada e definição de imagens no monitor em escala de cinza de 4 polegadas com rápida atualização do echo 100. O transmissor com feixe único (200 kHz) e potência de sonar de 100 watts (RMS) permite que você verifique profundezas de até 600 pés – suficiente para a maioria dos lagos de água doce. Economize espaço valioso O design compacto do echo 100 faz dele a companhia perfeita até mesmo para embarcações menores. E ainda mais, a montagem inclinada com desengate rápido e o transdutor com montagem em gio estão inclusos no pacote para instalação em instantes. Recursos do echo 100: Tecnologia Garmin HD-ID™ Design compacto para barcos menores Potência de transmissão de 100 watts (RMS) 600 pés de profundidade 60 graus de largura de feixe Monitor em escala de cinza FSTN de 8 níveis, 4 polegadas Instalação com suporte inclinado/giratório, transdutor, braçadeira para motor de proa e montagem em gio Conteúdo da caixa: echo 100 Montagem com desengate rápido com giro e inclinação Cabo de alimentação Transdutor com suporte de montagem, hardware e braçadeira para motor de proa Documentação.", name: "Sonar Garmin echo 100", manufacturer: "GARMIN BR", price: "499.0", price_3x: "166.0", price_30_days: "499.0", price_cash: "499.0", rev_icms18: "499.0", rev_icms12: "469.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
