  {code: "94334-00-2PP", description: "O Spectra Precision SP80 é um receptor GNSS de nova geração que combina tecnologia RTK com o novo e revolucionário processamento GNSS.  Possui a Tecnologia de processamento de Z –Blade, exclusive da Spectra Precision, rodando em um equipamento de última geração com 240 canais e tecnologia única 6G ASIC, o qual utiliza plenamente todos os 6 sistemas GNSS : GPS, GLONASS, Beidou, Galileo, QZSS e SBAS. A capacidade única GNSS-centric combina de forma otimizada sinais GNSS, sem dependência de qualquer sistema GNSS específico, permitindo operações no modo GLONASS somente ou Beidou, caso seja necessário.  O SP80 tem uma combinação única de tecnologias de comunicação, incluindo um modem integrado 3.5G GSM/UMTS, Bluetooth, conectividade Wi-Fi e rádio UHF interno opcional. O modem celular pode ser usado para SMS (mensagem de texto) e e-mails de alerta, bem como conexão com internet para trabalhos na técnica RTK via GSM ou VRS (Virtual Reference Station), utilizando o conceito de redes. Da mesma forma, o SP80 pode se conectar à internet no campo usando sinal Wi-Fi, quando houver disponível.  A exclusiva tecnologia Anti-Theft (anti-roubo) protege o SP80 quando estiver no campo em lugares remotos ou públicos e pode detectar se o produto é movido ou roubado. Esta tecnologia permite que o operador bloqueie o dispositivo para a posição na qual ele se encontra e inutilizá-lo, caso ele seja movido para outro local. Além disso, uma mensagem SMS ou e-mail será enviado para o telefone ou computador do operador, fornecendo as coordenadas atuais do receptor, permitindo o rastreamento de sua posição.  Com a tecnologia de baterias duplas hot-swappable pode-se facilmente trocá-las em campo para um dia de trabalho sem interrupção. Seu revestimento em fibra de vidro reforçado, resistente ao impacto, garante que SP80 possa lidar com as mais difíceis condições ao ar livre. A antena UHF patenteada, situada no interior do bastão de fibra de vidro resistente, amplia a gama de desempenho de rádio RTK. O visor de LED visível à luz solar oferece acesso instantâneo às informações principais do produto.  Os softwares de coleta Spectra Precision Survey Pro ou Fast Survey são desenvolvidos especificamente para o receptor GNSS SP80, propiciando um fluxo de trabalho fácil e tranquilo, porém muito poderoso e completo. O software de processamento Spectra Precision Survey Office fornece um conjunto completo de ferramentas para pós-processamento de dados GNSS e ajustamento dos dados, bem como a exportação dos resultados processados para locação em campo ou para formatos de softwares de CAD.  ESPECIFICAÇÕES TÉCNICAS  - Constelações: GPS / GLONASS / Beidou / Galileo / QZSS / SBAS  - Freqüências: L1/L2/L5  - Canais: 240  - Taxa de atualização: 0,05 seg.  - Precisão pós-processada (HRMS): 0,3 mm + 0,5 ppm  - Precisão em tempo real:      DGPS (HRMS): <25 cm      SBAS (HRMS): <50 cm  - Comunicações: Wi-Fi, GSM/UMTS/3.5G, BT  - Dimensões: 22,2 x 19,4 x 7,5 cm - Peso: 1,17 kg - Display: LED (gráfico e texto)  - Memória: 2 GB + SD card - Temp. de operação: -40°C a 65°C  - Proteção: IP67 / ETS300 019 e MIL-STD-810F (choque e vibração) - Alimentação (tipo - duração): 2x2600 mAh / aprox. 10 horas  KIT COMPOSTO DE:  - 2 receptores GNSS SP80 - 1 software de processamento Survey Office - 2 bastões de fibra de carbono p/ GPS - 2 tripés para bastão - 4 baterias (Li-Ion, 2.6Ah, 7.4V 19.2 Wh) - 2 carregadores duplos para a baterias - 2 fontes de alimentação (65W, 19V, 3.42A, 100-240V A/C) - 2 cabos de alimentação com conector C7 - 1 trena de 3,60m - 1 bastão extensivel de 7cm  - 1 cabo USB  - 1 estojo rígido com mochila inclusa - 1 manual do equipamento em português", name: "SP80 GNSS PÓS-PROCESSADO (PAR)", manufacturer: "SPECTRA PRECISION", price: "77919.0", price_3x: "25973.0", price_30_days: "77919.0", price_cash: "75579.0", rev_icms18: "77919.0", rev_icms12: "74019.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, av