e, amplia a gama de desempenho de rádio RTK. O visor de LED visível à luz solar oferece acesso instantâneo às informações principais do produto.  Os softwares de coleta Spectra Precision Survey Pro ou Fast Survey são desenvolvidos especificamente para o receptor GNSS SP80, propiciando um fluxo de trabalho fácil e tranquilo, porém muito poderoso e completo. O software de processamento Spectra Precision Survey Office fornece um conjunto completo de ferramentas para pós-processamento de dados GNSS e ajustamento dos dados, bem como a exportação dos resultados processados para locação em campo ou para formatos de softwares de CAD.  O coletor de dados Spectra Precision T41 é robusto, poderoso, compacto e oferece alta performance com um display legível ao ar livre de alta resolução. O design ergonômico e fino torna-o fácil de segurar e permite o uso durante todo o dia. Sua nova tela touch-screen capacitiva protegida por uma película de vidro fornece proporciona a capacidade de toque na tela com a ponta dos dedos. O T41 funciona também como celular, tendo capacidade de transmissão de dados devido seu modem 3.75G para uso com redes VRS, além de recursos de voz e SMS. Sua câmera de 8 megapixels pode ser configurada para incluir automaticamente o tempo e os dados de localização do receptor GPS integrado.   ESPECIFICAÇÕES TÉCNICAS  • SP80  - Constelações: GPS / GLONASS / Beidou / Galileo / QZSS / SBAS  - Freqüências: L1/L2/L5  - Canais: 240  - Taxa de atualização: 0,05 seg.  - Formato de dados: RTCM 2.1, 2.3, 3.1, 3.2, ATOM, CMR (+), NMEA - Precisão pós-processada (HRMS): 0,3 mm + 0,5 ppm  - Precisão em tempo real:      RTK (HRMS): 0,8 mm      DGPS (HRMS): <25 cm      SBAS (HRMS): <50 cm  - Tempo de inicialização: 2 seg  - Alcance de Inicialização: Até 40 km  - Comunicações: Wi-Fi, UHF 2W TRx, GSM/UMTS/3.5G, BT  - Dimensões: 22,2 x 19,4 x 7,5 cm - Peso: 1,17 kg - Display: LED (gráfico e texto)  - Memória: 2 GB + SD card - Temp. de operação: -40°C a 65°C  - Proteção: IP67 / ETS300 019 e MIL-STD-810F (choque e vibração) - Alimentação (tipo - duração): 2x2600 mAh / aprox. 10 horas  • SP80  - Processador: 1GHz - Memória RAM: 512 MB / Flash: 16 GB + micro SD até 32GB - Tela: 4,3\" WVGA TFT / 480 x 800 pixel - Câmera: 8 Megapixels - Sistema operacional: Windows Handheld 6.5 - GPS integrado (2-4m de acurácia) - Comunicações: Wi-fi, Bluetooth e porta serial 9 pinos  - Proteção: IP65 - Temp. de operação: -30ºC a 60ºC - Dimensões: 15,5 cm x 8,2 cm x 2,5 cm - Peso: 0,4 Kg  KIT COMPOSTO DE:  - 2 receptores GNSS SP80 - 1 rádio interno UHF (410-470 Mhz 2W TRx) - 1 coletor de dados T41 - 1 suporte para coletor de dados - 1 carregador de bateria + cabo USB para T41 - 1 rádio externo 35W ADL Vantage Pro - 1 antena do rádio externo (c/cabos) - 1 software de processamento Survey Office - 2 bastão de fibra de vidro 2m (com bolsa) - 1 tripé para bastão - 4 baterias (Li-Ion, 2.6Ah, 7.4V 19.2 Wh) - 2 carregadores duplos para a baterias - 2 fontes de alimentação (65W, 19V, 3.42A, 100-240V A/C) - 2 cabos de alimentação com conector C7 - 1 trena de 3,60m - 1 bastão extensivel de 7cm  - 1 cabo USB  - 1 estojo rígido com mochila inclusa - 1 tripé de alumínio - 1 base nivelante com adaptador - 1 manual do equipamento em português ", name: "SP80 GNSS RTK (PAR) C/ RÁDIO EXT. 35W - T41", manufacturer: "SPECTRA PRECISION", price: "116759.0", price_3x: "38920.0", price_30_days: "116759.0", price_cash: "113259.0", rev_icms18: "116759.0", rev_icms12: "110919.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
