  {code: "010-11254-20", description: nil, name: "TIRA ELAST P/CINTA MONITOR", manufacturer: "GARMIN BR", price: "139.0", price_3x: "46.0", price_30_days: "129.0", price_cash: "129.0", rev_icms18: "129.0", rev_icms12: "129.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "PRO DOUBLE", description: "O GTM PRO®, destina-se a uma parcela de usuários que utiliza o GPS profissionalmente, ou seja, necessitam de cálculo de área, transferência de dados para o Excel®, exportação para o AutoCad® e ArcView®, e outras funções avançadas. Geralmente são empresas, engenheiros, agrimensores, peritos judiciais, corretores de imóveis ou pessoas que querem utilizar o GPS como ferramenta auxiliar a levantamentos topográficos mais precisos, realizados com teodolito, estação total ou outros equipamentos topográficos de precisão.    O programa utiliza uma chave de hardware ou dongle que é um plugue eletrônico fabricado pela Geo Studio que funciona como uma senha de liberação. O plugue é facilmente conectado a uma das portas USB, e deve estar presente quando o programa GPS TrackMaker Professional® estiver sendo executado.  A chave de hardware possui as seguintes vantagens: - Você nunca perderá a licença da versão que adquiriu enquanto tiver a chave.  - Se você reformatar, peder ou vender seu computador, basta instalar o programa em outro computador e conectar a chave para utilizá-lo. - Permite transferir a licença facilmente de um computador para outro. - Não necessita ativação pela internet ou pelo telefone.  Principais Características do GTM PRO®  O GTM PRO® é o mesmo GPS TrackMaker® gratuito disponível na Internet, com os seguintes acréscimos:   - Permite criar projetos completos de Mapas (arquivos MAP e PJC)  - Rotação de imagens para uma calibração precisa  - Recorte de Imagem  - Função Expandir Zona que permite calibrar mapas localizados em duas ou mais zonas  - Suporte pata imagens GeoTiff (TIFF geocodificado)  - Suporte para arquivos DRG (Digital Raster Graphic)  - Abre e grava imagens BMP, JPG, GIF, TIFF, PNG, PCX  - Suporte para Plano Cartográfico e Plano Topográfico  - Calculo de áreas cartográficas delimitadas por Trilhas  - Cálculo da áreas locais topográficas delimitadas por Trilhas  - Cálculo de distâncias topográficas locais  - Cálculo de distâncias da projeção horizontal ou considerando as altitudes  - Função de conversão topográficas dos dados obtidos do GPS  - Importação e exportação para o AutoCad®, no formato DXF  - Importação e exportação para o ArcView®, no formato SHP  - Tratamento de dados em tabelas semelhantes ao Microsoft Excel®  - Exportação de arquivos no formato XLS (Excel® 95)  - Exportação de arquivos no formato DBF (dBase® IV)  - Exportação de arquivos MIF/MID (MapInfo®)  - Função Visualizar Impressão  - Importação e exportação de dados para editores de texto  - Criação de múltiplos estilos de Waypoints, para mapas mais detalhados  - Datum definido pelo usuário  - Grade Retangular definida pelo Usuário (User Grid)  - Sistemas LTM e RTM de coordenadas  - Ferramenta de União de Trilhas  - Cálculo de média da posição geodésica de Waypoints, Trilhas e Rotas  - Rotação de dados  - Perfil de Altitudes com funções avançadas  - Ferramenta para aplicar altitudes em curvas de nível  - Criação de Trilhas de perfil de altitudes a partir de curvas de nível  - Ferramenta de remoção de acentos  - Ferramenta de Recorte Retangular para mapeamentos avançados  - Fator de escala e Convergência Meridiana UTM  - Tabela de azimutes, velocidades e distâncias  - Cálculo de aminutes com precisão de centésimos de segundo  - Permite restaurar o aspecto original de imagens - Ferramenta de filtro de datas  - Rastreamento de múltiplos veículos com os rastreadores da Geo Studio  - Relatórios completos de endereço por onde o veículo passou   Contém 2 chaves de ativação. ", name: "TRACK MAKER COM 2 HARD", manufacturer: "TRACK MAKER", price: "449.0", price_3x: "150.0", price_30_days: "449.0", price_cash: "439.0", rev_icms18: "439.0", rev_icms12: "409.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
