  {code: "010-01088-01", description: "Gravação em True HD A VIRB grava vídeos True HD de 1080p que permitem que você reviva cada minuto de sua aventura em todos os detalhes, com alto contraste e sem distorções. Além de 1080p a 30fps, você pode ajustar a resolução e velocidade de filmagem para claras e dramáticas cenas em câmera lenta a até 120fps. E tudo isso visto por nossas lentes WideVü e processado pelo sensor CMOS de 16 megapixels para a maior qualidade de vídeo, mesmo antes de começar a edição. Múltiplos modos de vídeo HD: 1080p a 30fps, 960p a 48fps, 720p a 30/60fps, 848x480 a 120fps.  Visor Chroma de 1,4\" Por que espremer um botão e esperar que a cena tenha saído boa quando você pode configurar, visualizar e reproduzir vídeos em um visor cromático totalmente colorido integrado? O visor de 1,4\" na VIRB também é a sua janela para entrar nas configurações do menu. Verifique a cena antes de passar, escolha o modo de câmera lenta ou alterne entre vídeo e fotos estáticas. Está tudo na tela e a tela está sempre ligada (mas usando um mínimo de energia).  Long Battery Life Bateria de longa duração A VIRB possui uma bateria de íons de lítio de 2000 mAh líder da categoria que foi testada em gravações de 3 horas a 1080p. O que significa que existe uma boa chance de você ficar cansado antes que a bateria termine. Para recarregar basta conectá-la ao computador ou a uma tomada. Aumente o tempo de filmagem levando com você uma bateria sobressalente (vendida separadamente) para as suas aventuras por todo o dia.  Elegante e fácil de usar A VIRB foi projetada para ser usada com facilidade por um grande e instantâneo controle deslizante de gravação na lateral da câmera. O controle que desliza e clica facilita saber o que está sendo gravado, mesmo com luvas. O design geral da câmera é tanto elegante como resistente, o que ajuda a integrar a VIRB a suas atividades sem ter que trabalhar com uma câmera pesadona. Portanto, você pode fazer seu passeio de esqui, de tirolesa ou mesmo de trenó sabendo que conseguirá uma boa tomada.  Controle a VIRB remotamente A VIRB usa conectividade sem fio ANT+™ para permitir que você use seu produto Garmin compatível, como ofenix™, o Oregon® e o Edge® como controles remotos. E, no final de 2013, teremos um dispositivo de controle remoto dedicado funcionando com a mesma conectividade ANT+, de modo que você não terá que tirar as mãos do guidom nem remover a câmera do suporte para parar e iniciar gravações para fazer imagens estáticas.  Digital Image Stabilization and More Estabilização de imagens digitais e muito mais Com o recurso Estabilização de imagens digitais ativado, a VIRB acrescenta um pouco mais de estabilidade a passeios sacolejantes e aventuras, de modo que você possa compartilhar um vídeo mais uniforme com seus amigos. Além disso, a Correção de distorção de lentes (LDC) funciona para aprimorar a qualidade do vídeo, mesmo antes de você começar a editar.  Fotos de alta definição A VIRB também é uma câmera fotográfica digital de alta potência. com captura de fotos de 16 megapixels e LDC, suas fotos serão mais nítidas, mais claras e menos distorcidas. Fotografe a 16 megapixels, 12 megapixels ou 8 megapixels como uma única foto (no botão de câmera ou por controle remoto) ou escolha Photo Burst ou Time Lapse. E tudo isso é processado pelo processador CMOS de 16 megapixels para imagens de alta qualidade.  Faça fotos e vídeos simultaneamente Não perca um momento de vídeo só para tirar uma foto. A VIRB permite que você tire fotos estáticas ao mesmo tempo em que grava um vídeo com um simples toque do botão, seja pelo dispositivo remoto Garmin compatível ou pela própria câmera.  Suportes A ampla variedade de suportes da VIRB permite que você prenda a câmera firmemente na posição em praticamente qualquer lugar. De conveses e painéis curvos e planos a guidons, capacetes, alças e tiras multiuso e muito mais, os suportes da VIRB servem para o que você precisa. As junções dos suportes da VIRB possuem juntas com intertravamento que agarram ao invés de confiar somente na tensão. Isso proporciona um desempenho de travamento antivibrações mais resistente e durável. Nós até oferecemos um adaptador que permite que você use a VIRB com outros suportes do setor.  Estojo de mergulho opcional A VIRB é resistente e à prova d'água até (IPX7¹) sem mais proteção alguma. Para mergulhos mais profundos e exposições mais prolongadas, o estojo de mergulho opcional aumenta a resistência à água para 50 metros.  Na Caixa Câmera de ação VIRB Bateria de íons de lítio Base Link curto Link em ângulo reto Adaptador para suportes populares do setor Montagem em superfície plana Montagem em superfície curva Base em flange removível Anel roscado Botões (3) Cabo USB Documentação", name: "VIRB", manufacturer: "GARMIN BR", price: "1799.0", price_3x: "600.0", price_30_days: "1799.0", price_cash: "1749.0", rev_icms18: "1749.0", rev_icms12: "1659.0", stock_in: nil, stock_out: nil, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-01088-11", description: "Gravação em True HD A VIRB Elite grava vídeos True HD de 1080p que permitem que você reviva cada minuto de sua aventura em todos os detalhes, com alto contraste e sem distorções. Além de 1080p a 30fps, você pode ajustar a resolução e velocidade de filmagem para claras e dramáticas cenas em câmera lenta a até 120fps. E tudo isso processado por um sensor CMOS de 16 megapixels, de modo que você obtém a maior qualidade de vídeo e arquivos de tamanhos mais gerenciáveis para edição e compartilhamento. Múltiplos modos de vídeo HD: 1080p a 30fps, 960p a 48fps, 720p a 30/60fps, 848x480 a 120fps.  Visor Chroma de 1,4\" Por que espremer um botão e esperar que a cena tenha saído boa quando você pode configurar, visualizar e reproduzir vídeos em um visor Chroma totalmente colorido integrado? O visor de 1,4\" na VIRB também é a sua janela para entrar nas configurações do menu. Verifique a cena antes de passar, escolha o modo de câmera lenta ou alterne entre vídeo e fotos estáticas. Está tudo na tela e a tela está sempre ligada (mas usando um mínimo de energia).  Bateria de longa duração A VIRB Elite possui uma bateria de íons de lítio de 2000 mAh líder da categoria que foi testada em gravações de cerca de 3 horas a 1080p. O que significa que existe uma boa chance de você ficar cansado antes que a bateria termine. E, com várias opções de carregamento (vendidas separadamente) você aproveitará um bocado. Aumente o tempo de filmagem levando com você uma bateria sobressalente (vendida separadamente) para as suas aventuras de dia todo.  Conexão sem fio a smartphones A VIRB Elite é equipada com Wi-Fi para comunicação sem fio com smartphones ou computadores. O Wi-Fi permite ver a visualização da imagem. Controle de reprodução e ajuste das configurações da câmera. Além de gravar e parar a câmera, bem como tirar fotos estáticas remotamente, mesmo quando a câmera está filmando.  Filme a corrida, não a linha de chegada A VIRB Elite possui GPS de alta sensibilidade para marcação de dados e perfis de gravação \"inteligentes\" por GPS, como o modo Esqui, que grava automaticamente enquanto você desce a pista e para de filmar enquanto você se aquece com um chocolate quente ou quando chega na linha de chegada.  Sensores, sensores e mais sensores A conectividade sem fio ANT+™ da VIRB Elite também funciona com sensores externos da Garmin. Combine com o sensor de temperatura sem fio tempe™, o sensor de velocidade/cadência para bicicleta e o monitor de batimentos cardíacos Premium para incluir as informações reveladas pelos sensores nos seus vídeos, como o seu ritmo cardíaco na sua última corrida de bicicleta ou enquanto você admira o Grand Canyon. A Elite também possui um acelerômetro e um altímetro integrado para marcação de dados e perfis de filmagem personalizados.  Elegante e fácil de usar A VIRB Elite foi projetada para ser usada com facilidade por um grande e instantâneo controle deslizante de gravação na lateral da câmera. O controle que desliza e clica facilita saber o que está sendo gravado, mesmo com luvas. O design geral da câmera é tanto elegante como resistente, o que ajuda a integrar a VIRB a suas atividades sem ter que trabalhar com uma câmera pesadona. Portanto, você pode fazer seu passeio de esqui, de tirolesa ou mesmo de trenó sabendo que conseguirá uma boa tomada (e, quem sabe, o melhor tempo).  Controle a VIRB remotamente A VIRB Elite usa conectividade sem fio ANT+™ para permitir que você use seu produto Garmin compatível, como o fenix™, o Oregon® e o Edge® como controles remotos. Com a VIRB Elite, você também aproveita as vantagens do Wi-Fi, de modo que pode parar e começar a gravar ou capturar imagens estáticas de modo sem fio com seu smartphone ou dispositivo Garmin compatível. Agora, você não precisa mais ter que tirar suas mãos do guidom ou remover a câmera do suporte para captar aquela cena perfeita.  Estabilização de imagens digitais e muito mais Com o recurso Estabilização de imagens digitais ativado, a VIRB Elite acrescenta um pouco mais de estabilidade a passeios sacolejantes e aventuras, de modo que você possa compartilhar um vídeo mais uniforme com seus amigos. Além disso, a Correção de distorção de lentes (LDC) funciona para aprimorar a qualidade do vídeo, mesmo antes de você começar a editar.  Fotos de alta definição A VIRB Elite também é uma câmera fotográfica digital de alta potência. Com captura de fotos de 16 megapixels e LDC, além das lentes WideVü (Ampla/Média/Estreita) para tornar suas fotos mais nítidas, mais claras e menos distorcidas. Fotografe a 16 megapixels, 12 megapixels ou 8 megapixels como uma única foto (no botão de câmera ou por controle remoto) ou escolha Photo Burst ou Time Lapse. E tudo isso é processado pelo processador CMOS de 16 megapixels para imagens de alta qualidade e arquivos com tamanhos mais gerenciáveis.  Faça fotos e vídeos simultaneamente Não perca um momento de vídeo só para tirar uma foto. A VIRB Elite permite que você tire fotos estáticas ao mesmo tempo em que grava um vídeo com um simples toque do botão, seja pelo dispositivo Garmin compatível ou pela própria câmera.  Suportes A ampla variedade de suportes da VIRB Elite permite que você prenda a câmera firmemente na posição em praticamente qualquer lugar. De conveses e painéis curvos e planos a guidons, capacetes, alças e tiras multiuso e muito mais, os suportes da VIRB servem para o que você precisa. As junções dos suportes da VIRB possuem juntas com intertravamento que agarram ao invés de confiar somente na tensão. Isso proporciona um desempenho de travamento antivibrações mais resistente e durável. Nós até oferecemos um adaptador que permite que você use a VIRB com outros suportes do setor.  Estojo de mergulho opcional A VIRB Elite é resistente e à prova d'água conforme o padrão IPX7¹ sem mais proteção alguma. Para mergulhos mais profundos e exposições mais prolongadas, o estojo de mergulho opcional aumenta a resistência à água para 50 metros.  ¹Proteção contra imersão em água por 30 minutos à profundidade de 1 metro.  Na Caixa: Câmera de ação VIRB Elite Bateria de íons de lítio Base Link curto Link em ângulo reto Adaptador para suportes populares do setor Montagem em superfície plana Montagem em superfície curva Base em flange removível Anel roscado Botões (3) Cabo USB Documentação", name: "VIRB ELITE GPS", manufacturer: "GARMIN BR", price: "2199.0", price_3x: "733.0", price_30_days: "2199.0", price_cash: "2129.0", rev_icms18: "2129.0", rev_icms12: "2029.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-01225-00", description: nil, name: "VIVOFIT PRETO", manufacturer: "GARMIN BR", price: "599.0", price_3x: "200.0", price_30_days: "599.0", price_cash: "599.0", rev_icms18: "589.0", rev_icms12: "559.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0},
  {code: "010-01225-30", description: "Visualize a mudança que você deseja ser Bastar olhar para o visor de fácil leitura e você saberá quantos passos deu, a distância percorrida, as calorias queimadas e a hora do dia. Metas diárias personalizadas O vívofit aprende seu nível de atividade atual e, em seguida, atribui uma meta diária que pode ser alcançada. Quando você atingir seus marcos, o vívofit ajustará sua meta para o próximo dia, incentivando você gradativamente para um estilo de vida mais saudável. No site Garmin Connect™, você pode ganhar medalhas virtuais e ver seu progresso a cada dia, mês ou semana. Seus dados em fácil visualização Não há necessidade de parar e sincronizar seus dados para ver seu progresso. O vívofit armazena seus dados diretamente no seu pulso. Mais tarde, apenas com o toque de 1 botão, você pode fazer a sincronização sem fio com o Garmin Connect, nossa comunidade de treinamento online gratuita. Marca a hora e a avisa a \"hora de se mexer\" Pesquisas mostram que períodos prolongados de inatividade, como ficar muito tempo sentado atrás de uma mesa no escritório, diminui a produção de enzimas de queima de gordura de seu corpo. Você pode reverter esse efeito fazendo pausas para caminhadas curtas e frequentes durante seu dia. E caso você se distraia e se esqueça de se movimentar, o vívofit o lembrará. Uma barra de movimentação vermelha aparece no visor após 1 hora de inatividade e aumenta quando você fica muito tempo sentado. Caminhe por alguns minutos para zerar a barra de movimentação. Sempre ligado O vívofit acompanha seu progresso 24 horas por dia e pode continuar ativo por mais de um ano sem troca de bateria. Defina o modo de espera quando for dormir, e o vívofit monitorará seu descanso. Na página do Garmin Connect, você pode ver o total de horas de sono, bem como os períodos de movimentação e de sono repousante. A pulseira vívofit é resistente à água2, o que significa que você pode tomar banho ou chuva e não se preocupar. Fique conectado Em nossa comunidade online gratuita, o Garmin Connect, você verá um retrato completo do seu progresso e poderá organizar sua página inicial para exibir os dados mais importantes para você. Também é possível participar de competições online e ganhar medalhas virtuais para motivação extra. Esse recurso permite que você se conecte, faça competições e compare os resultados com amigos e familiares ao redor do mundo. Os desafios do Garmin Connect são uma ótima maneira de se acostumar a hábitos saudáveis. Se você já possui um dispositivo para fitness da Garmin, como o Forerunner® ou o Edge®, o vívofit pode acompanhar toda a sua atividade e tempo de recuperação entre as sessões de treino, e você pode rever todos os dados disponíveis no Gamin Connect. Disponível para seu computador ou dispositivo móvel compatível3.", name: "VIVOFIT PRETO HRM BUNDLE", manufacturer: "GARMIN BR", price: "699.0", price_3x: "233.0", price_30_days: "699.0", price_cash: "699.0", rev_icms18: "689.0", rev_icms12: "649.0", stock_in: 0, stock_out: 0, deleted_at: nil, subscribed_users: #<Set: {}>, avatar_file_name: nil, avatar_content_type: nil, avatar_file_size: nil, avatar_updated_at: nil, stage: "active", assigned_to: nil, user_id: nil, access: 0}
